INSERT INTO additional VALUES ('24', 'Ближний бой', '24', '10', '15', '20', 'fight', 'Увеличивает у всей армии навых ближнего боя на 10%', 'Увеличивает у всей армии навых ближнего боя на 15%', 'Увеличивает у всей армии навых ближнего боя на 20%');
