INSERT INTO additional VALUES ('26', 'Удача', '26', '5', '10', '15', 'luck', 'Даёт 5% шанс повторить атаку существу во время битвы', 'Даёт 10% шанс повторить атаку существу во время битвы', 'Даёт 15% шанс повторить атаку существу во время битвы');
