INSERT INTO clans VALUES ('Devil Fighters', 'Maloy', 'Способностей в клане пока нету.\r\nP.S. они появятся когда админ их напишет!', 'http://nld.spb.ru/forums/viewtopic.php?p=97#97', 'ftp://maloy.local/upload/7.gif', 'http://nld.spb.ru/images/clans/13war.jpg', '10', '0', '0', '0', '0');
INSERT INTO clans VALUES ('Мастера смерти', 'Lord-pasa', 'Стояла мертвая тишина. Высоченные сосны прятали в своих кронах последние лучи солнца. У подножий уже мягко расстелилась тьма. Тьма… она была живая. От каждого ствола отделилась тень. Вернее, это была не тень, ведь в полной темноте теней не бывает. Их можно было только почувствовать. Почувствовать сердцем. А еще увидеть. Но только для этого нужно особое зрение. Только сквозь реальность можно было что-либо разглядеть. Их не было в этом мире, но они питались. И питались они кровью. Они уходили так же незаметно, как и появлялись. Еще никому не удавалось их поймать. Они шли обычно на запах. На запах теплой крови. Крови, еще текущей по венам. Каждую ночь, после захода солнца, но до того, как появлялась луна, они выходили на охоту. Их жертвами становились мирные жители, вампиры и священники, и даже те, кто не смог выбрать ни путь тьмы, ни путь света… они умели двигаться сквозь время и пространство. Они были всюду и нигде. И скрыться от них было невозможно… даже днем, когда солнце царствовало на небосводе, сердце сжималось от страха. От страха быть замеченным и попасть в список жертв… и имя нагоняющим страх было BloodHuntes! И даже в данный момент они стоят за твоей спиной и ждут своего часа! И только самый внимательный и везучий может случайно заметить пронзительный взгляд их желтых глаз... \r\n', '', '', '', '10', '11707337', '0', '0', '0');
