INSERT INTO clans VALUES ('BloodmooN', 'DAYSTORM', 'Сумрак окутывал землю, день с каждым мгновением отступал, и в свои владения входила ночь. Покровительница темноты и страха. Серое небо постепенно темнело, приобретая более глубокий темный окрас. Звезд почти не было видно из-за густого тумана, который покрывал небо, из-за чего оно выглядело зловеще. Но сквозь туман можно было разглядеть неясные очертания полной луны. Полнолуние… много страшного связывали с ним испокон веков. Время загадочных и мистических происшествий, которым не было объяснения. Люди в городе старались держаться подальше от уединенных улочек и в основном предпочитали сидеть дома…особенно они боялись приближаться к лесу. Плотной непроницаемой стеной стояли угрюмые деревья. Кроны закрывали любой отблеск света, и даже спокойное сияние луны не проникало в лес. Сегодня, в этой наступающей темноте лес, казалось, замер, предвкушая последствия этой ночи. И только холодный и резкий ветер срывал с деревьев листву и уносил прочь. Поистине лес выглядел устрашающе. Вряд ли бы нашелся смельчак, который рискнул бы приблизиться этой ночью к лесу. Но ни смотря, ни на что, на большом, поросшем мхом камне у самого начала леса сидел человек. Взор его был прикован к маленькому блеклому кругу, который иногда появлялся сквозь густые клочья тумана. Человек смотрел на луну… он ждал полночи… Он знал, что придет его час и ожидал его размышляя. Он мысленно прокручивал свою жизнь с самого начала, не только эту, но и ту, что была раньше. Хотя он плохо помнил свою старую жизнь, только небольшими отрывками. Он вспоминал, как кто-то в детстве рассказывал ему страшные истории про вампиров, тогда они казали ему не больше чем сказка, а сейчас он сам стал таким. Для многих это было страшным роком, который преследовал на протяжении всей жизни, но только не для него. Это было второе рождение. Если бы ему предложили прожить жизнь заново, он ничего не изменил бы. Испокон веков люди смертельно боялись вампиров. Еще не зверь, но уже не человек. Ум, интуиция и ловкость человека смешались с силой, выносливостью и нюхом летучей мыши. Эта была опасная смесь, но в то же время он никогда не чувствовал себя так идеально. Будто все компоненты легли на свои места и сотворили нечто единое и завершенное. Они не боялись старости, она не затрагивала их, болезни обходили их стороной, они были почти бессмертны. И все же смерть гналась за ними по пятам. Люди нашли способ убивать вампиров, это было крайне сложно, но в основном удавалось это сделать только большим количеством человек. Но люди не учли одного. Вампиры, наполовину летучие мыши, они унаследовали сплоченность своих родственников. Чтобы противостоять врагам они стали объединяться. Стая, где все равны, где каждый будет стоять за другого до последнего своего вздоха, до последнего укуса, до последнего биения сердца. Бесстрашные люди-вампиры, преданные друзьям и беспощадные к врагам, стая была их семьей, а лес домом. Они странствовали по миру, борясь за свое существование, находя новых братьев. Вместе они были сила, сила, которая заставляет двигать миром. \r\n\r\nЧеловек мысленно поблагодарил луну за покровительство, за то, что она давала ему то, что не в силах был дать кто-либо другой. Ночь уже полностью окутала землю, до полночи оставались лишь считанные минуты. Он расслабился, отпустил все свои мысли и желания и приготовился нести смерть…\r\n', 'http://nld.spb.ru/forums/viewforum.php?f=12', 'http://kazus-factor.fatal.ru/bloodmoon/logo.gif ', 'http://kazus-factor.fatal.ru/bloodmoon/MISC18.jpg ', '10', '899157', '0', '0', '0');
