INSERT INTO zforums_posts_text VALUES (2, '5305340057', 'План разработки', '[color=blue:5305340057]\r\n[b:5305340057]План по разработки игры на февраль:[/b:5305340057]\r\n1) Написать бой между армиями как в героях\r\n2) Изменить некоторые вещи (по просьбам)\r\n[/color:5305340057][color=red:5305340057]а) На рынке сделать поле ввода для количества выставляемого ресурса[/color:5305340057][color=blue:5305340057]\r\n3) Дополнить систему боя прицельными ударами (10х to DragoN)\r\n4) Заняться РПГ частью игры - квестами\r\n[/color:5305340057]');
