INSERT INTO zforums_posts_text VALUES (3, '6bba3ab69c', 'Встреча 6.02.05', 'Предлагаю встретиться в воскресенье с утра или днём. Как такое предложение. Где-нибудь не далеко. В районе Комендантской площади или ещё где-нибудь.\r\n\r\nПовестка встречи:\r\nа) дальнейшая разработка\r\nб) Оплата хостинга :) (на добровольной основе)\r\nв) Просто прогулка и общение :)))))))))');
INSERT INTO zforums_posts_text VALUES (161, '10b657b324', '', 'я тута');
INSERT INTO zforums_posts_text VALUES (162, '442a205a17', 'Рыцарский Орден', 'В Рыцарском Ордене вам не придется качать только магию или только силу.Этот орден прдставляет из себя что то среднее.Ведь рыцари били хороши не только в бою но так же знали некоторые заклинания.Вступив в этот орден вам предстоит пройти должностную лестницу. Продвижение по которой зависит от вашего Уровня.\r\n\r\nТакже самые смелые и отважные войдут в состав Круглого стола который включает в себя 12 могучих рыцарей :Черного Рыцаря, Рыцаря Смерти, Рыцаря Жизни, Рыцаря Огня, Рыцаря Земли , Рыцаря Воды, Рыцаря Света, Рыцаря Правосудия, Рыцаря Солнца, Рыцаря     Ветра, Рыцаря Справедливости и Лунного Рыцаря\r\n\r\n\r\n                                      Должностная Лестница :\r\n\r\n\r\n                                8  Рыцарь Ордена\r\n\r\n                                7  Мастер Меча и Магии(25-30)\r\n\r\n                                6  Вояка(20-25)\r\n\r\n                                5  Доблестный Воин(15-20)\r\n\r\n                                4  Опытный Воин(10-15)\r\n\r\n                                3  Солдат(5-10)\r\n\r\n                                2  Оруженосец(3-5)\r\n\r\n                                1 Рекрут (1-3)\r\n\r\n\r\nОставляйте свои заявки здесь. Необходимо :\r\n1)Быть в нашем Клане\r\n2)Ник своего перса и желательно ссылочку на него');
INSERT INTO zforums_posts_text VALUES (17, 'cbcb26d71e', 'Ху из ху', 'Народ! Так как форум опять перелопатили, то все наши сообщения изчезли. Паса не батрачь не пиши снова сюда правила. Подождем пока все утрясется.\r\nВсЕ КТО В НАШЕМ КЛАНЕ ОТПИШИТЕСЬ ЗДЕСЬ!\r\nЧтобы знать ху из ху. (ккто есть кто)\r\nТем кто хочет присоединиться тоже надоотписываться, но уже с приставкой "хочу присоединитьсся". \r\n\r\n\r\nВсе. 8)');
