INSERT INTO zforums_posts_text VALUES (90, 'b1e11414a9', '', 'Пока просто примерные квесты. Я ещё даже редактор делать не начинал.\r\n\r\nПотом соответственно будет что-то вроде:\r\nЦель: (квеста)\r\nОбъект: (для действия)\r\nЗаказчик:\r\n\r\nПримеры: (Ну я не знаю)\r\n1) Какой-нибудь старый бандит (дон Капоне :) ) просит отмутузить такого-то игрока (причём этому дону можно оставлять заказы)\r\n\r\n2) Раздобыть такой-то артефакт\r\n\r\n3) Достичь такого-то уровня.\r\n\r\nПишите разные. Потом посмотрим, какие из них можно реализовать и уже из этого выйдет шаблон. Вот.');
INSERT INTO zforums_posts_text VALUES (91, '7cc4b80308', 'Битва в Native Land', 'В это воскресенье (а начал я уже (суббота)) я постараюсь полностью переделать бой между людьми. Посмотрим, что из этого выйдет...\r\n\r\nНовые достоинства:\r\n1) Надеюсь, добьюсь баланса\r\n2) После битв будет меньше экспы (ОКОНЧАТЕЛЬНО И БЕЗПОВОРОТНО)\r\n3) После LevelUP будут дополнительные характеристики (как в героях), но у каждого максимум - 25.\r\n4) После LevelUP будет добавляться по 5 очков на распределение.\r\n5) Постараюсь пересчитать характеристики монстров под новые уровни, а также, характеристики вещей.');
