INSERT INTO zforums_posts_text VALUES (94, '300189cb67', '', 'предлагаю такую фишку - пусть будет пара мест каких-нибудь, вроде такого:\r\nграбишь там всё или валишь мега-монстра, а потом за голову этого героя (того, который надебошырил там-то и там-то) назначают большую награду. скажем, на пару дней. потом обнуляецца. что-то типо гильдии убийц. или рандомом за чью-то голову награда. поохотицца на игроков можно (: по-моему - нормально должно выйти. \r\nили как в Мече и Магии сделать гильдию охотников за головами - даюцца квесты на головы каких-то монстров, и их нужно к такому-то числу припереть в один из филиалов гильдии. потом, особо приуспевшимся в этом злоЪбном деле, можно бонусы выдавать (скажем, первым пяти или десяти лучшим головорезам). вот, вроде не так плохо (: рандомом головы, и над квестами парицца не надо. потом бонусы... автоматика (:\r\n\r\nследуйщее...\r\nубить змия горыныча и спасти мега-принцессу из самой высокой башни на самоый высокой горе (((: можно наоборот - убить злющщую принцесску и спасти из её кровожадных лап несчастного змия =0) а то она захватила бедного змия, и хочет ставить над ним свои опыты в подземной лаборатории: испытывать на нём новые виды термоядерного оружия и новые противодраконные средства самообороны. Или просто ей злая-презлая мачеха сказала, дабы избавится от трёх голов и чешуи, нужно сварить суп из свежепойманного горыныча 31-го февраля в полночь, попрыгать на левой ноге и маленькими глотками выпить целебный отвар. цель - спасти зверушку от голодной пасти принцессы (: шутка.\r\n\r\nз.ы. пусть запостим темы с квестами а потом админ сам наберёт приглянувшейся состав');
INSERT INTO zforums_posts_text VALUES (95, '23a2326d7e', 'Дела Клана', 'Предлагаю сюда постить планы (чтобы были в курсе - что же нужно делать) на ближайшее будущее и их удтверждение. Глобальные планы, не секретные (:\r\n\r\n[color=red:23a2326d7e][b:23a2326d7e]Only for clan-members![/b:23a2326d7e][/color:23a2326d7e]\r\n\r\nВот, что я думаю:\r\n\r\n[b:23a2326d7e]1. Покупка клана.[/b:23a2326d7e] Не секрет - его нужно купить. То есть набрать со всех определённую сумму. Предложение: вся сумма с меня, и ещё что-нибудь из важных покупок (если будет) - тоже. Думаю против никого нет. Если мучает совесть (если таковая есть :roll: ) - можете потом вернуть. Хотя от меня не убудет. Один вопрос - когда скинуть нажитое Главе Ордена. То есть - ждём, когда создадут возможность покупки.\r\n\r\n[b:23a2326d7e]2. Набор в орден.[/b:23a2326d7e] Естественно, что клан подразумевает какое-то количество приверженцев. Набором, как понял, руководит тов. Гэндальф. Пусть руководит. Нужно чтоб об сией организации как-то узнали, дабы хотели вступить. Я приведу ещё несколько человек в феврале, но, думаю, с меня будет мало (:\r\n\r\n[b:23a2326d7e]3. Разработка клана.[/b:23a2326d7e] Так как решили образовать орден - нужна легенда, логотип, ну и так далее, как положено в цивилизованных местах. Соответственно, это нужно написать и сделать. Предлагаю от каждого по хорошей легенде и так далее, а затем - выбрать более подходящую методом голосования или Советом. \r\n[i:23a2326d7e]Добавление: [/i:23a2326d7e] логотип формата .gif или .jpg, размером 32*32 пикселя. Легенда калана - кто сколько напишет. Предлагаю тему - вампиры.\r\n\r\nИдеи, мысли, критику и прочие труды мозговой активной деятельности - прошу писать сюда.');
INSERT INTO zforums_posts_text VALUES (97, 'eb1d0cc45f', 'Прием в клан', 'Вобщем оставлять заявку в такой форме\r\n1) ник в игре\r\n2) какой основной ресурс\r\n3) иметь для вступления 1000 денег по курсу 1 к 1(пока что набераем бесплатно)\r\n\r\nЗЫ прозьба всех кто состоит в клане отпесаца тут.\r\nЗЫЫ наш клан уже зареген такчто нам ненадо собирать 500к на его регистрацию');
INSERT INTO zforums_posts_text VALUES (98, 'c33a970f3e', '', 'Предлагаю как-то упорядочить форум BloodmooN, а именно:\r\nТемы типа\r\n\r\nСостав Клана\r\nЗакон Клана\r\nДела Клана\r\nВерховный Совет\r\nВступление в Клан\r\n\r\nперевести в рязряд "объявление", дабы висело сверху и никуда не съезжало. То есть - основные темы по клану пусть займут верхнее место. Так же было бы хорошо перевести темы к одному виду: первая буква заглавная, остольное с маленькой, или всё с больших (: так будет удобнее, да и как-то поприличнее.\r\nТак же, думаю, топик Кланом Гарантируется перевести в Закон Клана или подвесить перед формой приёма. Думаю лишние темы не есть нуд (:\r\n\r\nГлава, прошу принять к сведению, так будет удобнее (:');
