INSERT INTO zforums_posts_text VALUES (102, 'b4ea2ca22a', 'Диалог Trimax и Maloy о новой системе боя', '[20:21] &lt;Trimax&gt; http://nld.spb.ru/battle.php\r\n[20:21] &lt;Trimax&gt; только пока ничего не тыркай\r\n[20:21] &lt;Trimax&gt; АУ???\r\n[20:22] &lt;Trimax&gt; Нажми для интереса атаковать...\r\n[20:22] &lt;Trimax&gt; Пока пашет только меч\r\n[20:22] &lt;Чёрт&gt; ок\r\n[20:22] &lt;Trimax&gt; Хе хе\r\n[20:22] &lt;Trimax&gt; С одного удара\r\n[20:22] &lt;Trimax&gt; Какой левел?\r\n[20:23] &lt;Чёрт&gt; 103\r\n[20:23] &lt;Trimax&gt; А\r\n[20:23] &lt;Trimax&gt; Ну ясно\r\n[20:23] &lt;Чёрт&gt; ты ещё жив\r\n[20:23] &lt;Trimax&gt; 66 и 103\r\n[20:23] &lt;Чёрт&gt; )\r\n[20:23] &lt;Trimax&gt; Млин\r\n[20:23] &lt;Trimax&gt; Я не делал проигрыш пок\r\n[20:23] &lt;Trimax&gt; а\r\n[20:23] &lt;Trimax&gt; Ещё разок\r\n[20:23] &lt;Чёрт&gt; тебя ударить ещё раз?)\r\n[20:23] &lt;Trimax&gt; Угу\r\n[20:24] &lt;Trimax&gt; Сколько ловкость у тебя?\r\n[20:24] &lt;Trimax&gt; Надо срочно всех снижать.\r\n[20:24] &lt;Чёрт&gt; 541\r\n[20:24] &lt;Trimax&gt; Цена за удар - 5 ловкости :)\r\n[20:24] &lt;Trimax&gt; Давай подумаем, как лучше её расчитать\r\n[20:24] &lt;Trimax&gt; Я полагаю, что 3500/5 = 700 ударов многовато\r\n[20:24] &lt;Trimax&gt; по 6000 урона\r\n[20:24] &lt;Trimax&gt; за хо\r\n[20:24] &lt;Trimax&gt; д\r\n[20:25] &lt;Чёрт&gt; =)\r\n[20:25] &lt;Trimax&gt; Так что?\r\n[20:25] &lt;Чёрт&gt; я думаю надо очки действия убрать\r\n[20:25] &lt;Trimax&gt; К урону ещё прибавляется ловкость (если повезёт)\r\n[20:25] &lt;Чёрт&gt; ну всмысле чтоб ловкость чтонибуть довала\r\n[20:25] &lt;Trimax&gt; Хм...\r\n[20:25] &lt;Trimax&gt; Секундочку...\r\n[20:25] &lt;Чёрт&gt; а очки действия в бою довали уровни\r\n[20:26] &lt;Trimax&gt; 101 очко?\r\n[20:26] &lt;Trimax&gt; А можно и так\r\n[20:26] &lt;Чёрт&gt; тойсть если ты 0 то 1 очко дейстивия и так далее\r\n[20:26] &lt;Trimax&gt; А цены на удары?\r\n[20:26] &lt;Trimax&gt; 1 удар = левел\r\n[20:26] &lt;Trimax&gt; тогда нужны бонусы к ОД\r\n[20:26] &lt;Чёрт&gt; да\r\n[20:26] &lt;Trimax&gt; Хм..\r\n[20:26] &lt;Trimax&gt; Можно\r\n[20:26] &lt;Trimax&gt; Сейчас...\r\n[20:26] &lt;Чёрт&gt; 0 - 1 удар, 1=2 удара и так далее\r\n[20:26] &lt;Trimax&gt; Надо записать\r\n[20:26] &lt;Чёрт&gt; =)\r\n[20:27] &lt;Trimax&gt; + к ОД будут давать бутылочки и плащи всякие...\r\n[20:27] &lt;Trimax&gt; Идёт?\r\n[20:27] &lt;Trimax&gt; И ещё\r\n[20:27] &lt;Чёрт&gt; да\r\n[20:27] &lt;Trimax&gt; Если ход пропускаем, ОД плюсуются\r\n[20:27] &lt;Trimax&gt; Отлично\r\n[20:27] &lt;Чёрт&gt; угу\r\n[20:27] &lt;Trimax&gt; Уже шаг вперёд\r\n[20:28] &lt;Чёрт&gt; не\r\n[20:28] &lt;Trimax&gt; Нажми ка передать ход\r\n[20:28] &lt;Trimax&gt; сработает?\r\n[20:28] &lt;Чёрт&gt; может как в героях\r\n[20:28] &lt;Trimax&gt; Поясни\r\n[20:28] &lt;Trimax&gt; Нажми ка передать ход\r\n[20:28] &lt;Trimax&gt; &lt;Trimax&gt; сработает?\r\n[20:28] &lt;Trimax&gt; Скореее\r\n[20:28] &lt;Чёрт&gt; чтоб ход пропуститть там часы типа выждать щит типа защита\r\n[20:28] &lt;Чёрт&gt; когда выжедаеш у тя не 1 удар а два\r\n[20:28] &lt;Trimax&gt; Согласен\r\n[20:29] &lt;Чёрт&gt; но и ты щетай пропустил удар от противнека\r\n[20:29] &lt;Чёрт&gt; или\r\n[20:29] &lt;Trimax&gt; А при нажатии на щит (справа), ОД сгорают\r\n[20:29] &lt;Trimax&gt; так?\r\n[20:29] &lt;Чёрт&gt; у тебя траф есть?\r\n[20:29] &lt;Trimax&gt; Очень мало :(\r\n[20:29] &lt;Чёрт&gt; жаль\r\n[20:29] &lt;Trimax&gt; Угну\r\n[20:29] &lt;Trimax&gt; Угу\r\n[20:29] &lt;Trimax&gt; &lt;Trimax&gt; А при нажатии на щит (справа), ОД сгорают\r\n[20:29] &lt;Trimax&gt; &lt;Trimax&gt; так?\r\n[20:29] &lt;Чёрт&gt; просто хотел дать тебе ссылку на гаму там система боя прикольная\r\n[20:29] &lt;Чёрт&gt; да\r\n[20:29] &lt;Trimax&gt; Давай. Потом гляну...\r\n[20:30] &lt;Чёрт&gt; www.tamezero.ru\r\n[20:30] &lt;Чёрт&gt; на регистрацию около метра уходит\r\n[20:30] &lt;Trimax&gt; Скачай страничку с боем\r\n[20:30] &lt;Trimax&gt; :)\r\n[20:30] &lt;Чёрт&gt; у меня трафа нет\r\n[20:30] &lt;Чёрт&gt; я из клуба играл)\r\n[20:30] &lt;Trimax&gt; ясно\r\n[20:31] &lt;Чёрт&gt; попробую обьяснить\r\n[20:31] &lt;Trimax&gt; Ddavaj\r\n[20:32] &lt;Чёрт&gt; противники появляются врзных концах поля, ну там клетак скажем 10х10, они вначале должны подойти друг к другу а потом наченается бой когда они появляются\r\n[20:32] &lt;Чёрт&gt; рядом\r\n[20:33] &lt;Чёрт&gt; и выбор куда бить ну скажем в голову, грудь ноги, а если поставить блок то 1 од исчезнит\r\n[20:33] &lt;Чёрт&gt; надо додумать с од\r\n[20:33] &lt;Trimax&gt; Я думаю насчёт ударов в части тела\r\n[20:33] &lt;Trimax&gt; Нажми "передать ход" плз\r\n[20:35] &lt;Чёрт&gt; или нащет од, каждому дается од не поуровню, а одинакова(ну там вещи ещё некоторые могут добовлять) ну там у каждого изначально 10, там защита стоит 2 од, прикрыть можно только 1 часть тела, и удар стоит 2 од\r\n[20:35] &lt;Trimax&gt; Хм...\r\n[20:35] &lt;Trimax&gt; Надо подумать\r\n[20:36] &lt;Чёрт&gt; ну а ловкость приспособить к уворотом от ударов\r\n[20:36] &lt;Trimax&gt; Можно\r\n[20:36] &lt;Trimax&gt; А как?\r\n[20:36] &lt;Trimax&gt; У нас есть число\r\n[20:36] &lt;Trimax&gt; Скажем 315\r\n[20:36] &lt;Trimax&gt; И как определить увернулся ли ты или нет?\r\n[20:36] &lt;Trimax&gt; :)\r\n[20:37] &lt;Чёрт&gt; я в програмировании нехера несмыслю, я только предложить могу(\r\n[20:37] &lt;Trimax&gt; Нус?\r\n[20:37] &lt;Чёрт&gt; смотри\r\n[20:37] &lt;Trimax&gt; Я имею в виду не это\r\n[20:37] &lt;Trimax&gt; Сек\r\n[20:37] &lt;Trimax&gt; ок?\r\n[20:37] &lt;Чёрт&gt; к примеру 100 лрвкости это 10 % к увароту\r\n[20:37] &lt;Trimax&gt; Если бы было 3 уровня: новичок, продвинутый, эксперт\r\n[20:37] &lt;Trimax&gt; то было бы просто\r\n[20:37] &lt;Trimax&gt; 30%\r\n[20:37] &lt;Trimax&gt; 60%\r\n[20:37] &lt;Trimax&gt; 90%\r\n[20:37] &lt;Trimax&gt; Хм...\r\n[20:38] &lt;Trimax&gt; &lt;Чёрт&gt; к примеру 100 лрвкости это 10 % к увароту - а е если кто-нить прокачает до 1000?\r\n[20:38] &lt;Trimax&gt; :)\r\n[20:38] &lt;Чёрт&gt; зделать там скажем интелект анти уварот\r\n[20:38] &lt;Trimax&gt; Хм...\r\n[20:38] &lt;Trimax&gt; Хе хе\r\n[20:38] &lt;Trimax&gt; Даже не знаю\r\n[20:38] &lt;Trimax&gt; Интеллект = кол-во маны\r\n[20:39] &lt;Чёрт&gt; я так сказал к примеру\r\n[20:39] &lt;Чёрт&gt; удачю зделать антиуваротом\r\n[20:39] &lt;Чёрт&gt; ну и макс количество ловкости 90\r\n[20:39] &lt;Чёрт&gt; тойсть\r\n[20:39] &lt;Чёрт&gt; обнулить всех играков\r\n[20:40] &lt;Чёрт&gt; и давать за каждый уровень стобильное количество очков повышения\r\n[20:40] &lt;Чёрт&gt; за 1 там 10\r\n[20:40] &lt;Чёрт&gt; за последующии также\r\n[20:42] &lt;Trimax&gt; Нет. Надо что-то другое...\r\n[20:42] &lt;Trimax&gt; Даже не знаю\r\n[20:42] &lt;Trimax&gt; Я имею в виду, максимальное не пойдёт\r\n[20:42] &lt;Trimax&gt; Будет доп. характеристика "ловкость"\r\n[20:42] &lt;Trimax&gt; там уже "новичок", "продв", "эксперт"\r\n[20:42] &lt;Trimax&gt; 10%\r\n[20:42] &lt;Trimax&gt; 25%\r\n[20:42] &lt;Trimax&gt; 40%\r\n[20:43] &lt;Trimax&gt; увернуться\r\n[20:43] &lt;Чёрт&gt; ну и так можно\r\n[20:43] &lt;Trimax&gt; А с этой что делать???????\r\n[20:43] &lt;Trimax&gt; Консенсус:\r\n[20:43] &lt;Trimax&gt; слышай:\r\n[20:43] &lt;Trimax&gt; :)\r\n[20:43] &lt;Trimax&gt; слушай:\r\n[20:43] &lt;Trimax&gt; 1) У всех на 1 ход - 5 ОД\r\n[20:43] &lt;Trimax&gt; 2) 3 ОД - удар\r\n[20:43] &lt;Trimax&gt; 3) 3 ОД - магия\r\n[20:43] &lt;Trimax&gt; 4) 2 ОД - защита\r\n[20:43] &lt;Trimax&gt; Хм...\r\n[20:44] &lt;Trimax&gt; 6 ОД на хрд\r\n[20:44] &lt;Trimax&gt; 6 ОД на ход\r\n[20:44] &lt;Trimax&gt; Или 5*\r\n[20:44] &lt;Trimax&gt; ?\r\n[20:44] &lt;Trimax&gt; Как лучше?\r\n[20:44] &lt;Чёрт&gt; нет\r\n[20:44] &lt;Чёрт&gt; смотри\r\n[20:44] &lt;Trimax&gt; Смотрю\r\n[20:44] &lt;Чёрт&gt; всего скажем 5 од походил истратил од, использовал магию также истратил од\r\n[20:45] &lt;Trimax&gt; нус?\r\n[20:45] &lt;Trimax&gt; а цены на магию и удары?\r\n[20:45] &lt;Trimax&gt; по сколько?\r\n[20:45] &lt;Trimax&gt; Если ход пропущен, ОД возрастают\r\n[20:45] &lt;Trimax&gt; А цены-то какие?\r\n[20:45] &lt;Trimax&gt; По сколько?\r\n[20:45] &lt;Чёрт&gt; всего 6 од удары и магия по 3 блок 2 ход зависет от количества пройденых клеток\r\n[20:46] &lt;Чёрт&gt; 1 клетка 2 од\r\n[20:46] &lt;Trimax&gt; Клеток не будет\r\n[20:46] &lt;Trimax&gt; Подожди\r\n[20:46] &lt;Trimax&gt; 6 ОД:\r\n[20:46] &lt;Trimax&gt; (Магия || удар) = 3\r\n[20:46] &lt;Trimax&gt; Защита = 2\r\n[20:46] &lt;Trimax&gt; Так?\r\n[20:46] &lt;Чёрт&gt; ну\r\n[20:46] &lt;Чёрт&gt; и 1 од остаётся на следующий ход\r\n[20:46] &lt;Trimax&gt; Если я ударил и защитился\r\n[20:46] &lt;Trimax&gt; угу\r\n[20:46] &lt;Trimax&gt; :)\r\n[20:46] &lt;Чёрт&gt; если стваить защиту\r\n[20:47] &lt;Trimax&gt; Если ставить защиту, (а перед этим жахнуть), останется 1 ОЖ\r\n[20:47] &lt;Trimax&gt; Если ставить защиту, (а перед этим жахнуть), останется 1 ОД. \r\n[20:47] &lt;Trimax&gt; Он и передастся\r\n[20:47] &lt;Trimax&gt; Так?\r\n[20:47] &lt;Чёрт&gt; да\r\n[20:47] &lt;Trimax&gt; Далее\r\n[20:47] &lt;Trimax&gt; Стрельба из лука:\r\n[20:47] &lt;Trimax&gt; Нужна перезарядка за 1 ОД\r\n[20:47] &lt;Trimax&gt; И Выстрел - 2 ОД\r\n[20:48] &lt;Trimax&gt; Так?\r\n[20:48] &lt;Trimax&gt; Магам нужна мана\r\n[20:48] &lt;Чёрт&gt; да\r\n[20:48] &lt;Чёрт&gt; да\r\n[20:48] &lt;Trimax&gt; максимум которой определяет интеллект\r\n[20:48] &lt;Чёрт&gt; угу\r\n[20:48] &lt;Trimax&gt; Выложу-ка я наш диалог на форум...\r\n[20:48] &lt;Trimax&gt; :)\r\n[20:48] &lt;Чёрт&gt; =)\r\n[20:48] &lt;Trimax&gt; А как бы его сохранить?\r\n[20:49] &lt;Чёрт&gt; я выложу\r\n[20:49] &lt;Trimax&gt; Знаешь?\r\n[20:49] &lt;Trimax&gt; Давай\r\n[20:49] &lt;Trimax&gt; Куда-нить в предложения\r\n[20:49] &lt;Trimax&gt; :)');
INSERT INTO zforums_posts_text VALUES (103, '3896649b0e', 'Легенда и.т.д !!!', '[b:3896649b0e]Я предлогаю сделать значком клана то что у меня на аватаре ! [/b:3896649b0e]\r\n[color=green:3896649b0e]+Новая легенда:[/color:3896649b0e]\r\n[i:3896649b0e]Стояла мертвая тишина. Высоченные сосны прятали в своих кронах последние лучи солнца. У подножий уже мягко расстелилась тьма. Тьма… она была живая. От каждого ствола отделилась тень. Вернее, это была не тень, ведь в полной темноте теней не бывает. Их можно было только почувствовать. Почувствовать сердцем. А еще увидеть. Но только для этого нужно особое зрение. Только сквозь реальность можно было что-либо разглядеть. Их не было в этом мире, но они питались. И питались они кровью. Они уходили так же незаметно, как и появлялись. Еще никому не удавалось их поймать. Они шли обычно на запах. На запах теплой крови. Крови, еще текущей по венам. Каждую ночь, после захода солнца, но до того, как появлялась луна, они выходили на охоту. Их жертвами становились мирные жители, вампиры и священники, и даже те, кто не смог выбрать ни путь тьмы, ни путь света… они умели двигаться сквозь время и пространство. Они были всюду и нигде. И скрыться от них было невозможно… даже днем, когда солнце царствовало на небосводе, сердце сжималось от страха. От страха быть замеченным и попасть в список жертв… и имя нагоняющим страх было BloodHuntes! И даже в данный момент они стоят за твоей спиной и ждут своего часа! И только самый внимательный и везучий может случайно заметить пронзительный взгляд их желтых глаз... [/i:3896649b0e]\r\n :evil:');
