INSERT INTO zforums_posts_text VALUES (107, '2943ab67a9', 'Закон Клана', '[size=18:2943ab67a9]Почитай Главу Клана, Святейший совет, соклановцеa своих и прочих сынов и дочерей Создателя... \r\nНикто не может служить двум господам: ибо или одного будет ненавидеть, а другого любить; или одному станет усердствовать, а о другом нерадеть...не заключайте тайных союзов с другими кланами... \r\nНовичка не обижай: вы знаете душу новичка, потому что сами были новичками... \r\nНе произноси ложного свидетельства на соклановца твоего... \r\nИтак во всем, как хотите, чтобы с вами поступали люди, так поступайте и вы с ними; ибо в этом закон и пророки... \r\n\r\nА теперь по существу... \r\n\r\n\r\n1. Соблюдать правила NATIVE LAND. \r\n2. Выполнять требования Главы и Совета, уважительно относиться к членам клана. \r\n3. Желательно выполнять условия поединка. \r\n4. Запрещаются какие-либо тайные сговоры с другими кланами, которые могут нанести вред клану или привести к утечке закрытой информации. \r\n5. Стремиться к увеличению авторитета клана всеми доступными способами. \r\n6. Помогать друг другу всегда и везде. \r\n7. По возможности наказывать предателей клана. \r\n\r\n\r\nКЛАНОМ ГАРАНТИРУЕТСЯ \r\n\r\n\r\n\r\n1. Взаимопомощь между игроками. \r\n\r\n2. Мнение и пожелание любого члена клана будет рассмотрено и учтено. \r\n\r\n3. При наличии средств в казне клана, возможны беспроцентные ссуды членам клана, (может потом чтото еще...) \r\n\r\n\r\n\r\n\r\n\r\nПравила будут дополняться...[/size:2943ab67a9]');
