INSERT INTO zforums_posts_text VALUES (132, '50fd4eb78f', 'О понижении уровней', 'Итак, вчера (в субботу) состоялся ночной разговор c Teider`ом и было принято следующее решение:\r\nВсе уровни будут понижены в 10 раз следующим образом:\r\n[b:50fd4eb78f]Новый уровень = старый уровень / 10[/b:50fd4eb78f]\r\nЗатем дробная часть будет отброшена.\r\nПосле этого [b:50fd4eb78f]все характеристики[/b:50fd4eb78f] персонажей будут сброшены на "0". И каждому будет начислено N статов.\r\n[b:50fd4eb78f]N = Новый уровень * 5[/b:50fd4eb78f]\r\nТ.к. с повышением на 1 уровень каждому игроку начисляется по 5 статов на распределение.\r\nТакже, автоматом будут начислены 6 стандартных очков, которые имеет любой созданный персонаж.\r\nКоличество опыта будет равно минимально необходимому для достижения нового уровня.\r\n\r\nПример: допустим, игрок был 151 уровня:\r\n\r\nНовый уровень = [151/10] = [15,1] = 15\r\nN = 15*5 = 45\r\nN = N + базовые\r\nN = 51 на распределение.');
INSERT INTO zforums_posts_text VALUES (133, '6175245c63', 'О входе в клан', 'После обновления боевой системы будет обновлена система кланов.\r\nЧто изменится?\r\nТолько одно (пока): чтобы вступить клан, необходимо будет написать заявку и выбрать клан. Затем она автоматом придёт админу клана и он решит (нажмёт кнопку "Принять" или "Стереть сообщение") вопрос о вступлении Вас в клан.\r\nВ случае положительного ответа, Вам сразу передаются все доп. способности клана, клановый значок и Вы начинаете платить ежедневный налог (систему уже забыл. В ПН вспомню).');
INSERT INTO zforums_posts_text VALUES (134, '92a7b9666a', '', '[quote:92a7b9666a="DragoN"]а ПОЧЕМУ желтых? Меня решил не ждать? Сам накалякал легенды?\r\nЛадно. Тогда предлагаю по легенде попросить нам возможность телепортации(ну или чего-нибудь вроде перемещения сквозь время и пространство!) и будем мы кланом убийц! наемных! Нам дадут какую-нибудь еще возможность типо невидимости или тихиго шага, и мы будем мочиться по заказу! пофигу кого[/quote:92a7b9666a]\r\n\r\nА чо мне эта идея нравится !!!!!\r\n :D');
