INSERT INTO zforums_posts_text VALUES (145, 'f885b84cfd', 'Стихи(не мои)', '[b:f885b84cfd]Дети Сатаны[/b:f885b84cfd]\r\n \r\n[i:f885b84cfd]Черная кровь, черный асфальт,\r\nТы сразу прогонишь печали все прочь,\r\nЛишь только смерть на холодных устах.\r\nВ умершем небе кружит воронье. \r\nГде ваша Жизнь? Схоронили ее.\r\nТам же почили Любовь, Доброта...\r\nНад горизонтом взошла звезда Зла.\r\n\r\nВы, кто взывал нас прощать всех врагов,\r\nМы вас прощаем. Простит ли вас бог?\r\nГде же Мессия, что должен спасти?\r\nУмер и он - ему помогли...\r\nИ на Земле мы ликуем одни -\r\nТе, кто избрал путь Сатаны![/i:f885b84cfd] \r\n\r\n\r\n[b:f885b84cfd]След Вампира[/b:f885b84cfd]\r\n \r\n[i:f885b84cfd]Сегодня он вновь придет к тебе,\r\nРовно в полночь, при тускло горящей свече.\r\nВсе тайны откроешь ему, а потом\r\nПокроется вновь твое тело огнем.\r\nНа шее твоей он оставил свой след,\r\nВедь ты для него самый вкусный обед.\r\nТеперь ты вампир, забудь свет дневной.\r\nДля тебя открыта тайна жизни ночной.[/i:f885b84cfd] \r\n\r\n[b:f885b84cfd]Да, я - вампир[/b:f885b84cfd]\r\n \r\n[i:f885b84cfd]Да, Я - Вампир, хоть выпали клыки\r\nДа, Я - Вампир, хоть обломались когти\r\nВся эта жуть была нужна Мне раньше\r\nКогда в ночи подстерегал Я Жертву\r\nТеперь все проще - целый день лежу\r\nНа низком берегу Реки Кровавой\r\nКровь люди проливают ежедневно\r\nЯ обеспечен свежей теплой Пищей...\r\nА люди стадом, параллельно руслу\r\nБредут в крови своей же по колено\r\nСебя считает каждый центром Мира\r\nА то, что под ногами, не заметит...\r\nВедь странные созданья - эти люди!\r\n"Мы видим Цель! Мы не свернем с Пути!"\r\nКакой же это путь к заветной цели?\r\nКровавая Река впадает в Море Крови,\r\nГде все утонут...Всемогущий Дьявол!\r\nОткрой глаза этим безумным толпам!\r\nПусть высохнет Река!!!...\r\nМне просто скучно\r\nЛежать на низком берегу без дела...[/i:f885b84cfd] \r\n\r\n[b:f885b84cfd]The Vampire\r\n [/b:f885b84cfd][i:f885b84cfd]Ты уходишь за ночью вслед,\r\nТебя ранит солнца восход,\r\nТы идешь, куда дороги нет,\r\nИ ишещь то, чего никогда не найдешь...\r\n\r\nТвоя жизнь - это кровь... Навсегда...\r\nНавечно проклят - ни жив, ни мертв,\r\nНавечно этот холод и эта печаль.\r\nТебя уже никто не спасет...\r\n [/i:f885b84cfd]\r\n[img:f885b84cfd]http://photo.surgut.info/image/1239.jpg[/img:f885b84cfd]');
INSERT INTO zforums_posts_text VALUES (146, 'f04ce09b5e', '', 'излагаю попроще:\r\n\r\nидея 1\r\n\r\nМесто - Гильдия убийц\r\nКвесты - каждый день награда за голову определённого монстра (рандом), за которую дают небольшие бонусы. В конце месяца подводжятся итоги, и нескольким лучшим головорезам даётся какой-то бонус. Вместо монстров можно иногда увидеть будет имя какого-то героя (:\r\n\r\n\r\nидея 2\r\n\r\nМесто - Воровской Лагерь\r\nКвесты - Будет какой-то тайник у воров. Его можно разграбить, и получить, скажем, 10 000 денег 1к1. За это воровство, атаман назначается награду за голову героя, который всё это украл, скажем, 1 очко навыка (условно). Если по прошествию, скажем, пяти дней, герой всё ещё с целой головой, то награда исчезает, тайник снова пополняется. \r\n\r\n\r\nидея 3 (возможно уже высказывалась, не помню)\r\n\r\nМесто - Доска объявлений (: Пусть будет в каждом городе (:\r\nКвест - тут герои оставляют заявки на убийство других героев, по каким-то своим причинам (ну, скажем, опустили вас на мега меч, и вы хотите его вернуть, но уровнем не удались, и отплатите наёмнику золотом). Можно что-нибудь другое (:\r\n\r\n\r\nидея 4 - с горынычем и принцессой (((:');
