INSERT INTO zforums_posts_text VALUES (185, 'ad8e382016', 'Новая система боя', 'Постараюсь здесь описать новую систему боя.\r\nСначала хочу сказать о том, что начало битвы осталось точно таким же. То есть, нажав на кнопку "Вызвать на поединок" и затем подав заявку на бой (или приняв чью-то) открывается окно битвы. \r\nОт предыдущей версии оно мало чем отличается. Изменилась только сама система битвы. Теперь каждому игроку (не зависимо от уровня и ловкости [которая кстати была исключена из игры]) на 1 ход даётся 6 ОД (Если прокачана доп. способность тактика, то, соответсвенно новичок - 7; продвинутый - 8; профи - 9). Он вправе использовать их следующим образом:\r\n\r\n[color=blue:ad8e382016]3 ОД - атака мечом или выстрел из арбалета\r\n3 ОД - использование магического заклинания\r\n2 ОД - использование щита\r\n2 ОД - использование бутылочки с напитком\r\n6 ОД - использование способности клана[/color:ad8e382016]\r\n\r\nЭти величины являются постоянными и не зависят от характеристик игроков.\r\n\r\nДля использования заклинаний теперь (как и в известной игре HOMM) нужна магическая энергия (очки магии, мана...). Они накапливаются со временем, как и здоровье игрока. Восполнить их во время боя можно с помощью бутылочки маны. Максимальное количество очков маны определяется основной способностью игрока - знания.\r\n\r\nMAX=ЗНАНИЯ*10\r\n\r\nЦены в магической энергии на заклинания скоро появятся рядом с эмблемами заклинания во время боя, а также, в ГМ первого уровня. В ГМ второго уровня, помимо бедствий, будут продаваться те самые бутылочки. Теперь все предметы (кроме оружия) имеют свой вес. Бутылочки в том числе. Максимально возможный вес определяется способностью выносливость\r\n\r\nMAX=ВЫНОСЛИВОСТЬ\r\n\r\nЗащита игрока от немагических атак производится следующим образом: базовая защита игрока + защита от всех доспехов и прочего инвенторя КРОМЕ щитов. Чтобы была прибавлена защита и от щита необходимо нажать на кнопку прикрыться.\r\n\r\nЗащита игрока от магических атак зависит от базового навыка "Защита от магии".\r\n\r\nСила заклинаний также зависит от трёх базовых навыков магии.\r\n\r\nПередача хода осуществляется поистечении одной минуты или в случае, когда ОД игрока станут равными нулю. Также, игрок вправе сам передать ход, нажам кнопку "Передать ход".\r\n\r\nЕсли какой-то игрок капитулирует, то он немедленно выходит из битвы (если у оппонента нет дополнительной способности "Устрашение" или "Оцепенение"). При этом, весь заработанный ОППОНЕНТОМ опыт остаётся у оппонента. Капитулировавший прибавки к опыту не получает. Здоровье игроков сохраняется на текущем уровне.\r\n\r\nКнопка "Ничья" (работает только после нажатия на неё обоих игроков) приводит к немедленному завершению битвы. При этом, никто опыта не получает.\r\n\r\nВ результате поражения в битве, опыт игроку НЕ НАЧИСЛЯЕТСЯ. Опыт получает только победитель.');
