INSERT INTO zforums_posts_text VALUES (157, 'ca6e47c81e', '', 'Глядя, как мама примеряет новую шубу из натурального меха,\r\nВовочка заметил:\r\n- Мама, а ты понимаешь, что эта шуба - результат ужасных\r\nстраданий бедного, несчастного животного?\r\nМама посмотрела на Вовочку строго и ответила:\r\n- Как ты можешь так говорить о родном отце?!!\r\n :D \r\nМужик просыпается с утра с жуткого бодуна, открывает глаза, голова\r\nболит, оглядывается по сторонам: фуууу, дома... встает с кровати,\r\nощупывает себя - е-мое, в пижаме... в жизни пижаму не одевал. Смотрит -\r\nна туалетном столике стакан воды, таблетка аспирина и записка от жены:\r\n"Милый, завтрак на столе, все прибрала, твоя навеки - жена". Мужик в\r\nсовершенном непонимании, выпивает таблетку и идет в ванную... по пути\r\nобнаруживает, что квартира не то что чистая, просто вылизана до блеска,\r\nсын сидит у себя в комнате, делает уроки...\r\n- Сынок, а что вчера было?\r\n- Ты пришел пьяный, как обычно под утро. Облевал всю прихожую, нагадил\r\n  мимо унитаза, побил в кухне всю посуду, поставил матери фингал под\r\n  глазом.\r\n- Ну и, что случилось с мамой, с квартирой???\r\n- Ааа, ты про это, просто когда тебя мама стала укладывать спать и\r\n  начала стягивать с тебя штаны, ты заорал "пошла на хуй, сука - \r\n  Я ЖЕНАТЫЙ!!!"\r\n :D \r\nЛесбийский чат на далеком американском сервере. Входит Вика.\r\nВика: Hi all! I\'m Vikky 17/f bi. Anybody wanna sex?\r\nHикто не отвечает. Все заняты своими делами.\r\nВходит Анна.\r\nАнна: Privet. Kto nibud\' govorit po russki?\r\nВика: anna privet. ti otkuda?\r\nАнна: Iz moskvi, a ti?\r\nВика: ya tozhe. u tebja russkij shrift est\'?\r\nАнна: da\r\nВика: ЧПФ ФБЛ РТПЮЙФБФШ HПЦЕЫШ?\r\nАнна: eto chto?\r\nВика: а вот так можешь прочитать?\r\nАнна: mogu\r\nВика: тогда переключайся на русский так проще\r\nАнна: Вот так?\r\nВика: умница. тебе сколько лет?\r\nАнна: 15, а тебе?\r\nВика: тебе в куклы надо играть, что ты тут делаешь?\r\nАнна: А тебе сколько, старушка?\r\nВика: скоро 18\r\nАнна: И в 15 лет ты в чат не ходила?\r\nВика: нет конечно\r\nАнна: Потому что компьютера не было?\r\nВика: очень смешно. ты в RL мужскую пипиську когда-нибудь видела?\r\nАнна: Hе знаю что такое RL, но откуда у тебя, Вика, мужская пиписька?\r\nВика: как откуда? мужики приносят. жаль только она у них не отстегивается.\r\nприходится еще их самих в нагрузку терпеть.\r\nАнна: Так ты и с мужиками трахаешься?\r\nВика: конечно, люблю разнообразие\r\nАнна: Hу так сегодня про мужиков забудь! Потому что ты в моей комнате,\r\nосвещенной свечами, на столике бутылка французского вина. Если не любишь\r\nвино, поставь себе, что хочешь. Я сижу с сигаретой в большом мягком кресле,\r\nа ты на пушистом ковре у моих ног.\r\nВика: меня посадят за растление малолетних\r\nАнна: Hе дрейфь. Я уже глажу твои волосы. Разве тебе не приятно?\r\nВика: уговорила. Я подползаю к тебе поближе, глажу твои ноги слушай, ты в\r\nбрюках или в юбке?\r\nАнна: В юбке. Ты тоже в юбке и в блузке, которую я начинаю медленно\r\nрасстегивать.\r\nВика: я приподнимаюсь, забираю у тебя сигарету, изящно протягиваю ногу и\r\nвыключаю свет.\r\nАнна: Что ты выключаешь? У нас же свечи горят.\r\nВика: извини. я приподнимаюсь, забираю у тебя сигарету, изящно протягиваю\r\nногу и задуваю свечу.\r\nАнна: Чем ты ее задуваешь?\r\nВика: что значит чем? ртом конечно. ты что?\r\nАнна: А зачем тогда ногой дрыгаешь?\r\nВика: @%$&amp;^$&amp;^$# да я просто скопировала текст и заменила выключаю на\r\nзадуваю. Что ты придираешься?\r\nАнна: Hе ругайся, а то я возьму тебя за волосы и опять посажу на пол.\r\nВика: а я буду целовать твои ноги. сначала ступни, потом голени, потом\r\nколенки, и стану подниматься выше выше выше\r\nАнна: Вика, а как ты такие большие буквы делаешь?\r\nВика: да просто таг хэдинга ставлю и все\r\nАнна: Это как?\r\nВика: ты что сюда пришла компьютерной грамоте учиться?\r\nАнна: Hу расскажи, пожалуйста-а-а-а-а-а-а-а-а-а-а-а-а-а-а-а-а\r\nВика: пишешь свой текст и все. будет самый крупный шрифт. H2 - помельче.\r\nи так до H6. других не бывает\r\nАнна: Спасибо! Все поняла.\r\nВика: умница! тогда я продолжу и поцелую тебя вот так\r\nТут под викиным текстом появляется картинка, на которой очень откровенно\r\nпоказано как одна девочка целует другую прямо между ножек.\r\nАнна: Так ты и картинки вставлять умеешь?\r\nВика: анечка тебе уроки делать не пора? что ты людям голову морочишь?\r\nАнна: Hу не сердись. Мне правда надо. Ты умеешь все это делать, домашние\r\nстранички всякие?\r\nВика: да я уже семь сайтов оформила, это моя халтура\r\nАнна: Классно! Вика, а ты нам не поможешь сделать сайт, только не очень\r\nдорого?\r\nВика: кому это вам? школьному кружку "умелые губки"?\r\nАнна: Да нет, фирме. А то начальник достал, требует "представительство в\r\nвебе", а денег не дает.\r\nВика: анечка, сколько тебе лет?\r\nАнна: Hу не 15. Все же хотят быть моложе.\r\nВика: только не все перебарщивают с омоложением\r\nАнна: Да ладно тебе. Ты сколько берешь за сайт?\r\nВика: ну это от объема зависит, от сложности\r\nАнна: Hам не сложный нужно, но не дороже 500 баксов. Можешь сделать?\r\nВика: без скриптов и анимации можно и за 500\r\nАнна: Заметано. Можешь завтра днем в офис на Маяковке подъехать? Обсудим\r\nдетали.\r\nВика: в 4 могу\r\nАнна: Пиши адрес: ...................\r\nВика: это твой начальник?\r\nАнна: Это я сам.\r\nВика: пятнадцатилетняя анечка?\r\nАнна: Да забудь это. О деле говорим. Придешь завтра?\r\nВика: обязательно. до завтра анечка. целую\r\nАнна: Погоди. Hадо же тебе пропуск выписать. Скажи полностью фамилию, имя,\r\nотчество.\r\nВика: Егоров Виктор Александрович.\r\n :D \r\nПо коридору ВУЗа идет профессор. Навстречу студент:\r\n- Здравствуйте, профессор. Можно Вас спросить?\r\n- Конечно, спрашивайте, молодой человек.\r\n- Скажите, профессор, Вы когда спать ложитесь, бороду\r\n  на одеяло или под одеяло кладете?\r\nПосле некоторой паузы:\r\n- Да, знаете, как-то не задумывался.\r\n- Ну, извините, пожалуйста.\r\nРазошлись.\r\nЧерез неделю зеленый профессор с кругами под глазами\r\nвстречает в коридоре того же студента и хватает за грудки:\r\n- Ну ты и сволочь! Неделю уже спать не могу - и так неудобно,\r\n  и так неудобно!\r\n :D \r\nЛетит самолет. Пилот по громкой связи:\r\n- Уважаемые дамы и господа, вас приветствует командир корабля. \r\nПрослушайте информацию о нашем полете. Наш полет проходит \r\nна высоте 10 тысяч метров со скоростью 900 километров в час, \r\nтемпература за бортом...БЛЯ...А-А-А-А!.. ЭТО ЧТО ТАКОЕ?.. НУ, ПИЗДЕЦ...\r\nВ салоне гробовая тишина.\r\nЧерез минуту опять по радио:\r\n- Прошу извинения у уважаемых пассажиров. Просто это наша \r\n  стюардесса опрокинула на меня горячий кофе. Видели ли бы вы \r\n  теперь мои белые брюки спереди...\r\nМужик в первом ряду:\r\n- Твои брюки, это все херня! Видел бы ты мои брюки сзади...\r\n :D \r\nМайк Тайсон выходит на ринг снова. Против него поставили самого\r\nсильного боксера, но в последний момент выясняется, что тому стало \r\nстрашно и он на ринг не выйдет. Что делать? Публика ждет, нужен \r\nсоперник. Смотрят, а возле рынка стоит местный мясник. Говорят ему:\r\n- Отстоишь один раунд, получишь 500 тысяч зелени.\r\nТот согласился. Начинается бой. Тайсон бьет с правой, аперкот и т.д.\r\nМужик стоит весь раунд. Все в шоке. Ему говорят:\r\n- Отстоишь еще раунд - получишь лимон....\r\nОтстоял.\r\nВсе в ужасе. Предлагают:\r\n- Отстоишь еще один - 3 лимона баксов.\r\nМужик:\r\n- Нет, больше не могу, сейчас я его буду пи"дить!!!\r\n :D \r\n\r\nПопали в Ад американец, индус и русский. Встретил их Черт и говорит:\r\n- Всем, кто сюда попадает, даю шанс перейти в Рай.\r\nИ достает здоровенный кнут (побольше, чем у Гаррисона Форда в "Последнем\r\nкрестовом походе"):\r\n- Кто выдержит три удара не закричав - отпускаю! Можете защищаться, чем\r\n  хотите.\r\nПервым вышел американец.\r\n- Чем хочешь защищаться?\r\nАмериканец взял здоровый гранитный камень: \r\n- Я готов!\r\nЧерт размахнулся в первый раз и... камень вдребезги. Второй раз - и\r\nамериканец заорал как бешенный...\r\n- Следующий, - говорит Черт.\r\nВыходит индус.\r\n- Чем будешь защищаться?\r\n- Ничем! - отвечает индус, - Я 80 лет занимался йогой, и в медитации\r\n  тело не чувствует боли!\r\n- Ладно.\r\nПервый удар. Индус: - Ошшш...\r\nВторой удар. Индус: - Ошшш...\r\nТретий удар. Индус: - Ошшш...\r\n- Ух е# твою... Еще никто не выдерживал трех ударов. - говорит Черт. - Ну \r\nчто ж, ты свободен, можешь спокойно идти в Рай.\r\n- Нет, - говорит индус, - хочу остаться и посмотреть. Во всех анекдотах \r\nрусские выигрывают. Хочу увидеть, как у него на этот раз получится.\r\n- Ладно, останься. Ну, чем думаешь защищаться? - обращается Черт к\r\nрусскому.\r\n- Чем защищаться - индусом, конечно...\r\n :D \r\n- А y меня вчеpа дpyг за пять минyт сеpвеp сломал.\r\n- Он что, хакеp??!\r\n- Он мyдак!!\r\n :D \r\nКороче, одному безработному актеру звонит друг и говорит:\r\n- Слушай, тут халтурка подвернулась, я сразу о тебе подумал.\r\nАктер:\r\n- Конечно, какой разговор, - типа, по гроб жизни благодарен, совсем \r\n  на мели. - А что за роль?\r\n- Да понимаешь, не очень большая.  Одна строчка.\r\n- Одна строчка?  Нет проблем, - типа, ну совсем бабок не осталось, \r\n  ничем не брезгует. - А какая?\r\n- "Чу! Я слышу пушек гром."\r\n- "Чу, я слышу пушек гром?"  Годится!  Куда идти?\r\n- В среду подойдешь в Малый, спросишь режиссера такого-то.\r\n- Заметано.\r\nВ среду актер подходит в Малый, находит режиссера, тот: скажите \r\nстрочку, актер с пафосом произносит:\r\n- Чу! Я слышу пушек гром!\r\n- Отлично, - говорит режиссер. - Роль ваша.  Приходите в субботу к 7 \r\n  вечера на спектакль.\r\n- Понял! - отвечает радостный актер.\r\n\r\nЯсное дело, от такого удачного поврота судьбы актер запивает по \r\nчерному.  Приходит в себя в субботу где-то в 6:30 и сломя голову \r\nбросается в театр, всю дорогу повторяя "Чу! Я слышу пушек гром".  \r\nУ театра его останавливает швейцар: ты, мол, куда без билета?\r\n- Я "Чу! Я слышу пушек гром", - объясняет актер.\r\n- А! Ты "Чу! Я слышу пушек гром", - успокаивается швейцар, - ну \r\n  проходи.\r\nАктер - за кулисы.  Его, ясное дело, не пускают.\r\n- Я "Чу! Я слышу пушек гром!", - кричит актер.\r\n- Ты "Чу! Я слышу пушек гром"?  Опаздываешь! Давай срочно в \r\n  гримерную! – кричат ему в ответ.\r\nОн - в гримерную.  Гримерша:\r\n- Товарищ, вы кто?\r\n- Я "Чу! Я слышу пушек гром."\r\n- Вы "Чу! Я слышу пушек гром"?  Что же вы опаздываете?!  Садитесь \r\n  вот тут, сейчас я вас быстренько.\r\nАктер, уже в гриме и в мыле, подбегает к сцене.  Его перехватывет \r\nрежиссер.\r\n- Ты "Чу! Я слышу пушек гром"?\r\n- Я "Чу! Я слышу пушек гром"!\r\n- Чуть не опоздал! Давай, твой выход!\r\nАктер выходит на сцену, и за спиной у него раздается оглушительный\r\nвзрыв. Актер вздрагивает и орет:\r\n- ДА ВЫ ЧТО ТАМ, СОВСЕМ ОХУЕЛИ??!!!\r\n :D \r\n\r\nЧто нужно, чтобы произвести впечатление на женщину:\r\n- говорите ей комплименты\r\n- уважайте ее\r\n- ласкайте ее\r\n- обнимайте ее\r\n- защищайте ее\r\n- тратьте на нее деньги\r\n- поите ее вином и кормите в ресторанах\r\n- покупайте ей то, что она хочет\r\n- слушайте ее\r\n- оставайтесь с ней\r\n- поддерживайте ее\r\n- идите ради нее на край света\r\n\r\nКак произвести впечатление на мужчину:\r\n- разденьтесь и приготовьте пожрать.\r\n :D \r\nМужик, вернувшись домой, видит сдохшего осла прямо напротив входа.\r\nЗвонит в полицию, сообщает об осле.\r\n- А нам-то нахрена звонишь? Возьми да закопай!\r\n- А потому, что в таких случаях принято сообщать родственникам!\r\n :D \r\nТри часа ночи. Муж с женой спят. Вдруг звонок в дверь. Муж, матерясь, \r\nидет открывать. На пороге стоит мужик, очевидно поддатый:\r\n- Друг, пойдем со мной, тут рядом, поможешь меня толкануть. \r\n- Ты, мужик, охренел, что ли? Три часа ночи. Иди кого-нибудь \r\n  другого проси.\r\nМуж ложится опять в постель. Жена спрашивает, кто приходил.\r\n- Да, какой-то козел застрял, просил его толкнуть. Я его послал.\r\n- Ты просто зверюга какой-то. Помнишь, как у нас мотор заглох, \r\n  да под дождем, и нас какой-то парень целый час толкал? Ты что, \r\n  человека выручить не можешь?\r\nМуж, опять матерясь, вылезает из постели, одевается. Выходит \r\nво двор в полной темноте. Кричит:\r\n- Мужик! Ты где?\r\nИз темноты:\r\n- Здесь я! Иди сюда!\r\n- Да где здесь?\r\n- Ну здесь, на качелях!\r\n :D \r\nКак разные народы переносят низкие температуры:\r\n\r\n+10 C: Американцев трясет. Русские сажают огурцы в огородах.\r\n+1.6 C: У итальянцев не заводятся машины. Русские ездят с опущенными\r\nстеклами.\r\n0 C: В Америке замерзает вода. В России вода загустевает.\r\n- 17.9 C: В Нью-Йорке домовладельцы включают отопление. Русские\r\nпоследний раз в сезоне выезжают на пикники.\r\n- 42 C: В Европе не функционирует транспорт. Русские едят мороженое на\r\nулице.\r\n- 73 C: Финский спецназ эвакуирует Санта-Клауса из Лапландии. Русские\r\nнадевают ушанки.\r\n- 114 C: Замерзает этиловый спирт. У русских плохое настроение.\r\n- 273 C: Абсолютный ноль, остананавливается атомарное движение. Русские\r\nругаются: "Холодно, мля!"\r\n- 295 C: У католиков в аду замерзают черти. Российская сборная по\r\nфутболу становится чемпионом мира.\r\n :D \r\nВ начале сотворил Бог небо и землю.\r\nИ сказал Бог: да будет свет. И стал свет. И сказал Oн, что это хорошо.\r\nИ сотворил Бог человека по образу своему. И сказал Oн, что это хорошо.\r\nИ сотворил Бог женщину. Посмотрел на нее и сказал Oн: \r\n"...ладно, она накрасится"...\r\n :D \r\nНа учениях.\r\n- Рядовой Бельдыев, у вас еще осталось немного воды во фляжке?\r\n- Конечно, братан!\r\n- Как это вы отвечаете старшему по званию! Повторяю вопрос:\r\n  у вас есть вода?\r\n- Никак нет, товарищ сержант!\r\n :D \r\nЗвонит герла на радио и говорит:\r\n- Вчера нашла кошелек, там было 5 тысяч долларов, 618 марок\r\n  и визитка на имя Гарика Марикяна, проспект Шверника, 19...\r\n  поставьте ему, пожалуйста, какую-нибудь хорошую песню!\r\n :D \r\nДавненько это было. В те времена, когда народ получил свободу выбора,\r\nгде им сажать картошку, и москвичи рванули скупать по дешевке брошенные\r\nдома в деревнях Тверской, Рязанской, Калужской и других ближних\r\nобластях.\r\nКупили и мы домик в Тверской губернии. На машину денег не осталось,\r\nпоэтому добираться приходилось ЖД транспортом. В основном электричками.\r\nОх, что творилось на вокзалах! Не знаю, как сейчас, давно не был.\r\nНу вот, суббота. Ленинградский вокзал. Народу в ожидании электрички\r\n11.40 на Тверь как комаров на болоте. Огородники, рыбаки, байдарочники,\r\nстуденты, бомжи, мама не горюй! Мне до Твери, там пересадка и дальше.\r\nЗатарился я капитально. Велосипед, рюкзак и собака. Не болонка. Дог.\r\nСтою я и грустно размышляю, как буду со всем этим хозяйством\r\nпробиваться в вагон. А ведь еще и посидеть хочется. Ехать-то три с\r\nлишним часа только до Твери.\r\nСмотрю, рядом молодая симпатичная мамаша с двумя детьми лет примерно\r\nпяти и семи, с чемоданами. Явно не москвичка. Потому что глаза у нее\r\nзаклинило в распахнутом положении навсегда от впечатлений. Детки\r\nтрескают мороженое, а мамаша, чувствую, терзается той же мыслью, что и\r\nя. Как сесть с этим табором? Ну, я и подкатил к ней с предложением\r\nобъединить усилия. Я, говорю, возьму рюкзак и мальчика вашего, сяду,\r\nместо займу, а потом мы с вами уже затащим все остальное. Сказано -\r\nсделано. Сели мы удачно. Занял я крайнее «купе». Народу битком, но\r\nжелающих нас потеснить особо нет ввиду лежащей в проходе догини Даши без\r\nнамордника. Коммуникабельные дети за «погладить собаку» быстренько\r\nвыложили, что едут они в Калашниково (часа полтора от Твери в сторону\r\nПитера) к бабушке. Едут из Тюмени, где их доблестный папка продолжает\r\nповышать благосостояние семьи добычей нефти и подтянется позже. Ну и\r\nзашибись! Мне еще дальше этого Алкашникова, значит, в Твери будем\r\nдействовать по отработанной схеме. Уже хорошо.\r\nДевочка, младшенькая, по странному совпадению тоже Даша, захотела\r\nписать. Мама ей - потерпи. А чего терпеть? Лучше не будет. Идите,\r\nговорю, на перрон, и не стесняйтесь. Здесь сейчас как на передовой.\r\nСходили они удачно, возвращаются. Минуты три до отправления осталось.\r\nСлышу - рев. Даша споткнулась и уронила сандалик между перроном и\r\nвагоном. Мама говорит - наплевать. А Даша сопли по щекам размазывает:\r\nновенькие сандалики, только купили! Ну, ее можно понять. Выскочила\r\nмаманя посмотреть, нельзя ли как нибудь сандалик достать, тут-то двери и\r\nзакрылись.\r\nЯ в окошко вижу проплывающее мимо изумленное лицо. До-о-олго помнить\r\nбуду.\r\nПро стоп-кран я даже не думал. Какой смысл? Пока доберешься до него,\r\nпока народу объяснишь, - руки оторвут.\r\nЕдем. Прокачиваю в мозге варианты. Сойти где-нибудь? А смысл? Сойти и\r\nвернуться? И чего? Сдать детей и багаж ментам? Вариант. Но сколько из\r\nменя менты душу будут вынимать? И через сколько мама с детьми\r\nвстретятся? Еще бы знать, что в голове у этой курицы. Так, про эту\r\nворону без вещей, денег и документов, которая осталась на перроне в\r\nМоскве, вообще не думать! Сама пусть выпутывается! Доехать до Твери и\r\nоставить детей там? Хорошая мысль. Но где Тверь, там и Калашниково. Я\r\nзнаю пункт их назначения. И она знает, что я знаю. Если у нее в голове\r\nне совсем труха - определится. Решено! Едем до Калашниково!\r\nТак! Теперь дети. Даша орет. Это нормально. Надо бы их как-то различить,\r\nа то откликаются обе. Значит, собака останется Дашей, а эта будет\r\nДарьей. Очень хорошо! Публика окружающая косится и шушукается. Насрать\r\nна публику! А вот парнишка, Коля, мне не нравится. Очень спокойный\r\nкакой-то. Не ревет, не требует повернуть поезд. Не суетится. Смотрит мне\r\nв глаза и говорит: "Дядя! Вы ведь нас не бросите?" О, Боже! Чуть слезу\r\nиз меня не вышиб.\r\nМного хорошего я про этого пацана про себя потом сказал. Такой сибирский\r\nмужичок. Семь лет. Успокоил сестру. Без сюсюканья. Сказал: хватит\r\nреветь, та и притихла. Да, серьезно в этой семье поставлен вопрос\r\nнепререкаемости мужского авторитета. Накормил всех нас, четверых,\r\nбулочками, напоил минералкой. Достал из кармана сумки билеты, документы,\r\nденьги, отложенные видимо на дорогу от основной суммы, отдал это все мне\r\nи уж окончательно расслабился.\r\nОдин раз за всю дорогу я чуть было не смалодушничал. Идет по вагону\r\nмилицейский патруль. И смотрю, бабка ряда через три от нас тормозит их и\r\nначинает чего-то втирать. На нас косятся. Ну и ладно, думаю. Значит,\r\nсудьба. А Коля это дело просек и говорит: я в милицию не хочу. Так. Ваши\r\nдокументы! Вот наши документы. Куда следуем? В Калашниково. Это ваши\r\nдети? Мент, ты же видишь, что это не мои дети. Я их сопровождаю. А вот\r\nнам гражданка сказала, что у них мать отстала от электрички. Да нет,\r\nмать их (иху мать!) нас провожала. (Хорошо, что я не стал дергаться и\r\nорать, когда электричка тронулась). Сама осталась в Москве. Будет позже.\r\nТы чего хочешь-то, мент? С вами пройти? Хорошо. Тогда вот бери\r\nвелосипед, рюкзак, два чемодана, собаку, девочку (не дай Бог разбудишь)\r\nи пошли. А сам про себя вспоминаю, есть у нас в УК уже статья о\r\nкинднеппинге или нет еще? И тут Коля говорит: "Дядя Андрей, я писать\r\nхочу!" Это произвело на ментов впечатление. Почесали они тыквы и\r\nсвалили.\r\nПовел я мальца в тамбур. Чего ж, говорю, ты дяденек милиционеров не\r\nлюбишь? А от них, говорит, пахнет всегда плохо - водкой и носками.\r\nТак. Тверь. Конечная. Чемодан раз, мамина сумка, Даша, чемодан два,\r\nДарья, велосипед, рюкзак, Коля замыкающим. Е-мое! Дарья в одном\r\nсандалике. Нехорошо по чужим вещам лазить, а что делать? Коля, ищем\r\nобувку. Нашли. Люди добрыи-и-и-и! Сами мы не местныи-и-и-и! Помогитя,\r\nкто чем моге-е-ет! А именно - перебраться на другой перрон, где\r\nэлектричка на Бологое. Ну, людьми добрыми наше отечество не оскудеет.\r\nЛишь бы чемоданы не спиздили. Но я не представляю, кто тут может бегать\r\nбыстрее Даши. С чемоданом. Помогли нам три солдата - срочника. Мы\r\nотблагодарились сигаретами и пивом. Все довольны. Ура! Едем дальше!!!\r\nКалашниково. Хорошо, что мы озаботились сесть в первый вагон. Так! Коля,\r\nвперед! Тормози локомотив, что б нам сгрузиться успеть. Ну, до чего\r\nтолковый пацан! Дарья, мамина сумка, велосипед, рюкзак, чемодан раз,\r\nчемодан два, Даша последней, у нее, если отстанет, телефон и адрес на\r\nмедальоне выбит, а в обиду она себя не даст. Все!!! Коля! Отпускай\r\nпаровоз!\r\nСели на травке. Чувствую, устали все. Я и сам бы прилег и задремал.\r\nЧасов шесть уже в дороге. А сколько они еще от своей Тюмени ехали? Так!\r\nНе ныть! Я капитан этого непотопляемого судна. Коля - боцман. Дарья\r\nбудет штурманом. Даша - лоцманом. Понюхает Дарьину ножку и приведет нас\r\nпрямо к бабушке. Всем молчать! Капитан думать будет.\r\nА чего думать? Два варианта. Сидеть и ждать маму-ворону. Раз. И\r\nпопробовать найти бабку. Два. А как? Двинуться со всем скарбом и\r\nспрашивать у каждого, не живут ли внуки в Тюмени? Не такое уж и большое\r\nэто Калашниково. Тыщь пять населения. За неделю управимся.\r\nТак! Экипаж, слушай мою команду! Боцман пойдет и найдет мне кусок мела, \r\nизвестки, или на худой конец кирпича. Штурман завязывает лоцману бантики \r\nна всех местах. Лоцман это терпит и бдительно охраняет такелаж. Капитан \r\nуходит в разведку.\r\nЧерез пятнадцать минут я знал, где живет бабушка. А так же с кем, какую \r\nдержит скотину, что сегодня с утра топила баню, а Пашке ейному на \r\nпрошлой неделе набили рожу. И правильно.\r\nВечером, когда мы сидели в летней кухне и уплетали клубнику с молоком, \r\nприжимая к груди сандалик появилась мама-ворона. От нее за версту пахло \r\nвалидолом, корвалолом и настойкой валерианы. \r\nПотом она сказала, что нисколечко не волновалась. Почему-то сразу\r\nрешила, что я порядочный человек, детей никуда не сдам и довезу их до\r\nКалашниково. И заплакала один раз всего только. Когда, подъезжая к\r\nКалашниково, увидела огромную надпись во весь перрон кирпичом по\r\nасфальту: "МАМА!!! МЫ УШЛИ ИСКАТЬ БАБУШКУ!!!"\r\n :D \r\nТаможенник поднимается на корабль для досмотра.\r\n- Наркотики есть?\r\nХозяин корабля отвечает:\r\n- Есть. Вот, пожалуйста (достает чемодан). Вот героин, вот кокаин.\r\n  Все аккуратно упаковано,вот шприц готовый.\r\nТаможенник, вытаращив глаза:\r\n- А может, и оружие есть?\r\nХозяин  (достает другой чемодан):\r\n- Вот макаров, вот калашник ,вот патроны к ним. Все как надо.\r\nТаможенник с усмешкой:\r\n- Наверное, и валюта есть?\r\nХозяин достает третий чемодан:\r\n- Вот миллион долларов, пожалуйста.\r\nТаможенник, ничего не понимая:\r\n- И это все ваше?\r\nХозяин:\r\n- Нет, это ваше. Мое в трюме.\r\n :D \r\nЗНАЙТЕ, ЧТО ВЫ СМОТРИТЕ АМЕРИКАНСКИЙ ФИЛЬМ, ЕСЛИ:\r\n(действующие лица - герой, злодей, АМЕРИКА)\r\n\r\n1. Количество спасаемых человеческих жизней должно быть в пределах \r\nот 2 до 6 миллиардов. \r\n2. Перед тем, как выпустить пулю в героя, злодей обязательно несколько \r\nминут читает ему нотацию, чтобы герой мог придумать какую-нибудь \r\nпакость во избежание неминуемой смерти. \r\n3. Шестизарядные пистолеты стреляют по 30-40 раз (видимо, их умудряются \r\nзаряжать магазинами от автомата).\r\n4. Когда злодей входит в дом жертвы, последняя принимает душ \r\nза прозрачной занавеской.  \r\n5. Для расправы героев загоняют в заброшенные сталелитейные заводы. \r\n6. Вдовы убиенных полицейских получают, как правило, несколько \r\nмиллионов зелененьких в качестве моральной компенсации.\r\n7. После 15 лет совместной жизни любящие супруги продолжают каждые \r\nпять минут страстно целоваться взасос. \r\n8. Злодей имеют такие злобные физиономии, что их надо арестовывать \r\nтолько по внешнему виду. \r\n9. В опасные для жизни моменты рядом с героем находится специальный \r\nвентиль, повернув который обдаешь злодея неслабой струей пара. \r\n10. Хорошо отомстить злодею можно, передавив на гороподобном грузовике \r\nего безумно дорогие машины. \r\n11. Злодеи любят проверять свои мины, когда таймер показывает \r\n00:0_с чем-то. \r\n12. В финальном бою, перед тем, как начать нормально махать руками \r\nи ногами, герой получает основательную взбучку. \r\n13. Входя в стан врага, герой перемещается исключительно кувырками. \r\n14. Кокаин перевозят партиями по 50 тонн. \r\n :D \r\nВ каптерку вбегает сержант и кричит: \r\n- Вашу мать! Кто сказал моей невесте, что каждая нашивка \r\n  означает ребенка? \r\n :D \r\n15.00\r\n	- Алло, милый?.. Мне стало скучно одной дома, и я решила \r\nтебе позвонить. Что ты делаешь?\r\n	- Работаю, конечно. Дел много. Ну, пока.\r\n\r\n15.20\r\n	- Алло, милый?..Мне показалось,что ты говорил со мной \r\nкак-то сухо...\r\n	- Я же на работе, здесь полно людей. До вечера.\r\n\r\n15.30\r\n	- Алло,это ты?..Все-таки ты мог бы сказать мне что-то \r\nласковое и нежное!\r\n\r\n15.35\r\n	- Алло! Раньше ты был смелее - ты на площади кричал о любви \r\nко мне! Трус!..Ну, скажи, что любишь...\r\n	- Не мешай работать, оставь меня в покое!\r\n\r\n15.38\r\n	- Это ты, тряпка?.. Тогда позовите моего мужа. Как какого?! \r\nТого, у которого на морде написано, что он... - трус!.. Если ты \r\nсейчас же не скажешь, что любишь меня, я от тебя уйду!\r\n	- Слава богу! Скатертью дорога!\r\n\r\n15.40\r\n	- Чудовище!..Я собрала вещи...Ну, что - скажешь или нет?\r\n	- Иди к черту!\r\n\r\n15.42\r\n	- Все, негодяй, я ухожу! Прощай! А?\r\n	- !!!\r\n\r\n15.45\r\n	- Алло! Ты еще не ушла?..Тогда слушай: я тебя люблю, зараза, \r\nчтоб ты сдохла!\r\n	- Ну вот... Не задерживайся, я пирог испекла. Целую! \r\n :D \r\nЗНАЙТЕ - ПОРА ОСТАНОВИТЬСЯ, ЕСЛИ:\r\n\r\n- в поездке вы проводите большую часть времени с ноутбуком на\r\n  коленях, сдав ребенка в багаж.\r\n\r\n- жена говорит, что общение весьма важно в браке, и вы покупате\r\n  второй компьютер и делаете дома локалку, чтобы можно было\r\n  поболтать с женой по аське.\r\n\r\n- вы решаете остаться в институте еще на годик или два ради\r\n  бесплатного доступа в интернет.\r\n\r\n- вы считаете, что неудачники - это люди с модемами на 28.8 kbs.\r\n\r\n- вы используете смайлики в обычной, бумажной почте.\r\n\r\n- вы не знаете пол трех своих лучших друзей, потому что у них\r\n  нейтральные ники, а спросить вам не приходило в голову.\r\n\r\n- делая дома ремонт, вы долго не можете решить - наклеить обои\r\n  или растянуть одну картину на всю стену;\r\n\r\n- чтобы улыбнуться, вы наклоняете голову вбок на 90 градусов.\r\n\r\n- купание в ванной вы называете "даунлодинг".\r\n\r\n- вы решаете установить возле компьютера вместо кресла унитаз.\r\n\r\n- каждый раз, выключая модем, вы оказываетесь в ужасной пустоте\r\n  и испытываете колоссальное чувство вины, словно предали\r\n  лучшего друга.\r\n\r\n- новым знакомым вы представляетесь как "Вася @ мэйл точка ру".\r\n\r\n- ваше сердце начинает биться чаще, если в телевизионной рекламе\r\n  вы видите адрес сайта какой-либо компании.\r\n\r\n- выходя из комнаты, вы включаете динамики на полную громкость,\r\n  чтобы не пропустить момент, когда придет новая почта.\r\n\r\n- у всех ваших друзей и знакомых в имени есть символ "@".\r\n\r\n- у вашей собаки есть своя домашняя страничка.\r\n\r\n- вы не можете позвонить родителям - у них нет модема.\r\n\r\n- вы проверяете электронную почту. Если новых сообщений нет,\r\n  вы проверяете ее снова.\r\n\r\n- встав в три часа ночи, чтобы сходить в туалет, вы остаетесь\r\n  у компьютера до утра.\r\n\r\n- жена начала запрещать вам брать ноутбук в постель.\r\n\r\n- ваших детей зовут Яху, Рамблер или Тема.\r\n\r\n- у вас есть татуировка, гласящая "This body best viewed \r\n  with Internet Explorer 4.0 or higher".\r\n\r\n- попав в ДТП, вы инстинктивно ищете кнопку "Back".\r\n\r\n- прочитав это, первым делом вы пересылаете данный текст другу.\r\n :D \r\nЖена начал подозревать мужа в измене, ну и соответственно наняла \r\nдетектива, чтоб он выяснил все раз и навсегда. Ну и через неделю \r\nприходит тот самый детектив и выдает ей распечатки его телефонных \r\nразговоров, а там ТАКОЕ НАПИСАНО :?*)) !! Вечером жена, злая есно \r\nсидит, приходит муж она ему с порога швыряет бумажку. Он читает, \r\nгрустнеет, бледнеет, потом обреченнно говорит: \r\n- Ну и что мы делать теперь будем??\r\nОна, в ярости тыча в бумажку: \r\n- Вот это, вот это, и весь пятый абзац!\r\n :D \r\nКазино под утро. Почти все разошлись, у дальнего стола с рулеткой \r\nскучают два крупье. Вдруг к столу подходит совершенно чумовая девица.\r\n- Хочу сыграть.\r\n- Пожалуйста.\r\n- Только один раз.\r\n- Пожалуйста.\r\n- Поставлю на номер 1000 долларов.\r\n- Ого! Ну пожалуйста.\r\n- Я обязательно выиграю. Я всегда выигрываю.\r\n- Желаем успеха.\r\n- У меня есть счастливый метод. Я буду играть без юбки и без трусиков. \r\n  Вы не против?\r\nКрупье немножко охреневают:\r\n- Почему против? Пожалуйста.\r\nДевица снимает юбку, трусики:\r\n- Пускайте шарик.\r\nКрупье кидает шарик. Девица начинает приподниматься из-за стола:\r\n- Ну, давай, ну давай, ну, НУ, НУ!.. НУ!!.. НУ!!!.. НУ!!!!!! \r\n  УРА-А-А-А-А!!!!! Что я говорила!!!\r\nКидается к крупье, начинает их обнимать, целует шарик...\r\nОдурелые крупье тупо отсчитывают ей фишки, она одевается и уходит...\r\nОдин крупье говорит другому:\r\n- М-да! Бывает же так! Кстати, что выпало?\r\n- Мудила! А на что хоть она поставила?\r\n :D \r\n11 признаков того, что вы мужчина:\r\n\r\n1. Вас перевязали голубой ленточкой.\r\n2. Вы - неоднократный чемпион мира по лыжным гонкам среди женщин.\r\n3. Вы никогда не говорили маме: "Мам, я сегодня у подружки \r\n   заночую!", хотя именно это и делали.\r\n4. Ваше отчество заканчивается на "-ич". (Исключения: Вера Засулич, \r\n   Таня Друбич, Марыля Радович).\r\n5. После того, как вы закончили заниматься любовью, непреодолимая \r\n   сила сразу поворачивает вас лицом к стене и заставляет громко \r\n   храпеть.\r\n6. Два ваших пьяных друга дотащили вас не до своего дома, \r\n   а до вашего.\r\n7. После приобщения к продажной любви денег у вас стало меньше, \r\n   а не больше.\r\n8. Вы приносите в семью мало денег, не то что Сидоров.\r\n9. У вас есть главный половой признак - старое трико с пузырями \r\n   на коленях.\r\n10. Вы испортили кому-либо ее лучшие годы.\r\n11. Вы сволочь, вас убить мало.\r\n :D \r\nЧТО БЫЛО БЫ, БУДЬ МУЖЧИНЫ НА САМОМ ДЕЛЕ АБСОЛЮТНЫМИ ХОЗЯЕВАМИ ЖИЗНИ?\r\n\r\n- Восьмое марта перенесли бы на двадцать девятое февраля. Раз в четыре\r\n  года это еще можно вынести.\r\n- Галстук можно было бы не завязывать. А ширинку не застегивать.\r\n- Пластическая операция по увеличению женской груди входила бы в\r\n  программу бесплатного медицинского страхования.\r\n- Всех женщин звали бы одинаково - для простоты в общении.\r\n- У всех женщин была бы аллергия на золото, драгоценные камни и меха\r\n  животных.\r\n- В женских носах стояли бы специальные фильтры, заглушающие запахи\r\n  пива, пота и лука.\r\n- Тиранозавров вывели бы заново - чтобы в жизни было больше приключений.\r\n- На работе парень, который лучше всех играет в Quake, автоматически\r\n  становился бы начальником.\r\n- Кошек разрешено было бы держать только в двух местах: холодильниках\r\n  китайских ресторанов и в тирах - в качестве мишеней.\r\n- Каждый телефонный аппарат был бы снабжен устройством, прерывающим\r\n  связь через тридцать секунд разговора.\r\n- Салфетки так и остались бы неизобретенными. Галоши тоже.\r\n- Пристальный взгляд на женский бюст при первой встрече расценивался бы\r\n  как официальное признание в любви.\r\n- За проезд в левом ряду со скоростью шестьдесят километров в час\r\n  расстреливали бы на месте.\r\n- Чтобы расстегнуть застежку бюстгальтера, достаточно было бы легко на\r\n  нее дунуть.\r\n- После очередного этапа гонок "Формулы-1" любой желающий мог бы\r\n  порулить болидом победителя.\r\n- Выдав дочь замуж, мать автоматически забывала бы о ее существовании.\r\n  Таким образом проблема тещ была бы решена окончательно.\r\n- Вместо "пивного живота" росли бы "пивные мышцы".\r\n- Переворачивание пинком столика с нардами, шашками или монополией\r\n  автоматически означало бы твою победу.\r\n- В начале передачи новостей дикторы рассказывали бы все свежие матерные\r\n  анекдоты.\r\n- Были бы изобретены носки, которые всегда существовали бы только\r\n  попарно. Оставленные тобой в разных местах, они энергично подползали бы\r\n  друг к другу.\r\n- Купальник-бикини считался бы идеальным костюмом для бизнес-леди. И не\r\n  бизнес тоже.\r\n- Сиденья на унитазах откидывалась бы вверх сразу после того, как с них\r\n  вставали.\r\n- В каждом баре стояли бы раскладушки для тех, кто не собирается сегодня\r\n  отсюда уходить.\r\n- Мусорные пакеты покидали бы дом самостоятельно. По ним достаточно было\r\n  бы хорошенько наподдать ногой.\r\n- Месячные у женщин были бы один раз в год. Во время открытия\r\n  рыболовного сезона.\r\n- Никто не относился бы ни к чему слишком серьезно.\r\n :D \r\nПлывет по Атлантике красивый, большой лайнер.\r\nПублика подобралась тоже соответствующая: мужчины в дорогих смокингах, \r\nженщины в роскошных вечерних платьях. Собрались они  в банкетном зале. \r\nТут выходит капитан:\r\n- Господа, у меня две новости: одна хорошая, другая плохая. С какой\r\n  начнем?\r\nВсе, естественно:\r\n   - С хорошей.\r\nКапитан:\r\n   - Господа, мы получили 11 оскаров!\r\n :D \r\nВ управление крупного банка поступил сигнал, что в одном из отделений \r\nбанка дела очень плохи. Операции почти не совершаются, активность \r\nблизка к нулю. Поехал ревизор это дело проверить.\r\nЯвляется ревизор в это отделение в разгар рабочего дня. Входит внутрь - \r\nтам никого. Только по соседству из кабинета директора слышатся голоса:\r\n-…вполне он мог бубну снести…\r\n-…бубну снес, ну так черва осталась…\r\n-…две, конечно, мы ему всунем…\r\n-…две, это минимум….\r\nЗаглядывает ревизор в этот кабинет и о*уевает - директор отделения \r\nи 3 клерка режутся в карты. Так, думает ревизор, сейчас я им устрою. \r\nВозвращается в операционный зал и нажимает на кнопку тревоги. Начинает \r\nзавывать сирена. Ревизор отпускает кнопку, сирена стихает, и из \r\nкабинета слышится:\r\n-…сначала спокойно трефу отберем…\r\n-…а ход от кого?\r\nОпять ревизор нажимает кнопку. И опять после сирены:\r\n-…а теперь прорезаем пику…\r\n-…точно нет у него бубны…\r\nНет, думает ревизор, я вас все-таки сделаю. Нажимает на кнопку третий \r\nраз. Тут в дверь с улицы входит официант из пивняка напротив, \r\nнесет 4 пива:\r\n- Да слышу я, слышу, уже несу… \r\n :D \r\n- А мой сосед жену свою постоянно называет "ласточка моя", ласково так...\r\n- Что, она у него такая маленькая?\r\n- Да нет, она у него залетает постоянно.\r\n :D \r\nТропическая страна. Туристы садятся в длинную пирогу для прогулки \r\nпо реке. Гид говорит гребцу:\r\n- Слушай, я не могу на всю лодку орать. Я буду только для передних \r\n  рассказывать, а ты все равно в середине сидишь, так повторяй мои \r\n  слова для тех, кто сзади. Получишь чаевые.\r\n- ОК.\r\nНу, поплыли. Гид рассказывает:\r\n- Сейчас мы проплываем мимо типичной местной деревни. Крыши умело \r\n  украшены пальмовыми листьями…\r\nЛодочник:\r\n- Сейчас мы проплываем…крыши…пальмовыми листьями…\r\nГид:\r\n- А сейчас мы оказались в типичном тропическом лесу. Вы видите \r\n  баньяны, лианы, баобабы…\r\n- …в типичном тропическом лесу…лианы, баобабы…\r\nГид:\r\n- Вдали вы можете разглядеть типичного местного жителя, который…\r\nВдруг гид приглядывается и видит, что этот местный житель трахается \r\nс какой-то красоткой, прислонив ее к баобабу.\r\nГид:\r\n-…э-э-э, местного жителя, который, похоже, катается на велосипеде.\r\nЛодочник:\r\n- Вдали вы можете разглядеть типичного местного жителя, который …\r\n(приглядывается)…бля, да это ж мой велосипед!\r\n :D \r\nШестисотый мерин въезжает сзади в каток. Из машины вылезает здоровенный \r\nдетина и начинает звонить по мобиле своему гаишнику.\r\nЧерез некоторое время останавливается милецейская тачка, из нее выходит \r\nгаишник, подходит к водителю катка, отводит его в сторону и задушевно \r\nшепчет:\r\n- Ну, рассказывай. Как обгонял... Как подрезал...\r\n :D \r\nУтром отец говорит сыновьям - какой-то пидар украл у нас ночью \r\nкорову. Младший говорит - раз пидар, значит маленького роста. \r\nСредний - раз маленького роста, значит из Малиновки. Старший - \r\nраз из Малиновки, значит Васька-Косой. Пошли в Малиновку, \r\nнадавали Косому по жопе - не отдает корову. Не крал, - говорит. \r\nПовели братья Ваську-Косого к мировому судье - так, мол, и так, \r\nукрал корову, а не отдает. По жопе надавали - не отдает, по морде \r\nнадавали - не отдает, даже по шарам дали - все одно не отдает. \r\nСудья их спрашивает - а почему вы решили, что это Васька-Косой?\r\n- Как почему? - отвечают братья, - украли корову, значит пидар \r\n  украл, раз пидар , то маленького роста, если маленького роста, \r\n  то из Малиновки, там все короткие, раз из Малиновки, то, ясное \r\n  дело, что Васька-Косой.\r\n- Интересная логика, - говорит судья, - ну, да ладно. Что у меня \r\n  вот в этой коробке?\r\n- Квадратная коробка, - сказал отец.\r\n- Значит, в ней круглое, - сказал младший.\r\n- Круглое, значит оранжевое, - сказал средний.\r\n- Оранжевое - ясен корень, что апельсин, - сказал старший.\r\nСудья достал из коробки апельсин и сказал, задумчиво глядя на Ваську:\r\n- Косой, блин, верни братьям корову!\r\n :D \r\nНовый русский, пьяный в стельку, несется на своем 600 мерсе по шоссе \r\nсо скоростью 200 км в час. Машину постоянно кидает из стороны в сторону.\r\nНу и останавливает его гаишник. "Здравствуйте, - говорит. - Я сержант \r\nмилиции Пупкин. Ваши права, пожалуйста. Вы превысили скорость и Вы \r\nуправляете машиной в нетрезвом виде!"\r\n- Никак нет, начальник - ни в одном глазу!\r\n- Хорошо, тогда тест на алкоголь, подышите, пожалуйста, в трубочку.\r\nДышит.\r\n- Странно, реакции на алкоголь нет, ну давайте еще тест. Подносим \r\n  попеременно указательные пальцы к носу с закрытыми глазами.\r\n- Без базара! - несколько раз подносит пальцы к носу.\r\nОзадаченный гаишник предлагает третий и последний тест. Рисует мелом \r\nна асфальте прямую линию и, смотря на нового русского, спрашивает: \r\n- Знаете, что делать?\r\n- Не вопрос, командир.\r\nВстает на колени на асфальт и, зажав пальцем левую ноздрю, с шумом \r\nзатягивает всю дорожку.      \r\n :D \r\nЯхта Ротшильда потерпела крушение в Карибском море. Ротшильд с женой \r\nблагополучно добрался до маленького атолла на надувном плоту. Осмотрев \r\nатолл, он невозмутимо сел на песок и стал смотреть на море.\r\n- Чего ты ждешь, старый болван, нас же никогда здесь не найдут, \r\n  мы погибнем от голода и жажды, делай же что-нибудь, кретин...!!!, - \r\nв истерике закричала на него жена.\r\n- Успокойся, дорогая. Послушай, что я тебе скажу. Три года назад, \r\n  как щас помню 23 июля, я пожертвовал Главной Синагоге Америки 500 тыщ\r\n  долларов. Через год, после одной удачной сделки на бирже, я опять решил \r\n  сделать им пожертвование, и в тот же день, 23 июля, перевел на их счет \r\n  700 тысяч долларов. В прошлом году мои нефтяные акции круто поползли \r\n  вверх, и я наварил 12 лимонов с их продажи. Один миллион, как всегда,\r\n  по традиции, 23 июля я отослал в синагогу. Вот так-то.\r\n- Ну и что с того? - спросила жена.\r\n- А то, милая, что сегодня 22 июля, и не пройдет и двух дней, как\r\n  они нас найдут....!!!\r\n :D \r\nФермер утром выходит во двор, сосредоточенно смотрит вдаль \r\nи думает: "Так, коров я подоил, коням корм задал, что еще... \r\nЧерт, у меня ж баба не@бана!"\r\n :D \r\n- Вы уверены,что хотите удалить папку D:TEMP ?\r\n- Да.\r\n- В этой папке находятся файлы. Вы уверены, что хотите их удалить?\r\n- Да!\r\n- Удаление этих файлов может повлиять на зарегистрированные \r\n  программы. Вы все еще уверены?\r\n- Да! Да! Да!!!  \r\n- Эти файлы могут использоваться системой. Вы уверены?\r\n- Пошла ты нахуй! - заорал админ и нажал Cancel.\r\n- Ага! Испугался! - подумала NT\r\n :D \r\nВ общем, ситуация классическая. Жена в постели с утомленным \r\nлюбовником, неожиданно врывается муж. Жена кричит любовнику:\r\n- Дорогой! Докажи ему, что ты настоящий мужчина!\r\nЛюбовник:\r\n- КАК? И ЕМУ ТОЖЕ?\r\n :D \r\nОднажды к Кролику ( из "Винни-Пуха") подошли и спросили:\r\n- Что вы думаете про Бориса Николаевича Ельцина?\r\n- Борис Николаевич Ельцин, - ответил Кролик, - грамотный стратег,\r\n  оптимально выбирающий пути развития России, великолепно проявивший \r\n  себя в подборе и расстановке компетентных руководителей на ключевые \r\n  посты в стране, и умеющий вовремя отправить их в отставку.\r\nА что Кролик подумал на самом деле, так никто и не узнал -\r\nпотому, что он был очень воспитанный... \r\n :D \r\nЕдут молодая мама с грудным ребенком в автобусе, а рядом сидит грузин.\r\nМама пытается покормить ребенка грудью, а ребенок отворачивается. Мама:\r\n- Ну покушай, покушай! (Ребенок отворачивается...) А то отдам сисю тому \r\nдяде! (Ребенок отворачивается...) Кушай, кушай, а то отдам сисю дяде!\r\nРебенок опять не хочет.\r\nГрузин не выдерживает:\r\n- Слишш девущка... Определайса, а то я уже третью остановку проезжаю!\r\n :D \r\nИталия. Бар в небольшом городке на берегу Адриатики. \r\nЗа столиком сидит небольшая, но шумная и уже подпитая группа \r\nитальянцев. В помещение, с доской под мышкой, на которой навешано \r\nразное барахло для продажи, входит здоровенный ленивый черный \r\nмарокканец, подходит к стойке бара и заказывает стакан воды. \r\nИтальянцы прекращают шуметь и переключают все внимание на негра.\r\n    Через пару секунд компания оживляется, и самый эдакий шустрый\r\nитальяшка (И) кричит марокканцу (М):\r\n     - Эй, марокканец, иди сюда!\r\n     Тот подходит.\r\n(И)  - Угадай, почему ты весь черный, а ладони у тебя белые?\r\n(М)  - Не знаю...\r\n(И)  - Это потому что когда я тебя красил, ты ими о стену опирался!!!\r\n    Ну, итальянцы в рогот, а тот помялся-помялся да и пошел к стойке.\r\n    А итальянец не унимается и через минуту опять:\r\n     - Эй, марокканец, иди сюда!\r\n     Подходит.\r\n(И)  - Угадай, почему ты сам черный, а ступни у тебя белые?\r\n(М)  - Не знаю,- говорит.\r\n(И)  - Это оттого, что когда я тебя красил, ты на земле стоял!!!!\r\n    Итальянцы со смеху мрут, а негр постоял-постоял, да и пошел \r\nводу допивать. Допил, значит, взял свое барахло, подходит к тому \r\nстолу веселому и спрашивает у итальяшки:\r\n     - А ты знаешь, почему ты весь белый, а дырка у тебя в заднице\r\nчерная?\r\n     -?!?!?!...\r\n     - Это потому что когда я тебя ебал, на мне краска еще не обсохла!!!\r\n :D \r\nСидят два мужика в кафе. Подходит официант:\r\n- Я вас слушаю.\r\nОдин:\r\n- Мне томатный сок, пожалуйста.\r\nВторой:\r\n- Ты что! Будешь пить кровь мертвых помидоров?!\r\n :D \r\nПриходит английский лорд домой. Ему открывает дворецкий и говорит:\r\n- Ну что, старый хрен, опять бухал и шлялся по девкам?\r\n- Нет, Джон, ходил покупать слуховой аппарат...\r\n :D \r\nСудят грузина за убийство соседа. Судья говорит: ну рассказывайте, \r\nподсудимый, как это произошло.\r\nГрузин говорит: Прихажю я, значыт, домой. Смотрю, дверь открыта. Вижу, \r\nмой сасед маю жену обнимает. Я хватаюсь за кинжал, но потом вспоминаю: \r\nя ведь тоже его жену обнимал! Смотрю дальше: мой сосед маю жену раздевает! \r\nЯ хватаюсь за кинжал, но потом вспаминаю: я ведь тоже его жену раздевал! \r\nСмотрю дальше. Мой сосед мою жену валит на кровать!! Я хватаюсь за кинжал, \r\nно потом вспоминаю: я  ведь тоже его жену валил на кровать...\r\n  Судья(устало): короче,подсудимый, за что вы убили своего соседа?\r\n  Грузин(возмущенно): я свой х.й об его занавэску не вытирал!!\r\n :D \r\nАмерика. Парень провожает девушку после свидания домой, доходят \r\nдо крыльца ее дома и парень, опершись одной рукой о косяк двери, \r\nвдруг говорит:\r\n- Мэри, сделай мне, минет, пожалуйста...\r\n- Ты что, сдурел, на пороге дома? А вдруг соседи увидят!\r\n- Черт с ними, соседями, один минетик, Мэри....\r\n- Нет, не сейчас, лучше завтра.\r\n- Мэри, один легкий отсос, я же знаю - тебе это нравится..\r\n- Нет, Нет и Нет, сейчас не буду...\r\n- Пожалуйста, Мэри, пососи немного, ты же столько раз это делала \r\n  для меня и моих товарищей...\r\n- Отстань от меня....\r\nи т.д.\r\nВ этот момент открывается дверь и на пороге дома появляется заспанная \r\nвсклокоченная младшая сестра девушки и говорит:\r\n- Добрый вечер. Папа сказал, чтобы я вам отсосала, или чтобы мы \r\n  с сестрой вам отсосали, или чтоб вы у себя отсосали, или папа \r\n  спустится и вы у него отсосете, НО РАДИ БОГА УБЕРИТЕ РУКУ С ДОМОФОНА!\r\n :D \r\nМаленький мальчик носится по квартире. Сбрасывает книжки с буфета, \r\nраскидывает одежду, опрокидывает стулья. Прибегает нянечка \r\nи спрашивает:\r\n- Ты что делаешь?\r\n- Я играю в игру\r\n- В какую?\r\n- "Ёб твою мать где ключи от машины"!!! \r\n :D \r\nВот 4 вопроса, которые используют кадровые агентства мирового уровня для\r\nтого, чтобы оценить умственные способности кандидатов:\r\n\r\nВопрос 1: Как засунуть жирафа в холодильник?\r\n\r\nПравильный ответ: Открыть холодильник, засунуть туда жирафа, закрыть\r\nхолодильник.\r\n\r\n--&gt; Этот вопрос позволяет выяснить, нет ли у вас склонности выискивать\r\n    чересчур сложные решения для простых задач.\r\n\r\nВопрос 2: Как засунуть в холодильник слона?\r\n\r\nНеправильный ответ: Открыть холодильник, засунуть туда слона, закрыть\r\nхолодильник.\r\nПравильный ответ: Открыть холодильник, вынуть оттуда жирафа, засунуть\r\nтуда слона, закрыть холодильник.\r\n\r\n--&gt; Этот вопрос позволяет выяснить, способны ли вы при принятии решений\r\n    учитывать последствия ваших предыдущих действий.\r\n\r\nВопрос 3: Лев созвал всех зверей на собрание. Явились все, кроме одного.\r\nЧто это за зверь?\r\n\r\nПравильный ответ: Это слон. Он же в холодильнике, помните?\r\n\r\n--&gt; Этот вопрос проверяет вашу память.\r\n\r\nОК. Даже если вам не удалось правильно ответить на предыдущие три\r\nвопроса, у вас все же остался шанс показать, на что вы способны.\r\n\r\nВопрос 4: Вам нужно пересечь широкую реку, которая кишит крокодилами.\r\nКак вы это сделаете?\r\n\r\nПравильный ответ: Вплавь. Ведь крокодилы-то все на собрании у льва.\r\n\r\n--&gt; Этот вопрос позволяет выяснить, способны ли вы учиться на\r\n    собственных ошибках.\r\n\r\nЗадайте эти вопросы своим друзьям, пусть и они поломают голову 8)\r\n :D \r\nСочи. Знойный полдень. Пляж... На золотисто-желтом песке лежит\r\nредкой красоты обнаженная женщина. Проходящий мимо старик \r\nостанавливается и принимается восторженно созерцать данное \r\nчудо природы. \r\n- Что ты смотришь на меня, старый хрен! Я холодна, как рыба...\r\nВ ответ старик, по-детски почмокав губами, произносит мечтательно:\r\n- Эх, и хороша же в жаркую пору холодная рыба да под старым хреном!\r\n :D \r\nЖенатая пара едет по загородному шоссе. Никуда не торопятся, скорость - \r\nкилометров 60. Муж за рулем. Жена, сидя справа, поворачивается к нему и говорит:\r\n- Дорогой, мы женаты вот уже 15 лет, но сегодня я решила сказать тебе, что хочу \r\n  развода.\r\nМуж ничего не отвечает, только постепенно увеличивает скорость до 70 километров.\r\n- И я не хочу, чтобы ты меня отговаривал, это уже решено. Я сплю с твоим лучшим \r\n  другом, и он гораздо более хороший любовник, чем ты.\r\nОпять муж ничего не отвечает, но увеличивает скорость до 80 километров в час.\r\n- Я забираю у тебя наш дом.\r\nМуж едет со скоростью 90.\r\n- И детей.\r\nТеперь на спидометре уже 100 километров.\r\n- А также все твои деньги и машину.\r\nМуж молчит, только постепенно начинает направлять машину к опоре ближайшего моста \r\nна дороге.\r\n- А тебе что-нибудь нужно? - спрашивает жена.\r\n- Нет, у меня есть все, что нужно, - наконец отвечает муж.\r\n- И что же?\r\nИ за секунду до того, как машина ударилась о бетонную стенку, он отвечает:\r\n- Подушка безопасности.\r\n :D \r\nОдна деваха клюнула на объяву в газете:\r\n"Требуются молодые и красивые девушки. Не интим"\r\nИ решила поучаствовать.\r\nПриходит, а там снимают крутое порно. Ее тут же раздевают \r\nи начинается групповуха.\r\nПосле съемок она размазывет сопли по косметике и говорит: \r\n- Ну было же написано "Не интим"!\r\nПомреж ей говорит:\r\n- Правильно, интим - это вдвоем при свечах, а это просто секс!\r\n :D \r\nВыходит утром гаишник на дорогу, голова после вчерашнего раскалывается.\r\nСмотрит - джип несется. Ну он остановил его с целью сбора средств \r\nна опохмел. Смотрит, а там бомж сидит. Документы проверил - правда, \r\nбомжа машина. Ну мент его спрашивает:\r\n- Ты же бомж. Ты где такую крутую тачку взял?\r\n- А мне пьяные новые русские предложили, если я их рассмешу - джип мой.\r\n  Ну я их и рассмешил.\r\n- А как?\r\n- Да я одному лысому на голову насрал, у него сразу волосы выросли,\r\n  вот умора была.\r\nМент шапку снимает, там лысина. Он и говорит:\r\n- А ты мне так насрать можешь?\r\n- Могу.\r\nБомж срет менту на лысину, a из кустов раздается хохот и крик:\r\n- Не, ну ваще, да я ему еще и хату подарю.\r\n :D \r\nПpавила езды для МАЗов:\r\nВыехать на пеpекpесток, посмотpеть налево-напpаво - нет ли дpyгого\r\nМАЗа, пpодолжить движение.\r\n :D \r\nОдин мужик, решив проверить правильность пословицы "есть еще порох\r\nв пороховницах", стал регулярно подсыпать себе в еду вместо соли \r\nпорох. Заметив улучшение своего состояния, он продолжил поедать \r\nсей продукт. Он прожил 108 лет, оставив после себя 10 детей, \r\n28 внуков, 44 правнука и 5-метровую воронку на месте крематория.\r\n :D');
INSERT INTO zforums_posts_text VALUES (158, '34753d5311', '', 'Однажды короля Артура поймал другой царь и посадил в тюрьму. \r\nПотом он его пожалел и сказал, что отпустит его, если тот \r\nответит на один очень сложный вопрос. Королю Артуру давался \r\nгод, чтобы найти ответ.  Если он не сможет ответить, то будет \r\nказнен. Вопрос был: "Что на самом деле хотят женщины?"\r\n\r\nКороль Артур опрашивал всю женскую половину своего королевства \r\nв течении года, и никто не дал ему ответа. Наконец, ему сказали \r\nчто одна старая ведьма может дать ему ответ, но ее цена будет \r\nочень высока. У короля не было выбора, он пошел к ней и спросил, \r\nчто она хочет. Она хотела выйти замуж за его лучшего рыцаря \r\nГаваина. Ведьма была жутко страшная, старая, противная \r\nи с одним зубом.\r\n\r\nАртур сказал, что он не хочет заставлять своего друга это делать \r\nи лучше умрет. Тем не менее, Гаваин сказал, что жизнь Артура важна \r\nдля всего королевства и он согласен жениться на старой противной \r\nведьме. После этого ведьма ответила на вопрос Артура. \r\n\r\nОна сказала, что женщины больше всего хотят распоряжаться своей \r\nсобственной жизнью. \r\n\r\nПосле этого жизнь Артура была спасена, все радовались и наступило \r\nвремя свадьбы. Рыцарь Гаваин был настоящим джентльменом, в то время \r\nкак ведьма отвратительно себя вела, жрала руками и пердела \r\nво время свадьбы. \r\n\r\nКогда наступила свадебная ночь, Гаваин, скрепя сердце, зашел в спальню. \r\nПеред его глазами лежала самая красивая женщина, которую он когда-либо \r\nвидел. Он удивленно спросил, что случилось. Ведьма ответила, что \r\nв благодарность за хорошее отношение к ней, когда она была страшной \r\nи противной, она согласна половину времени быть молодой красавицей, \r\nа половину времени - старой ведьмой. Затем она сказала, что он должен \r\nвыбрать, какой он хочет чтобы она была днем, а какой ночью. Гаваин \r\nзадумался. Хочет ли он, чтобы днем его видели с красавицей, а ночи \r\nпроводить со старой каргой, или иметь днем страшную ведьму, а ночью \r\nбыть с красавицей? Он решил дать ей решать самой. После того как она \r\nэто услышала, она сказала, что всегда будет красавицей, потому что он \r\nее уважает и дает ей возможность распоряжаться своей собственной \r\nжизнью.\r\n\r\nТак какова мораль этой длинной истории?\r\nМораль такова - не имеет значения, красивая ваша женщина или страшная, \r\nумная или глупая. Под всем этим она все равно ведьма...\r\n :D \r\nГлаза: - Видим пивную точку.\r\nМозг: - Ноги, поворачиваем.\r\nНоги: - А у нас шнурок развязался.\r\nРот: - Мне парочку, пожалуйста.\r\nГлаза: - Пиво мутное, гадость.\r\nМозг: - Ничего, желудок разберется.\r\nПрямая кишка: - Ага, разбираться опять через меня будете.\r\nМозг: - Тебе не привыкать.\r\nЖелудок: - Ой, хорошо-то как.\r\nРот: - Еще парочку.\r\nРуки: - Тухни, денег нет.\r\nМозг: - А мне по кайфу.\r\nМочевой пузырь: - Вот так всегда, верхам по кайфу, а низам вкалывать.\r\nЖелудок: - Петь охота.\r\nРот: - Я тте спою.\r\nПочки: (глубоко дышат)\r\nМочевой пузырь: -Ой, не могу.\r\nМозг: - Эй, ноги, помогите пузырю. Правая поднялась, опустилась.\r\nЛевая поднялась, опустилась. Раз, два, раз, два....\r\nНоги: - Блин, шнурок развязался.\r\nМозг: - Уломали. Туловище, нагибаемся.\r\nВестибулярный аппарат: - Отключаюсь.\r\nЖелудок: - Щас спою.\r\nМозг: - Туловище, отставить.\r\nВестибулярный аппарат: - Включаюсь.\r\nЖелудок: - Все равно спою.\r\nМочевой пузырь: - Или сейчас, или никогда.\r\nМозг: - Вас понял. Ноги, вперед за угол.\r\nНоги: - А у нас шнурок развязался.\r\nМозг: - Я же сказал, за угол.\r\nВестибулярный аппарат: - Бывааали дни весеелые...\r\nГлаза: - К какому углу?\r\nМозг: - К ближайшему.\r\nПравый глаз: - К правому.\r\nЛевый глаз: - К левому.\r\nНоги: - А мы на шнурок наступили.\r\nШишка на лбу: - ЗдорОво, мужики.\r\nМочевой пузырь: - Быстрей, быстрей.\r\nНоги: - Раз, два, раз, два..\r\nМочевой пузырь: - Уффф!  \r\nРот: - Еще парочку.\r\nШишка на лбу: - Правильно, я себе братика хочу.\r\nМозг: - Глохни, синяк безмозглый.\r\nШишка: - Я гематома, это ты - синяк.\r\nПочки: - Надоело, отключаемся.\r\nПравый глаз: - Ой, какая девушка идет.\r\nЛевый: - Где?\r\nПозвоночник: - Спинным мозгом чую - блондинка!\r\nГлаза: - Впереди столб.\r\nГолова: - Бум!\r\nГлаза: - Ой, какие звездочки.\r\nМозг: - Сам вижу. Беру управление на себя.\r\nПозвоночник: - 5.4.3.2.1 поехали!\r\nРот: - Земля в иллюминаторе....\r\n :D \r\nОтвечать надо быстро, не раздумывая и не тратя понапрасну время.\r\nА главное - не мошенничать!\r\n\r\n1. Вы участвуете в соревнованиях и обогнали бегуна, занимающего вторую\r\nпозицию. Какую позицию вы теперь занимаете?\r\n\r\nОтвет: Если вы ответили, что вы теперь первый - то вы абсолютно не\r\nправы.\r\nВы обогнали второго бегуна и заняли его место, так что вы теперь на\r\nвторой позиции.\r\n\r\nПопробуйте не ошибиться во втором вопросе.\r\n2. Вы обогнали последнего бегуна, на какой позиции вы теперь находитесь?\r\n\r\nОтвет: Если вы ответили на предпоследнем - вы опять абсолютно не правы.\r\nПодумайте. Как можно обогнать бегуна, идущего последним? Если вы бежите\r\nза ним, значит он не последний. Ответ - это невозможно. Получается, что\r\nиспользование мозга ваша не самая сильная сторона.\r\n\r\nКак бы то ни было - вот еще один вопрос. Ничего не пишите и не\r\nиспользуйте калькулятор, и помните - вы должны отвечать быстро.\r\nВозьмите 1000. Прибавьте 40. Прибавьте еще тысячу. Прибавьте 30.\r\nЕще 1000.\r\nПлюс 20. Плюс 1000. И плюс 10. Что получилось?\r\nОтвет 5000? Опять неверно. Правильный ответ 4100. Попробуйте пересчитать\r\nна калькуляторе.\r\n\r\nСегодня точно не ваш день. Но, может быть, получится с последним вопросом.\r\nУ отца Мэри есть пять дочерей: 1. Чача 2. Чече 3. Чичи 4 Чочо.\r\nВопрос: Как зовут пятую дочь? Думайте быстро. Ответ чуть ниже.\r\n\r\nОтвет: Чучу? НЕТ! Конечно, ее зовут Мэри. Прочтите еще раз вопрос.\r\n\r\nВЫВОД: Вы самое слабое звено - прощайте.\r\n :D \r\nТелефонный опрос, проведенный наутро после 31 декабря, дал следующие \r\nрезультаты: 2% опрошенных ответили "да?"; 3% - "алло?"; остальные 95%\r\nзатруднились ответить.\r\n :D \r\nIF-2004-РОССИЯ-ЧЕЧНЯ-ТЕРРОРИСТЫ-ЗАХВАТ\r\n\r\nНА ТЕРРИТОРИИ ЧЕЧНИ ЗАХВАЧЕНО КРУПНОЕ БАНДФОРМИРОВАНИЕ\r\n\r\nМосква. 20 апреля. ИНТЕРФАКС. - Как заявил в четверг журналистам в \r\nМоскве первый заместитель начальника генерального штаба \r\nВооруженных сил России генерал-полковник Валерий Манилов, в \r\nрезультате спецоперации на территории Чеченской Республики захвачено \r\nкрупное бандформирование сепаратистов. В следственном изоляторе \r\n"Лефортово", куда уже доставлены боевики, ведутся предварительные \r\nдопросы таких известных сепаратистов, как\r\n  Ушат Помоев,\r\n  Улов Налимов,\r\n  Букет Левкоев,\r\n  Рекорд Надоев,\r\n  Отряд Ковбоев,\r\n  Подрыв Устоев, \r\n  Подиум Прибоев,\r\n  Погром Евреев,\r\n  Поджог Сараев,\r\n  Захват Покоев,\r\n  Исход Изгоев,\r\n  Побег Злодеев,\r\n  Обвал Забоев,\r\n  Угон Харлеев,\r\n  Удел Плебеев,\r\n  Камаз Отходов,\r\n  Развод Супругов,\r\n  Забег Дебилов,\r\n  Парад Уродов.\r\n  По некоторым сведениям, среди арестованных имеется также воевавший \r\nна стороне боевиков абхазский снайпер Партучеба.\r\n  Личности других террористов в настоящий момент устанавливаются.\r\n :D \r\n- Прикинь, моя сестра чиканулась. Она переоделась мужчиной \r\n  и пошла служить в армию.\r\n- Но ведь ей придется ходить в баню с мужиками. Кто-нить \r\n  обязательно сдаст!\r\n- Да кто сдаст-то?!?!?!?!\r\n :D \r\nВ одной частной парикмахерской работал один парикмахер с молодым \r\nучеником. Как-то ученик говорит своему шефу:\r\n- Тут к нам в парикмахерскую последнее время повадился ходить \r\n  какой-то странный тип!\r\n- А что за тип? - спрашивает парикмахер.\r\n- Да приходит каждый день после обеда, пересчитает всех людей \r\n  в очереди и уходит. Прямо какой-то ненормальный. Вот скоро, \r\n  наверно, опять придет…\r\n- Ты знаешь что, - говорит парикмахер - ты, когда он от нас выйдет, \r\n  пойди назаметно проследи за ним, а потом мне расскажешь.\r\nНу, действительно, через некоторое время приходит хорошо одетый \r\nмолодой человек и начинает всех в очереди считать: "Раз, два, три, \r\nчетыре! пять!! шесть!!!". Потом поворачивается и молча уходит.\r\nПарнишка-ученик, как ему было велено, тоже за ним незаметно \r\nвыскользнул. Через некоторое время возвращается. Парикмахер, \r\nестественно, спрашивает:\r\n- Ну, рассказывай, чего этот тип делал, когда от нас ушел? \r\n- Да купил букет цветов и пошел домой…\r\n- Ну значит точно псих - говорит парикмахер.\r\n- Не-а, он к вам домой пошел…\r\n :D \r\nМолодожены по дороге в церковь попали в аварию и прямиком\r\nотправились в рай на встречу с Богом.\r\n- Мы так любим друг друга, и хотим все-таки пожениться, - \r\nпросят молодожены у него.\r\n- Вы тут первые с такой просьбой, - \r\nсказал Бог и исчез на три недели. Через три недели он появился \r\nсо священником, который их и повенчал. А молодожены опять недовольны:\r\n- Так, вроде, в раю ни к чему брак. А нельзя ли развестись?\r\n- Не морочьте мне голову! Я три недели потратил, чтобы найти в раю хоть  \r\n  какого-нибудь священника! Вы хоть представляете, сколько времени\r\n  потребуется, чтобы найти в раю адвоката?!\r\n :D \r\nСообразили два зайца в лесу на пузырек водки, а закуски нету :(\r\nРешили пойти к вороне.\r\nНашли ворону на ветке, а в клюве у нее сыр.\r\n- Привет, ворона!\r\nОна молчит...\r\n- Выпить хошь?\r\n- ДА!\r\nСыр падает и зайцы съебываются.\r\nНа следующий день опять с бутылкой к вороне:\r\n- Ворона, выпить хошь?\r\nМолчание...\r\nЗаяц, наливая в стакан, спрашивает:\r\n- Столько хватит?\r\n- ДА!\r\nСыр падает, зайцы съебываются.\r\nНа третий день снова с бутылкой к вороне:\r\n- Ворона, выпить хошь?\r\nМолчание...\r\nЗаяц, наливая в стакан:\r\n- Столько хватит?\r\nМолчание...\r\n- Ворона, ты что думаешь, мы тебя наебать хотим?\r\n- ДА!!!!\r\n :D \r\nУ мужчины спрашивают: \r\n- Какова вероятность того, что, выйдя на Невский, \r\n  вы встретите динозавра?\r\nМужчина:\r\n- Одна миллиардная.\r\nУ женщины спрашивают: \r\n- Какова вероятность того, что, выйдя на Невский, \r\n  вы встретите динозавра?\r\nЖенщина: \r\n- Одна вторая.\r\n- Как так? - спрашивают.\r\n- Ну, - говорит, - или встречу, или не встречу.\r\n :D \r\nМосковское метро в час пик. Все едут спрессованные. Вдруг одна девушка \r\nначинает возмущаться:\r\n- Нет, ну это хамство. Молодой человек, отодвиньтесь от меня.\r\n- Девушка, ну что вы, успокойтесь. Это не то, что вы думаете. \r\n  Я сегодня получку получил, это деньги свернутые у меня в кармане.\r\nПроехали еще несколько станций. Вдруг девушка говорит:\r\n- Молодой человек, только не говорите мне, что после "Киевской" \r\n  вам прибавили зарплату.\r\n :D \r\nДжон и Билл с женами играли в карты. У Джона случайно выпала из\r\nрук карта. Когда он полез за ней под стол, то увидел, что жена\r\nБилла без трусов. Весь красный, он вылез из-под стола и продолжил\r\nигру. Чуть позже, на кухне, жена Билла спросила его, заметил ли он\r\nпод столом что-то, что ему понравилось.\r\n- Да, очень даже понравилось, - ответил Джон.\r\n- Ты  можешь иметь это за 100 долларов, - сказала она, - Билл по\r\n  пятницам работает во второй половине дня и если ты придешь  \r\n  около 2-х часов после обеда, все будет в порядке.\r\nВ пятницу, Джон пришел к ней в два часа, хорошенько потрахал ее,\r\nзаплатил 100 долларов и свалил.\r\nВечером, когда Билл пришел домой, он сразу спросил жену,\r\nзаходил ли Джон.\r\n- Да, он забежал на пару минут, - с неохотой ответила жена.\r\n- Он дал тебе 100 долларов? - снова задал вопрос муж.\r\n"О Боже! Он все знает" - подумала жена и сказала:\r\n- Да, он дал мне 100 долларов.\r\n- Ну и хорошо, - сказал муж, - он забегал ко мне на работу сегодня\r\n  утром и одолжил 100 баксов, сказав, что обязательно занесет \r\n  долг после обеда...\r\n :D \r\nКак работает Америка:\r\n\r\nЕсли женщина ошпаривает себе ляжки горячим кофе, который она поставила\r\nна сиденье между ног, в то же время управляя машиной и говоря по\r\nмобильнику, она обвиняет ресторан.\r\n\r\nЕсли ваш сын кончает жизнь самоубийством, вы обвиняете рок-н-ролл или\r\nего любимого музыканта.\r\n\r\nЕсли вы, выкуривая по три пачки в день в течение 40 лет, умираете от\r\nрака легких, ваша семья обвиняет табачную компанию.\r\n\r\nЕсли ваша дочь беременеет от капитана школьной футбольной команды, вы\r\nвините школу за плохое сексуальное просвещение.\r\n\r\nЕсли ваш сосед врезался в дерево, когда ехал домой пьяный - виноват\r\nбармен.\r\n\r\nЕсли ваш родственник подцепил СПИД, потому что колол себе героин грязным\r\nшприцом - виновато правительство, не снабдившее его стерильным.\r\n\r\nЕсли ваши внуки - придурки, не умеющие себя вести - виновато\r\nтелевидение.\r\n\r\nЕсли вашего друга застрелил спятивший псих - виноват производитель\r\nоружия.\r\n\r\nЕсли еще один псих вламывается в кабину самолета и пытается убить\r\nлетчика на высоте 10 000 м, а вместо этого пассажиры убивают его самого,\r\nмать погибшего обвиняет авиакомпанию.\r\n\r\nЯ прожил достаточно долго для того, чтобы понять, что такое мир и каков\r\nон. Так что если я умру, сидя на своем старом, сморщенном заду перед\r\nэтим компьютером, я хочу, чтобы вы свалили вину на Билла Гейтса.\r\n :D \r\nДеревня. Ночь. В избе старик отец укладывается на печке. Почти засыпает, \r\nно сквозь дрему слышит, как внизу молодые шебуршатся.\r\nСтарикан, засыпая, посмеивается про себя:...эх молдость, молодость...\r\nА внизу шепчутся:\r\n - давай стоя\r\n - ну давай\r\n - а давай терерь сидя\r\n - давай\r\n - давай ты сверху\r\n - давай\r\n - давай валетиком\r\n - давай\r\n - давай раком\r\n - давай\r\n - давай кандрибобиком\r\n - давай\r\nОпа!!! Старикана аж подбросило, че за дела - ни разу не слыхал. Дай\r\nхоть подсмотрю! Нагнулся, вглядывается - ниче не видать... темень.\r\nВысовается дальше... не видать... дальше... не видать...\r\nГнулся, гнулся, пока с полки не полетел. Шум на весь дом... ушаты,\r\nприхваты, кастрюли, котелки все по дороге прихватил. Поднялся кое-как,\r\nбок почесывает, пытается обратно заползти.\r\nВ это время дочка с испугом спрашивает:\r\n - что случилось, папочка?...\r\n - ниче не случилось, дочка, просто ебстись надо по-людски!!!\r\n :D \r\nУрок арифметики. Училка задает Вовочке вопрос:\r\n- Вот представь, я даю тебе 200 долларов. Ты отдаешь $50\r\n  Машеньке, $50 Леночке и $50 Наташеньке. Что у тебя будет?\r\nВовочка: \r\n- Оргия.....\r\n :D \r\nПреподаватель:\r\n- Ваша фамилия? \r\nСтудент:\r\n- Иванов (улыбается).\r\n- Чему вы улыбаетесь? - спрашивает профессор.\r\n- Доволен, что хорошо ответил на первый вопрос.\r\n :D \r\nСообщение в новостях:\r\n- Вчера в столице автономного края Косово произошло новое крупное \r\nвооруженное столкновение. Погибли 10 американских и 8 русских \r\nвоеннослужащих. Также пострадал один албанский боец.\r\nТак ему и надо.\r\nПусть не суется не в свои дела.\r\n :D \r\nПара молодоженов. Однажды вечером муж решил посидеть с друзьями в баре \r\nи говорит жене:\r\n- Дорогая, я выйду на пару часиков.\r\n- А куда ты собрался, заинька мой?\r\n- Золотко, я бы в бар хотел заскочить, выпить пива.\r\n- Ты пива хочешь, котик? Так смотри, я тебе купила 25 сортов пива, и светлое, \r\n  и темное...\r\n- Понимаешь, душа моя, мне бы хотелось пива с чипсами. Я скоро вернусь.\r\n- Любимый, посмотри в шкаф, я там такой набор чипсов тебе припасла...\r\n- Слушай, бельчонок, в баре подают с горячими креветками, моими любимыми.\r\n- Солнце мое, я как раз сейчас ставлю вариться твои любимые креветки.\r\n- Ну как тебе объяснить, синеглазка, в баре совсем по-другому, там можно иногда \r\n  раскрепоститься и при этом никто не осудит, там даже матерятся свободно...\r\n- Так милый! ДАВАЙ, ПЕЙ СВОЕ ЕБАНОЕ ПИВО С ТВОИМИ СРАНЫМИ ЧИПСАМИ И ЭТИМИ \r\n  БЛЯДСКИМИ КРЕВЕТКАМИ, ПОТОМУ ЧТО ТЫ НА ХЕР НИКУДА НЕ ПОЙДЕШЬ, КОЗЕЛ!\r\n :D \r\nУспех в 5 лет - проснуться в сухой кровати.\r\nУспех в 17 лет - суметь переспать с женщиной.\r\nУспех в 25 лет - найти хорошую жену.\r\nУспех в 35 лет - карьера и семья.\r\nУспех в 45 лет - семья и карьера.\r\nУспех в 55 лет - найти хорошую жену.\r\nУспех в 65 лет - суметь переспать с женщиной.\r\nУспех в 85 лет - проснуться в сухой кровати.\r\n :D \r\n- Чем вы занимаетесь на работе?\r\n- Я специалист по ускоренной релокации средств размножения...\r\n- Это как?\r\n- Хуи пинаю....\r\n :D \r\nСадится хохол в поезд, заходит в вагон, нашел свое купе.\r\nОткрывает дверь, а там три негра сидят!\r\nХохол:\r\n- Ой, хлопцы! А шо тут горело?\r\n :D \r\nУмный мужчина + умная женщина = легкий флирт.\r\nУмный мужчина + тупая женщина = мать-одиночка.\r\nТупой мужчина + умная женщина = нормальная семья. \r\nТупой мужчина + тупая женщина = мать-героиня.\r\nУмный начальник + умный подчиненный = прибыль.\r\nУмный начальник + тупой подчиненный = производительность.\r\nТупой начальник + умный подчиненный = продвижение по службе.\r\nТупой начальник + тупой подчиненный = сверхурочная работа.\r\nМужчина заплатит 2 рубля за рублевую вещь, которая ему нужна.\r\nЖенщина заплатит один рубль за двухрублевую вещь, которая ей не нужна.\r\nЖенщина беспокоится о своем будущем до тех пор, пока у нее нет мужа.\r\nМужчина никогда не беспокоится о своем будущем до тех пор, пока у него \r\nнет жены.\r\nМужчина, добившийся успеха, это тот, кто зарабатывает больше денег, \r\nчем может потратить его жена.\r\nЖенщина, добившаяся успеха, это та, которая сумела найти такого \r\nмужчину.\r\nДля того, чтобы найти счастье с мужчиной, нужно сильно его понимать \r\nи немножко любить.\r\nДля того, чтобы найти счастье с женщиной, нужно сильно ее любить и\r\nдаже не пытаться понять.\r\nЖенщина выходит замуж с надеждой, что мужчина изменится, \r\nа он не меняется. \r\nМужчина женится с надеждой, что женщина не изменится, а она меняется.\r\nЗа женщиной остается последнее слово в любом споре.\r\nВсякое слово, сказанное мужчиной после этого, является началом нового \r\nспора.\r\n :D \r\nПpиходит к священнику молодой человек и исповедуется:\r\n- Святой отец, я гpешен!\r\n- Покайся, сын мой.\r\n- Пpишел я как-то к моему другу. Его дома не было, а была \r\n  его жена. Пошел  дождик, а у меня не было зонтика. Жена \r\n  дpуга пpедложила мне остаться, и я остался и согpешил с ней.\r\n- Да! Это гpех, сын мой! Hо я отпускаю тебе его.\r\n- Это еще не все! Я пpишел к тестю, его дома не было, начался \r\n  дождик, а у меня не было зонтика, теща пpедложила мне остаться, \r\n  я остался и согpешил с тещей.\r\n- Да! Это большой гpех, сын мой! Hо я и его отпускаю тебе.\r\n- Это еще не все! Я пpишел к теще, ее дома не было, начался дождик, \r\n  а у меня не было зонтика, тесть пpедложил мне остаться, я остался \r\n  и согpешил с тестем.\r\n- Сын мой, у тебя зонтик с собой?\r\n- Hет?!\r\n- Тогда вали отсюда с Богом, а то скоpо дождик начнется!\r\n :D \r\nИз окна отходящего поезда один мужик кричит другому, \r\nоставшемуся на перроне:\r\n- Ну, счастливо! Еще раз спасибо за гостеприимство! Все \r\n  было классно! А жена твоя трахается - это просто супер!\r\nПотом смотрит -  в вагоне у всех пассажиров вокруг него \r\nчелюсти отвалились. Он им, виновато:\r\n- Да нет, это так, вранье на самом деле. Не хотелось просто \r\n  хорошего человека огорчать.\r\n :D \r\nЗаходит парень в кафе и читает прейскурант:\r\nГамбургер - 2$\r\n...\r\nМинет - 20$\r\n\r\nСмотрит - за прилавком стоит продавщица - сногсшибательная блондинка, \r\nвсе при ней.\r\nПарень: \r\n- Извините, а кто у вас делает минеты?\r\nБлондинка с томной улыбкой на устах: \r\n- Я делаю, а что?\r\nПарень: \r\n- Тогда вымойте, пожалуйста, руки - мне гамбургер....\r\n :D \r\nМаня и Ваня - маляры. Красят они стену многоэтажки на уровне\r\n10-го этажа. Вдруг Ване приспичило по-маленькому.\r\n- Слышь, Мань! Не могу терпеть!\r\n- А ты давай прямо с люльки!\r\n- Да ты шо! Там же люди внизу!\r\n- А ты перегнись посильнее, как раз вон в фонтан попадешь!\r\n- Да я ж наебнусь!\r\n- Да не! Я тебя держать буду!\r\n- Крепко?\r\n- Крепко! Давай!\r\nНу Ваня встал на край люльки, Маня его сзади за ремень держит, а тот\r\nсильно вперед наклонился и облегчается аккурат в бассейн. Красота!\r\nИ тут Мане приспичило чихнуть! Каак чихнет и ... выпустила Ваню, \r\nи ушел он вниз как куль с дерьмом.....\r\nПрошло несколько месяцев. И вот в одном мериканском баре сидят три\r\nбабенки и рассуждают, где мужики самые до баб охочие.\r\nПервая: \r\n- Я вот давеча была в Париже, так эти французы проходу мне не давали. \r\n  Всяк норовил в постель затащить! Это у них в порядке вещей!\r\nВторая: \r\n- Нее, самые охочие - это мексиканцы. Была я там недавно. Они там\r\n  все такие потные, волосатые! Прям глазами раздевают! Сперма аж \r\n  из ушей прет!\r\nТретья: \r\n- Все это ерунда! Самые дикие мужики в России! Вот прикиньте! Пару\r\n  месяцев назад была я в Москве. Иду по улице мимо фонтана. Вдруг \r\n  слышу звук сверху. Поднимаю голову и вижу: летит на меня мужик \r\n  какой-то! Ширинка расстегнута, а он держится руками за член и орет:\r\n  -П И И И И И И З Д А А А А А А !!!!!........\r\n :D \r\nКто как напивается: \r\nПлотник - в доску. Стекольщик - вдребезги. Извозчик - в дугу. Сапожник - \r\nв стельку. Портной - в лоскуты. Пожарный - в дымину. Гробовщик - \r\nвусмерть. Свинарка - до поросячьего визга. Охотник - в дупель. Шофер - \r\nв баранку. Железнодорожник - в дрезину. Футболист - в аут. Ассенизатор \r\n- в говно. Повар - в сосиску. Бондарь - в бочку. Лесник - в шишку. \r\nМузыкант - в дудку. Электрик - в отключку. Математик - в ноль. \r\nФизкультурник - в лежку. Медик - до потери пульса. Физик - до потери \r\nсопротивления. Химик - до выпадения в осадок. Писатель - до ручки. \r\nЖурналист - до точки. Голубой - в жопу. \r\nА астрофизик - до звезд из глаз. Зато красиво...\r\n :D \r\nРано утром приходит мент на работу абсолютно голым.\r\nВсе сослуживцы его окружили, спрашивают, че ты в таком виде, \r\nсовсем охуел?\r\nОн говорит:\r\n- Сегодня ночью пошел я в ночной клуб. Весело там, музыка играет, \r\n  все танцуют. Вдруг гаснет свет и тихий голос говорит: "А сейчас \r\n  все девушки раздеваются".\r\nСослуживцы:\r\n- Ну?\r\n- Через две минуты свет включился, и, действительно, все девушки \r\n  голые. Дальше все танцуют, веселятся. Через полчаса опять гаснет \r\n  свет и тот же голос тихо вещает: "А сейчас раздеваются все мужчины".\r\n- Ну, что дальше??\r\n- Потом опять свет включился, и мужики все реально голые. Танцуем \r\n  дальше. А через полчаса свет опять вырубили, и голос говорит: \r\n  "Теперь мужчины приступают к работе".\r\n- Ну?!?!?!?\r\n- Ну вот я и пришел.\r\n :D \r\nЕдет богатырь по дороге, видит - впереди развилка, три дороги, \r\nкамень, а на камне надпись: "Налево пойдешь - пизды получишь, \r\nнаправо пойдешь - пизды получишь, прямо пойдешь - тоже пизды получишь." \r\nСтал думать - куда идти, коли везде такая засада. Тут голос сверху:\r\n"Решай быстрей, а то прямо здесь пизды получишь!"\r\n :D \r\nСтудент пpиходит на экзамен, откpывает поpтфель, достает\r\nбутылки водки, ставит на стол.\r\n- Вот вам тpи бутылки, поставьте мне тpи.\r\nПpофессоp, беpя паpу бутылок:\r\n- Я возьму две.\r\n :D \r\nМалыши, брат с сестрой, лепят снеговика. Мальчик говорит:\r\n- Ну все, почти готов. Побегу на кухню, морковку возьму.\r\nСестра:\r\n- Две возьми, нос ему тоже сделаем.\r\n :D \r\nПриходит мужик домой и с удивлением сообщает жене:\r\n- Дорогая, ты знаешь, наш тамагочи забеременел!\r\n- ??\r\nМужик вынимает "Тамагочи" из кармана и показывает жене. Там надпись: \r\n"Я беременна".\r\nЖена:\r\n- Идиот, это же пэйджер!\r\n :D \r\n- Доктор, мой ребенок наелся песка. Я дала ему много воды, а что теперь?\r\n- Следите, чтоб он не подходил к цементу...!!!\r\n :D \r\nЕсли вам необходимо доказательство, что человечество вымрет из-за своей\r\nглупости - прочитайте эти инструкции:\r\n\r\nНа одеяле (made in Taiwan)\r\nНЕ ИСПОЛЬЗУЙТЕ КАК ЗАЩИТУ ОТ ТОРНАДО\r\n\r\nНа зеркальце, приделанном к каске, которую используют американские\r\nвелосипедисты\r\nПОМНИТЕ, ПРЕДМЕТЫ В ЗЕРКАЛЕ НА САМОМ ДЕЛЕ ЗА ВАМИ\r\n\r\nНа крышке от бутылки молока в Англии\r\nПОСЛЕ ОТКРЫТИЯ НЕ ПЕРЕВОРАЧИВАЙТЕ БУТЫЛКУ ВВЕРХ ДНОМ\r\n\r\nВ некоторых странах на бутылках с Кока-Колой\r\nОТКРЫВАЙТЕ ДРУГОЙ РУКОЙ\r\n\r\nНа фене фирмы Sears\r\nНЕ ИСПОЛЬЗУЙТЕ ВО СНЕ\r\n\r\nНа упаковке овального мыла\r\nИНСТРУКЦИЯ - ИСПОЛЬЗУЙТЕ КАК ОБЫКНОВЕННОЕ МЫЛО\r\n\r\nНа коробочке с десертом Тирамису в магазине BILLA (напечатано снизу\r\nкоробочки)\r\nНЕ ПЕРЕВОРАЧИВАЙТЕ ВВЕРХ ДНОМ\r\n\r\nНа пудинге от Marks &amp; Spencer\r\nПОСЛЕ РАЗОГРЕВА ПРОДУКТ БУДЕТ ГОРЯЧИМ\r\n\r\nНа китайских гирляндах\r\nТОЛЬКО ДЛЯ ИСПОЛЬЗОВАНИЯ В ПОМЕЩЕНИИ ИЛИ СНАРУЖИ\r\n\r\nНа арахисе фирмы Sainsbury\'s\r\nПРЕДУПРЕЖДЕНИЕ - ПРОДУКТ СОДЕРЖИТ ОРЕХИ\r\n\r\nНа упаковке орешков  American Airlines\r\nИНСТРУКЦИЯ - ОТКРОЙТЕ УПАКОВКУ, СЪЕШЬТЕ ОРЕШКИ\r\n\r\nНа шведской электропиле\r\nНЕ ПЫТАЙТЕСЬ ОСТАНОВИТЬ ПИЛУ СВОИМИ РУКАМИ ИЛИ ГЕНИТАЛИЯМИ (интересно, \r\nна основании какого телефонного звонка от заказчика фирма была вынуждена\r\nвключить это предложение в инструкцию?)\r\n\r\nНа детском костюме Супермена\r\nДАЖЕ С ЭТИМ КОСТЮМОМ ВЫ НЕ СМОЖЕТЕ ЛЕТАТЬ\r\n\r\nНа шапочке для купания в отеле\r\nТОЛЬКО НА ОДНУ ГОЛОВУ\r\n\r\nНа упаковке от утюга Rowenta\r\nНЕ ГЛАДЬТЕ ОДЕЖДУ НА ТЕЛЕ\r\n\r\nНа сиропе против кашля для детей от фирмы Boot\'s\r\nНЕ УПРАВЛЯЙТЕ АВТОМОБИЛЕМ ИЛИ СТАНКОМ\r\n\r\nНа упаковке снотворного Nytol\r\nПРЕДУПРЕЖДЕНИЕ - МОЖЕТЕ ПОЧУВСТВОВАТЬ СОНЛИВОСТЬ\r\n :D \r\nЧем отличается наш Дед Мороз от их Санта Клауса? Их всегда трезвый и\r\nодин, а наш всегда пьяный и с какой-то девкой.\r\n :D \r\nМуж с женой в постели. Жена достигает оргазма, потом еще раз. \r\nМуж продолжает, как заведенный. У жены третий, четвертый, пятый... \r\nНаверху блаженства она спрашивает:\r\n- Дорогой, что с тобой сегодня?\r\n- Что? Ой, прости... Задумался...\r\n :D \r\nВ бар заходит мужик, а за ним страус и мокрая кошка. Официант подходит\r\nза заказом. Мужик заказывает пиво, поворачивается к спутникам и\r\nспрашивает "А вам?" Страус: "Я тоже возьму пива", Кошка: "И мне".\r\nОфициант приносит заказ: "С вас 6,20". Мужик не глядя достает из кармана\r\nденьги, отдает официанту - ровно 6,20. На следующий вечер картина\r\nповторяется, и снова мужик не глядя достает из кармана нужную сумму. \r\nВ очередной раз приходит эта компания, заказывает уже двойной виски.\r\nОфициант приносит заказ: "С вас 19,70". Опять мужик достает из кармана\r\nсумму без сдачи. Официант не удержался и спрашивает:\r\n- Послушайте, я понимаю, что у каждого своя компания, вопросов нет, \r\n  но как вы умудряетесь доставать деньги без сдачи?\r\n- Ну, - отвечает мужик, - пару лет назад мне достался в наследство дом,\r\n  и на чердаке я нашел лампу, а в ней оказался джинн. И первым моим\r\n  желанием было иметь в кармане всегда столько денег, сколько мне нужно.\r\n- Идеально! - восхитился официант.\r\n- Да, я всегда имею только ту сумму, которая мне нужна: спички купить\r\n  или Роллс-Ройс...\r\n- А второе и третье желание? - спросил официант.\r\n- Я пожелал, чтобы со мной рядом всегда была цыпочка с длинными ногами и\r\n  влажной "киской"...\r\n :D \r\nМне надысь историю рассказали. \r\n\r\nТут от одного предприятия отправили в командировку пожилого \r\nи молодого. Ну прибыли они в третью столицу, поселились в отеле, \r\nто да се, поужинали, поддали водочки с пивком, посмотрели ТВ \r\nи пожилой отправился на боковую, а молодой решил кино досмотреть. \r\nСидит, смотрит, попивает прохладный напиток, да и скучно ему стало. \r\nА тут и девчонки позвонили в номер. Поболтали они и заказал молодой \r\nroomservice в количестве двух экземпляров - неудобно же одному, \r\nтоварищ хоть и пожилой, а вдруг обидится. Через 15 минут прибывают \r\nдве девицы, молодой значит выбрал себе какую по вкусу, а другой \r\nсказал, чтобы та тихонько и с полным уважением - не будя старшего - \r\nсделала ему легкий ночной минет, как бы приснилось чтобы ему. \r\nА сам значит с подругой отправился в ванную, видать фантазии \r\nу него были. И вот через некоторое время выглядывает он ради \r\nкороткой передышки и вообще так сказать общей разведки ситуации \r\nв комнате, прислушивается и вдруг слышит как в темноте раздается \r\nсдавленно-хриплый голос пожилого:\r\n- Василий! Да ты что, ох..ел что-ли! \r\n :D \r\nМедленный, чувственный танец.\r\nОна (прижимаясь к партнеру, страстно):\r\n- Я немного волнуюсь. Мне кажется, что мое декольте слишком глубоко. \r\n  А вы как думаете?\r\nОн (заглядывая в декольте, осторожно):\r\n- Э-э-э, по правде сказать... да нет. А у вас что, волосы на груди?\r\nОна (в кокетливом ужасе):\r\n- Да что вы такое говорите? Конечно нет!\r\nОн:\r\n- Да, тогда, пожалуй, немножно глубоковато.\r\n :D \r\nРешил как-то Британский Парламент утвердить в Англии правостороннее \r\nдвижение. Издали указ. А англичанам насрать: как ездили по левой \r\nстороне, так и ездят. Консерваторы, понимаешь, бля! Ну, Парламент \r\nразослал депеши во все страны с правым движением. Типа, совета \r\nспросить. Германия предложила постепенную переподготовку водителей \r\nв течение пяти лет. Франция обязалась сделать это за три года. \r\nАмерика - за год. Пришел ответ и из России. Наши пообещали за одну \r\nнеделю перевести всю страну на правостороннее движение.\r\nДля этого предлагалось паромами переправить в Англию пятьсот Камазов \r\nс российскими водителями и пустить их на неделю по дорогам страны....\r\n :D \r\nФильм ужасов по роману Стивенкингса:\r\n"ОСТРОВ СВЕКРОВИЩ !!!"\r\n :D \r\n  Юзер и Windows\r\n\r\n     Юзер: - Поставь-ка новые драйверы видеокарточки.\r\n  Windows: - А диск есть?\r\n     Юзер: - Есть.\r\n  Windows: - А что сказать надо?\r\n     Юзер: - Ok\'.\r\n  Windows: - Фиг тебе, а не Ok\'. Не могу найти необходимые файлы!\r\n     Юзер: - Так вот же они!\r\n  Windows: - Где?!\r\n     Юзер: - Да на диске!\r\n  Windows: - На каком?\r\n     Юзер: - На B:.\r\n  Windows: - Нет такого диска.\r\n     Юзер: - А почему под DOS\'ом есть?!\r\n  Windows: - Не мои проблемы.\r\n     Юзер: - А как же мне драйверы поставить? \r\n  Windows: - А зачем тебе драйверы? У тебя видеокарточки-то нет.\r\n     Юзер: - Не может быть!\r\n  Windows: - Точно тебе говорю.\r\n     Юзер: - А аудио есть?\r\n  Windows: - И аудио нет.\r\n     Юзер: - А что есть?\r\n  Windows: - Джойстик есть.\r\n     Юзер: - Отродясь не было...\r\n  Windows: - Мне виднее.\r\n     Юзер: - Надо же, а я его покупать собрался.\r\n  Windows: - Вот видишь! Что бы ты без меня делал?\r\n :D \r\nЖила-была девочка, которая ну ни херашеньки не видела (короче - слепая).  \r\nКаждый раз, когда семья садилась за стол и мама подавала еду, девочка \r\nдолго ощупывала содержимое тарелки руками и каждый раз ныла:\r\n- Ну вот, как всегда мне меньше всех положили!  Раз ничего не вижу - \r\n  значит и обделить можно!  Жмоты...\r\nМаме все это надоело и решила она проконсультироваться с психологом.  \r\nНа что доктор дал ей такой совет:\r\n- Вы, - говорит, - сварите целый тазик пельменей! Ну как на "Маланьину \r\n  свадьбу". Ну и пусть ест!\r\nНа следующий день мама накрывает на стол и ставит перед девочкой \r\nПАРАШУ пельменей. Девочка садится за стол, двигает к себе нехилую \r\nпорцию пельменей, долго ощупывает содержимое руками и говорит:\r\n- Представляю, сколько вы себе нахерачили... \r\n :D \r\nВстpечаются два мyжика. Пеpвый говоpит:\r\n- Вчеpа ТАКУЮ негpитяночкy подцепил! Блеск! Hожки - изyмительные! \r\n  Фигypка - чyдо! Личико - мечта!\r\nВтоpой:\r\n- Hy, и?\r\n- Пpивел домой, попили шампанского, потанцевали, поцеловались...- HУ, И?\r\n- Я ее медленно pаздел, потyшил свет...\r\n- HУ, А ПОТОМ???\r\n- Потом я ее не нашел...\r\n :D \r\nЕГО и ЕЁ поведение у банкомата\r\n------------------------------\r\nОН\r\n1. Подъехать к автомату\r\n2. Вставить карточку\r\n3. Ввести код\r\n4. Забрать деньги, карточку и квитанцию\r\n\r\nОНА\r\n1. Подъехать к автомату\r\n2. Проверить макияж в зеркало заднего вида\r\n3. Выключить двигатель\r\n4. Положить ключ в сумочку\r\n5. Выйти из машины, т.к. остановилась слишком далеко от автомата\r\n6. Порыться в сумочке в поисках карточки\r\n7. Вставить карточку\r\n8. Порыться в сумочке в поисках бумажки с записанным кодом\r\n9. Ввести код\r\n10. Поизучать инструкции\r\n11. Нажать "Cancel"\r\n12. Ввести правильный код\r\n13. Проверить баланс\r\n14. Поискать конверт для депозита\r\n15. Порыться в сумочке в поисках ручки\r\n16. Заполнить депозитный талончик\r\n17. Подписать чеки\r\n18. Совершить депозит\r\n19. Поизучать инструкции20. Снять деньги со счета\r\n21. Вернуться в машину\r\n22. Проверить макияж\r\n23. Поискать ключи\r\n24. Завести машину\r\n25. Проверить макияж\r\n26. Тронуться с места\r\n27. ОСТАНОВИТЬСЯ\r\n28. Подать машину назад\r\n29. Выйти из машины\r\n30. Забрать карточку и квитанцию31. Вернуться в машину\r\n32. Положить карточку в бумажник\r\n33. Положить квитанцию в чековую книжку\r\n34. Сделать записи о депозите и съеме денег в чековой книжке\r\n35. Освободить место в сумочке для бумажника и чековой книжки\r\n36. Проверить макияж\r\n37. Переключить передачу на задний ход\r\n38. Переключить передачу на передний ход\r\n39. Поехать\r\n40. Проехать 3 мили\r\n41. Сняться с ручника\r\n :D \r\n- Hy что - может ляжете, наконец?\r\n- Я бы не хотела...\r\n- А я бы лег.\r\n- Я б на вашем месте стоял, я вообще стоя люблю...\r\n- А я лежа. \r\n- И вообще это лежа делают.\r\n- Ложитесь, а? Уже поздно.\r\n- Уже pано.\r\n- Договаpивайтесь, девyшка ждет, нехоpошо.\r\n- Ладно, легли.\r\n- Ложимся.\r\n- Оп-па!\r\n- Ух ты...\r\n- А это ты поближе к себе положи, запyтаемся.\r\n- Так.\r\n- Да.\r\n- Вот так.\r\n- Да!\r\n- И вот так!\r\n- Да-да-да!\r\n- Ох...\r\n- Отдайся...\r\n- Э, не тоpопитесь...\r\n- (девyшке) А ты это положи на его это... (кладет)\r\n- Ой!\r\n- А если вот так...\r\n- Да! Да! Да!\r\n- Ваy!\r\n- Ффy...\r\n- Ух ты...\r\n- Hy вы даете...\r\n- (закypивая сигаpетy и довольно моpщась) Hичего так полyчилось.\r\n- Мне понpавилось.\r\n- Да. Четыpе в гоpy запиши.\r\n- И на меня шесть вистов.\r\n- А пpоpезать надо было бyбной все-таки!\r\n- Тебе сдавать.\r\n- Как все запyщено...\r\n :D \r\nПеревод с британского английского:\r\n\r\nУВЕДОМЛЕНИЕ ОБ ОТМЕНЕ НЕЗАВИСИМОСТИ\r\n\r\nК гражданам Соединенных Штатов Америки:\r\n\r\nВ свете вашего провала попытки избрать себе Президента США и, таким образом, \r\nподтверждения невозможности управлять своей страной самостоятельно, Мы высочайшим \r\nизволением уведомляем вас об отмене вашей независимости. Данный факт вступает \r\nв силу с сегодняшнего дня. Ее Королевское Величество Королева Елизавета II \r\nвозвращает себе монаршую власть над всеми штатами, содружествами и другими \r\nтерриториями. Кроме штата Юта, который ее Величеству омерзителен.\r\n\r\nВаш новый премьер-министр (г-н Тони Блэр - объясняем это для 97,85% тех из вас, \r\nкто не знал, что существует жизнь и за границей вашей страны) назначит министра \r\nпо делам Америки без необходимости проводить дополнительные выборы. Конгресс \r\nи сенат будут распущены.\r\nВ следующем году будет проведен опрос, чтобы определить, заметил ли эти изменения \r\nхоть кто-нибудь из вас. \r\n\r\nДля того, чтобы помочь с переходом в зависимость от Британского Престола, вводятся \r\nследующие правила, носящие обязательный и немедленный к исполнению характер:\r\n\r\n1. Ознакомьтесь со значением слова «отмена» в Оксфордском словаре английского \r\nязыка. Затем найдите слово «алюминий». Посмотрите транскрипцию. Вы будете удивлены, \r\nкак неправильно вы произносили это слово. В качестве руководящего принципа \r\nрекомендуем вам обогатить ваш словарь до приемлемого уровня. Сверьтесь \r\nсо значением слова «словарь». Использование одних и тех же 27 слов с вставками \r\nтам и сям слов-паразитов, таких как «like» [«типа»] и «you know» [«ну, это»] \r\nявляется неприемлемым и неэффективным способом общения. Посмотрите значение слова \r\n«разнообразный».\r\n\r\n2. Такого языка, как «Английский США» [US English] не существует. Для вашей же \r\nпользы мы сообщим об этом Майкрософту.\r\n\r\n3. Вам следует научиться понимать английское и австралийское произношение, \r\nэто не так уж и сложно.\r\n\r\n4. Голливуд будет иногда использоваться для того, чтобы снимать английских актеров \r\nв ролях положительных героев.\r\n\r\n5. Вам следует заново выучить ваш настоящий национальный гимн: «Боже, храни \r\nКоролеву». Однако вам следует делать это только после выполнения правила №1. \r\nМы не хотели бы, чтобы вы сбивались и не допевали гимн даже до половины. \r\n\r\n6. Вам следует прекратить играть в американский «футбол». Существует только один \r\nнастоящий футбол. 2,15% вашего населения, которые знают, что существует жизнь \r\nи за пределами вашей страны, наверное, уже заметили, что в американский «футбол»\r\nнигде кроме Америки не играют. Вам больше не будет разрешено играть в эту игру; \r\nвы должны будете освоить настоящий футбол. На начальном этапе мы бы посоветовали \r\nвам выбрать в соперники девчонок, так как это очень сложная игра. Самым бесстрашным \r\nиз вас по истечении некоторого срока будет позволено играть в регби (оно похоже \r\nна американский «футбол», только при игре в него не нужно останавливаться каждые \r\n20 секунд для отдыха и не требуется носить бронежилеты как каким-то трусишкам). \r\nНадеемся, что к 2005 году из вас можно будет набрать хотя бы одну команду седьмой \r\nлиги.\r\n\r\n7. Вам следует объявить войну Квебеку и Франции и использовать атомное оружие, \r\nесли те будут причинять вам какое-либо «мердэ» [merde]. 97,85% из вас, те, что \r\nне подозревают о существовании жизни за границей вашей территории, должны понять, \r\nчто им очень повезло. Ведь не русские все это время были «плохими ребятами». \r\n«Мердэ» по-французски обозначает «дерьмо».\r\n\r\n8. 4 июля больше не будет национальным праздником. Вместо него будет введен \r\nпраздник 8 ноября, который будет называться «День нерешительности».\r\n\r\n9. Начиная с этого момента все американские машины запрещены к эксплуатации. \r\nОни - мусор, и это же пойдет вам самим на пользу. Когда мы вам покажем немецкие \r\nмашины, вы поймете это и сами.\r\n\r\n10. Пожалуйста, сообщите нам, кто же все-таки убил Кеннеди. Этот вопрос сводит \r\nнас с ума.\r\n\r\nБлагодарим за сотрудничество и понимание.\r\n :D \r\nНесколько слов о российском е-бизнесе.\r\n\r\nВ целом, практически все виды хозяйственной деятельности в России можно\r\nописать словом "е-бизнес". Внутри же российский е-бизнес можно разбить\r\nна некоторые виды, определяемые, в основном, состоянием и видом\r\nдеятельности предприятий:\r\n\r\n1. Зае-бизнес - процветающий е-бизнес. Этот вид чаще всего можно\r\nвстретить на новых, только что открывшихся предприятиях.\r\n2. Прое-бизнес - медленно разваливающийся е-бизнес. Этот вид чаще всего\r\nможно встретить на предприятиях, уже проработавших какое-то время на\r\nроссийском рынке.\r\n3. Разъе-бизнес - то же, что и пункт 2 - но очень быстро.\r\n4. Нае-бизнес (он же объе-бизнес) - один из наиболее прибыльных и\r\nраспространенных видов е-бизнеса в России. Как правило, следующим этапом\r\nэтих видов бизнеса становится съе-бизнес (при этом деятельность предприятия \r\nвыходит за территорию России).\r\n5. Пое-бизнес - разновидность е-бизнеса, когда никого не интересует ни\r\nсам процесс, ни его результат.\r\n6. Подъе-бизнес - е-бизнес, в основном направленный на борьбу с\r\nконкурентами.\r\n7. Уе-бизнес - силовое направление е-бизнеса, как правило, также\r\nсочетающееся с последующим съе-бизнесом.\r\n8. Прие-бизнес - е-бизнес, в основном связанный с незаконным\r\nиспользованием чужих ноу-хау и торговых марок.\r\n\r\nСписок видов е-бизнеса в России постоянно дополняется и изменяется.\r\nСледите за публикациями в прессе.\r\n :D');
