INSERT INTO zforums_posts_text VALUES (160, 'c77025ec68', 'Результаты работы с боем', '1) Система боя обновлена и написана заново. Ничего нового не появилось, но я вроде убрал все глюки и недочёта.\r\n2) Произведено понижение всех героев по описанной ранее схеме.\r\n\r\n[size=18:c77025ec68][b:c77025ec68][color=blue:c77025ec68]Всем необходимо распределить статы и набрать хоть немного опыта до 01.02.05[/color:c77025ec68][/b:c77025ec68][/size:c77025ec68]');
