INSERT INTO zforums_posts_text VALUES (167, '866b864cd0', 'Сайт клана', 'Внимание открылся сайт для нашего клана !!! Начальную версию вы можете посмотреть по этой ссылке [url]http://10.1.15.63[/url] !!!\r\nПожалуйста пишите тут какие на ваш взгляд можно внести коррективы !!! Принимается любая помощь в усовершенствовании сайта !!!\r\n :lol:   :D');
INSERT INTO zforums_posts_text VALUES (169, 'ed7bf10f30', '', 'Решение проблемы льгот по-русски: выдать каждому пенсионеру халявной\r\nводки, дешево, лекарств не надо - ничего не болит и пьяных в метро не\r\nпускают.\r\n :D \r\nТеперь в транспорте место пенсионерам можно уступать только за деньги.\r\nЭту льготу тоже монетаризировали.\r\n :D \r\nПартия "Родина" в знак протеста против монетизации льгот объявляет\r\nголодовку, ежедневно, от завтрака до ужина, с перерывом на обед.\r\n :D \r\nИдет заседание правительства. Путин - Зурабову:\r\n- Скажите нам, пожалуйста, когда, наконец, в России, не останется \r\n  людей, живущих за чертой бедности?\r\nЗурабов:\r\n- Владимир Владимирович, по моим расчетам, года за два должны \r\n  передохнуть все!\r\n :D \r\nИ что вы так Путина не любите? Первый президент России, который\r\nдействительно не смешон.\r\n :D \r\nРоссийская каста неприкасаемых - чиновники...\r\n :D \r\nЕсли в России победить коррупцию, кто будет управлять страной?\r\n :D \r\nНаполеон сказал, что Бог на стороне больших батальонов, в наше время\r\nможно добавить, что демократия - на стороне больших банков.\r\n :D \r\nЗа морем телушка - полушка, да рубль перевоз... и два растаможка.\r\n :D \r\nПочему в Советском Союзе было столько анекдотов о чукчах? Потому что\r\nАмерика была далекой, неведомой страной.\r\n :D \r\nЕсли Ливия предоставит Бобби Фишеру политическое убежище, станет ли он\r\nафроамериканцем?\r\n :D \r\nОдна женщина говорит другой:\r\n- Я вчера на вечеринке познакомилась с мужчиной. И мы как-то сразу\r\n  перешли на ты.\r\n- Что прям сразу?\r\n- Да. Он сразу мне сказал: "Да пошла ты...".\r\n :D \r\nДевушки разговаривают о Камасутре. Обсуждают разные позы. 37-ая, 54-ая.\r\n- А тебе что нравится? - спрашивают подругу.\r\n- Да что ты?!! Я голого мужчину-то ни разу не видела!!!!\r\n- Так ты позу смени, а то в такой позе, как у тебя, ничего и не увидишь,\r\n  тока если с зеркальцем :)\r\n :D \r\nDomestos - убивает все известные микробы!\r\nА неизвестные берет в плен, для опытов...\r\n :D \r\n       на правах рекламы\r\nНиколай Дроздов потратился. Купил VIERA. Дорого. И правильно сделал.\r\nТеперь он и в «Последнем герое», на островах, успевает, и вечером\r\nзимовку с пингвинами детишкам показывает в "Мире животных". Приглашают\r\nвести экстремальное шоу про гонки на лимузинах и танках. Подумывает, не\r\nсогласиться ли...\r\n :D');
INSERT INTO zforums_posts_text VALUES (170, '2ecc5dcc1b', '', 'на удтверждение:\r\n\r\n[b:2ecc5dcc1b]http://kazus-factor.fatal.ru/bloodmoon/start.htm[/b:2ecc5dcc1b]\r\nпросто дизайн сайта, имя потом сменим, разместил пока у себя.\r\nотписываемяся, кто что думает, и что где сменить. по-моему, вполне цивильно. сделаю наш форум, приклею к сайту, если нужно. типа всё своё и всё такое (: вообщем вот так. какие есть идеи и предложения, чем можете помочь - внимательно слушаю.\r\n\r\n\r\n[b:2ecc5dcc1b]http://kazus-factor.fatal.ru/bloodmoon/logo.gif[/b:2ecc5dcc1b]\r\nлоготипчик на удтверждение. потом можно доработать. просто и незатейливо. 32*32, багровая луна и чОрный лЯтучий мыш. это будет около ника, маленькое. есть идеи - пишите сюда.\r\n\r\nвсе ссылки внешние, потом всё доработаю. обязательно на счёт всего отпишитесь, и поподробнее. жду  8)');
