INSERT INTO zforums_posts_text VALUES (175, 'b2f6b85098', '', 'Анекдоты 23.01:\r\n :D \r\n- Абрам, ты собираешься мне отдавать долг? Ты ведь у меня в мае \r\n  1.000 рублей одолжил на месяц, а уже прошло полгода!\r\n- Не могу!\r\n- Почему?\r\n- Да по тысяче причин!\r\n- Ну назови хоть одну!\r\n- Пожалуйста! У меня нет денег!\r\n :D \r\nНадпись на двери: «Служба безопасности».\r\nВнизу пришпилена записка: «Уходя, кладите ключи под коврик».\r\n :D \r\nРеклама: Представляем новый сотовый телефон с сенсорным экраном. \r\nТеперь для того, чтобы он включился, его нужно нежно погладить!\r\n :D \r\n- А где готовят блюдо, которое может отведать осужденный на смертную\r\n  казнь перед приведением приговора в исполнение?\r\n- В тюремной кухне.\r\n- Но ведь это же двойное наказание!\r\n :D \r\nНемецкий водила делится впечатлениями о России: "Асфальт у них такой же\r\nчерный, только в дождь пожиже".\r\n :D \r\nЧто общего между бюстгалтером и бухгалтером?\r\nОба скрывают то, что лучше не показывать и создают видимость того, \r\nчего нет на самом деле.\r\n :D \r\nИдет игра "Что? Где? Когда?"\r\nВедущий объявляет:\r\n- Выпал тринадцатый сектор, а значит, вопрос задают зрители из\r\n  Интернета. Внимание на экран...\r\nНа экране появляется текст:\r\n"Как известно, когда-то люди не болели СПИДом, а болели СПиДом только\r\nобезьяны.\r\nВопрос: какой урод?"\r\n :D \r\nДвое менеджеров разговаривают.\r\n- В бухгалтерии пополнение из молодых.\r\n- Что, длинноногая и с большим бюстом?\r\n- Нет, маленький и с большим х..м.\r\n :D \r\nГномик в аптеке:\r\n- Дайте мне, пожалуйста, пирамидон.\r\n- Вам завернуть?\r\n- Нет, я так покачу.\r\n :D \r\nЯ не понял, что Вы сказали, но я с Вами совершенно не согласен.\r\n :D \r\nПросыпается муж с утра, бодунище, голова - Царь-Колокол.\r\n- Блять, вот это бодун...\r\nЖена:\r\n- Делай выводы.\r\nМуж:\r\n- Та тут все понятно - надо пить больше, тренироваться...\r\n :D \r\nЛучше выпить водки литр, чем не выпить водки литр!\r\n :D \r\n       на правах рекламы\r\n"Я просил экскурсию по Петрограду!!! Покажите мне Рериха! Покажите мне\r\nРериха!" – кричал напуганный покупатель Виеры, когда молчаливые матросы\r\nтащили его к набережной замершей Невы...\r\n :D');
INSERT INTO zforums_posts_text VALUES (176, 'ca060dcd1e', '', 'Афоризмы 23.01:\r\n :D \r\nПродаю жадность. Оптом. Дорого. Очень дорого. Торг уместен. Спросить \r\nХитрость!\r\n :D \r\nНеожиданное случается чаще ожидаемого.\r\n :D \r\nУ умного – большой разум, а у мудрого – большое сердце!\r\n :D \r\nУж полночь близится а Герман (Греф) все есть! \r\n :D \r\nКто плохо ищет - тот всегда нарвется!\r\n :D \r\nЕсть вещи пострашнее лени - усердие дураков.\r\n :D \r\nНелегко обрести друга. Еще труднее потерять врага.\r\n :D \r\nПетух – это тот же орел. Только опущенный. \r\n :D \r\nХозяева до такой степени очеловечили кота, что он стал вести себя \r\nпо свински.\r\n :D \r\nВ тоталитарном государстве любовница нужна прежде всего для алиби.\r\n :D \r\nРусская медитация - это процесс, в котором ты получаешь просветление\r\nтогда, когда потратил все деньги.\r\n :D \r\nДети - не роскошь, а средство передвижения в старости.\r\n :D \r\nТрудно затащить человека в клетку. Но еще труднее заставить его оттуда \r\nвыйти.\r\n :D \r\nКогда неприятности отступают, главное - их не преследовать.\r\n :D \r\nАктуально не то, о чем все говорят, а то, о чем все помалкивают.\r\n :D');
INSERT INTO zforums_posts_text VALUES (178, 'e1de917960', '', 'Истории 23.01:\r\n :D \r\nОдин мой знакомый первый раз купил компьютер пару месяцев назад. Причем\r\nв компьютерах он разбирался, да и сейчас разбирается меньше, чем\r\nафриканский бабуин. По моей наводке он купил игру Heroes of M&amp;M III, в\r\nтечении всей следующей недели изрядно измучив глупыми вопросами всех\r\nокружающих, он наконец-то понял, как в нее играть. На радостях он решил\r\nкупить add-on к игре Armageddon Blade. Не зная, что такое add-on и как\r\nего едят, он попросил продавца объяснить. Продавец сказал, что add-on\r\nArmageddon Blade ставится поверх оригинальной версии Heroes of M&amp;M III.\r\nМой приятель придя домой сделал следующее (привожу по пунктам): \r\n1. Открыл CD-ROM drive.\r\n2. Положил в него диск с Heroes III.\r\n3. Сверху положил диск с Armageddon blade.\r\n4. Последовала попытка (после проделанных выше операций) закрыть CD-ROM\r\ndrive.\r\n5. CD-ROM оказал отчаянное сопротивление.\r\n6. Далее последовало надавливание на непокорный CD-ROM обеими руками с\r\nпереносом на них веса всего тела пользователя (78кг).\r\n7. CD-ROM с хрустом вошел внутрь системного блока (Навсегда!!!).\r\nВсе, кому я рассказывал эту историю, хохотали до упаду, но скажу честно,\r\nкогда мой приятель позвонил мне и сказал, что он сделал, я просто завис\r\nв ступоре.\r\n :D \r\nСидим в универе, свободная пара, готовимся к огромной, сложной, важной\r\nконтрольной по юридическому английскому. Я задумчиво, со своим "хорошим"\r\nпроизношением, читаю вслух название первой главы:\r\n- "What is law?"\r\n- Чего?! - переспрашивает Лиза удивленным тоном. - Вот и зло?!\r\nДве минуты смотрим друг на друга. Потом до нас, и до всех однокурсников,\r\nдоходит.\r\nА перед юридическим английским теперь так и говорят: вот и зло! =))))\r\n :D \r\nРаботала оператором по обслуживанию клиентов в телефонной компании, в\r\nАмерике. Так же отвечала на звонки русскоговорящих пользователей.\r\nРазговоры получались иногда неуклюжие, так как ну непривычно быть\r\nвежливым "по-русски".\r\nНапример, приветствовать клиентов надо было так: "Здравствуйте! Спасибо,\r\nчто позвонили в Компанию такую-то. Меня зовут ---. Как я могу вам\r\nпомочь?" Уже смешно, нет? Некоторые не терялись и тут же отвечали:\r\nМатериально!!\r\n\r\nА еще, звонит дедулька какой-то на русскую линию. Ну, я поприветсвовала\r\nкак надо. Чем помочь, говорю? Он: доченька, а на подскажешь, где мне\r\nбилет до Москвы подешевле купить-то????? Я ему: Хм.. Вы не туда попали,\r\nэто телефонная компания. Он: ну так что же? Вы же говорите по русски????\r\n(логика железная).\r\n\r\nВ другой раз... конец моей смены, буквально последний звонок. Звонит\r\nрусский мужик, заметно, что привычка говорить по-английски усложняет\r\nзадачу ясно излагать мысли по-русски. Спрашивает, по какому адресу\r\nпослать оплату счета. Я лениво диктую адрес. Мужик видно еще хочет\r\nпообщаться. Спрашивает: А адрес на переде написать, или на заде????\r\n(Речь идет о конверте). Я терпеливо и так же маразматически: Hа переде.\r\nОн: а там поймут куда послать? Я теряя терепение: Да, поймут, и пошлют\r\nкуда надо!!...\r\n :D \r\nГуляю с маленьким сыном (ему полтора года). Недалеко от нас стоит\r\nженщина и при-и-истально так на нас смотрит.\r\nОсмотрела я себя, осмотрела малыша - никаких изъянов в одежде не\r\nобнаружила. Стала гордиться: вот мы какие красивые, просто глаз не\r\nотвести. Горжусь и играю с мелким, про женщину забыла уже.\r\nА она про нас - совсем нет. В разгар возни, когда я почти вытащила палец\r\nнастырного младенца из собственного уха, чувствую, как кто-то трогает\r\nменя за плечо. Поворачиваюсь - она. Смотрит на малыша и произносит:\r\n\r\n- Чем дольше на вас смотрю, тем сильнее удивляюсь, как сильно ваш\r\n  ребенок похож на моего мужа.\r\n\r\nСзади хохочет МОЙ муж. Он, оказывается, пришел минут 10 назад и смотрел,\r\nкак мы играем. Пауза. Женщина пристально его рассматривает и выдает\r\nпродолжение:\r\n\r\n- Да и на вашего тоже.\r\n :D \r\nВсем известно, а кому неизвестно - сейчас узнает, что в простонародье\r\nбелую горячку называют "белочкой".\r\n\r\nВ нашем городе в аккурат после первых больших, запойных новогодних\r\nпраздников кукольной театр повсюду развесил афиши о новом спектакле под\r\nназванием "Посвящается белочке". Думаю, что актуально.\r\n :D \r\nСыновья увлеклись игрой Lineage 2. Хотели и меня приохотить.\r\nЯ убил несколько монстров, собирал, покупал и сдавал в магазин разные\r\nвещи, копил деньги, а они подсказывали мне и критиковали мои действия:\r\n«Зря ты с этим Орком сцепился, - смотри, какой он тебе дамаг наносит».\r\n(«Дамаг» - ущерб, урон).\r\nПотом я сказал, что старую обезьяну поздно учить новым штукам, и бросил\r\nэту затею.\r\nВчера ехали со старшим в машине. На дороге валялся жигулевский ремень\r\nвентилятора. Я издалека увидел какой-то предмет на гладком асфальте.\r\n«Что это там лежит? » – спрашиваю. Сын, приглядевшись, ответил –\r\n«Ресурсы».\r\n(Это в игре они находят на земле то ресурсы, то оружие, то шмотки).\r\nУлыбнувшись, я спросил его: « Ты хоть чем-нибудь кроме компьютера\r\nинтересуешься? Про цунами в Индонезии слышал? » «Да, слышал, слышал, -\r\nотвечает, - там такой дамаг!.. »\r\n :D \r\nУ моего друга было день рождения, 30 лет. До этого был у нас в \r\nрок-группе ведущим шоу. Когда мама его спросила чего он хочет на день\r\nрождения, он ответил: "Черную женщину на белом рояле..." После чего мама\r\nему сказала: "Сережа, тебе уже тридцать лет, а ты все о музыке думаешь!"\r\nпосле этого данная фраза у нас стала крылатой.\r\n :D \r\nВечеринка была в типовой девятиэтажке. Шум, гам, музон - все как\r\nположено. Наступает затишье, предлагается поиграть в фанты.\r\nОдно из пожеланий "Пойти к соседям - попросить туалетной бумаги"\r\n(те еще глумилушки). Идет исполнитель и группа секундантов.\r\nДолго звонят, открывает замученная застенной вакханальей соседка.\r\nСонно, недовольно вопрошает - "Чего надо?"\r\nНа запрос туалетной бумаги, ни секунды не задумываясь, изрекает:\r\n"Использованная подойдет?"\r\nСвидетели стекают по стенам и ползут делиться полученым впечатлением с\r\nоставшимися.\r\n :D \r\nОдного знакомого блокадника вызывают в какой-то комитет и просят\r\nрассказать о своих проблемах. Спрашивают:\r\n- Что вам нужно? Может быть, дверь в квартиру надо поменять?\r\n- Нет, спасибо, я недавно сам новую повесил.\r\n- А, может быть, трубы водопроводные в плохом состоянии?\r\n- Нет, спасибо, у нас в доме поселился новый русский и всем заменил\r\n  все трубы.\r\n- Может быть, телевизор у вас старый?\r\n- Нет, новый, хороший.\r\n- Да вы не стесняйтесь, смело говорите, что вам надо. Смело просите -\r\n  мы все равно ничего не дадим.\r\n :D \r\nМлин так неудачно уронил телефон Siemens SL150 в сортир на даче   \r\nсортир типа очко с выгребной ямой в доме. Просто отвисаем у друга \r\nна даче и тут такая неприятность млин. А еще должна звонить бабушка \r\nмоего друга как с ней теперь разговаривать то \r\n10.30 После первых манипуляций с леской с петлей удавкой он только \r\nпогрузился на несколько см в г....\r\n10.35 посовещавшись решили пока нетрогать а то уйдет на дно и все пипец...\r\n10.44 позвонили на тел работает вроде... даже звонит только как то глухо \r\nно оно и понятно в принципе почему...\r\n10.50 решили больше не звонить т. к. виброзвонок включен уйдет на дно \r\nдумаем.\r\n11.00 позвонила бабушка (сработало автоподнятие трубки) поговорили она \r\nсказала что нас плохо слышно и что она перезвонит, мы сказали что ее \r\nтоже плохо слышно, эта дура положила трубку \r\n11.05 опять звонила и кореш проорал в очко что бы она больше не звонила \r\nа то телефон утонет  эта дура нифига непоняла и опять положила трубку.\r\n11.10 ждем звонка опять\r\n11.15 приехал брат, пошол в сортир, ждем\r\n11.17 звонок и крик из сортира, пришлось все рассказать..\r\n11.35 брат пришел в себя и пошел в туалет на улицу\r\n11.40 опять по ходу звонила бабушка, ничего не слышно, глубоко ушел \r\nвидимо\r\n12.00 нашли магнит, попробуем поднять с его помощью\r\n12.30 все пробовали неполучилось\r\n12.45 пробовали звонить и по звонку определить местоположение \r\nне вышло, резонанс\r\n13.00 брат сказал что он мог отплыть в сторону зацепившись за г...\r\n13.02 решили опустить фанарик на леске и посветить..\r\n13.05 я чихнул а кореш уронил фонарик\r\n13.07 мы все ****** оказывается (так сказал брат)\r\n13.10 я сказал что он тоже ***** так как корпус пластмассовый а про \r\nмагнит это его идея...\r\n13.12 мы все равно ******...\r\n13.15 пьем чай думаем как достать\r\n13.20 кто то звонил, долго\r\n13.22 думаем по звуку он уже глубоко млин что делать?\r\n13.25 нашли ковшик с дырками, думаем как приспособить...\r\n13.30 тянули жребий кому там черпать\r\n13.32 пронесло....\r\n13.30 полез брат\r\n13.35 конструкция аналогично рыбацкому черпаку\r\n13.40 много мата\r\n13.45 курим, кто то звонил, живучий зараза\r\n13.55 брат подчерпнул что то светящееся\r\n13.58 фонарик жив но не горит, включать никто не решился\r\n14.00 опять звонит\r\n14.02 брат подсек, орали будто щуку вытягивал...\r\n14.05 мы опять ******, уронил\r\n14.07 ушел неглубоко\r\n14.10 достал вроде его, но опознать что это нельзя\r\n14.11 трогать не решились\r\n14.15 курим \r\n14.30 решили помыть\r\n14.35 воняет просто ужас, вынесли на улицу\r\n14.38 в коридоре пока обувались положили напол сачок\r\n14.40 мы опять ******, потому что убираться мне\r\n14.45 вынесли на улицу, достать пока не решаемся все еще воняет \r\n14.50 кто то звонил, трубку не подняли неохота \r\n14.50 сработал автоответ поговорили с бабушкой\r\n15.10 говорим по очереди с бабушкой\r\n15.20 сказали про телефон\r\n15.21 она сказала что мы все ******\r\n15.23 курим ,обидно\r\n15.25 решили просто облить из чайника водой теплой\r\n15.27 поставили погреться чайник\r\n15.30 пока грелся чайник ЭТО похоже замерзает\r\n15.32 решили лить (я курю)\r\n15.35 облили показался телефон, еще работает...\r\n15.40 отнес в ванну отмываю, отвратительно воняет\r\n15.42 пришла подруга моего кореша\r\n15.45 рассказали про телефон\r\n15.46 подруга ржет как лошадь\r\n15.50 показал ей телефон из рук\r\n15.51 побежала блевать в сортир\r\n15.53 бежит обратно мы там забыли убрать фонарик\r\n15.55 мы все опять ******, теперь с ее слов, уже не смеется\r\n16.00 курим\r\n :D');
INSERT INTO zforums_posts_text VALUES (179, 'c59b47e3b5', 'Администрация', 'Администратор и программист: [color=blue:c59b47e3b5][b:c59b47e3b5]Trimax[/b:c59b47e3b5][/color:c59b47e3b5] (Дима)\r\nАдминистратор и дизайнер: [color=blue:c59b47e3b5][b:c59b47e3b5]Teider[/b:c59b47e3b5][/color:c59b47e3b5] (Олег)\r\nЗаместитель администратора: [color=blue:c59b47e3b5][b:c59b47e3b5]TbMA[/b:c59b47e3b5][/color:c59b47e3b5] (Артур)\r\nГлавная по новостям: [color=blue:c59b47e3b5][b:c59b47e3b5]Panterka[/b:c59b47e3b5][/color:c59b47e3b5] (Вика)\r\nГлавный по карте: [color=blue:c59b47e3b5][b:c59b47e3b5]Dpako[/b:c59b47e3b5][/color:c59b47e3b5] (Виталий)\r\nГлавный по кланам: [color=blue:c59b47e3b5][b:c59b47e3b5]Anarki[/b:c59b47e3b5][/color:c59b47e3b5] (Паша)\r\nГлавный по квестам: [color=blue:c59b47e3b5][b:c59b47e3b5]Dragon[/b:c59b47e3b5][/color:c59b47e3b5] (Доржи)');
