INSERT INTO zforums_posts_text VALUES (192, '3a20479546', '', '[quote:3a20479546="Kazus-Factor"]на удтверждение:\r\n\r\n[b:3a20479546]http://kazus-factor.fatal.ru/bloodmoon/start.htm[/b:3a20479546]\r\nпросто дизайн сайта, имя потом сменим, разместил пока у себя.\r\nотписываемяся, кто что думает, и что где сменить. по-моему, вполне цивильно. сделаю наш форум, приклею к сайту, если нужно. типа всё своё и всё такое (: вообщем вот так. какие есть идеи и предложения, чем можете помочь - внимательно слушаю.\r\n\r\n\r\n[b:3a20479546]http://kazus-factor.fatal.ru/bloodmoon/logo.gif[/b:3a20479546]\r\nлоготипчик на удтверждение. потом можно доработать. просто и незатейливо. 32*32, багровая луна и чОрный лЯтучий мыш. это будет около ника, маленькое. есть идеи - пишите сюда.\r\n\r\nвсе ссылки внешние, потом всё доработаю. обязательно на счёт всего отпишитесь, и поподробнее. жду  8)[/quote:3a20479546]\r\n :blue: [color=red:3a20479546][size=24:3a20479546]УТВЕРЖДЕН![/size:3a20479546][/color:3a20479546]');
