INSERT INTO zforums_posts_text VALUES (197, '31eaf4613e', '', 'Два наркомана на кухне что-то варят из конопли. Один спрашивает: \r\n- Слушай, Колян, а как ты думаешь, что будет, если одному вот это все залпом выпить? \r\n- Да у тебя кровь полется сразу, из ушей там, из носа, изо рта, из глаз.... \r\n- А это почему, интересно? \r\n- Да потому, что я тебе этим половником все рыло разобью! :twisted:  :twisted:');
