INSERT INTO zforums_posts_text VALUES (199, '1b80e5183f', '', 'Идет по казарме генерал с проверкой,\r\nза ним бежит старшина.\r\nЗаходит в первое помещение, видит пыль\r\nпод тумбочкой:\r\n"Что такое? Непорядок! Убрать! Ну-ка\r\nпоговорку!"\r\nВсе рядовые хором:\r\n"Чистота- залог здоровья!"\r\nЗаходит во второе, видит: спичка на\r\nполу валяется:\r\n"Что такое? Непорядок! Убрать! Ну-ка\r\nпоговорку!"\r\nВсе опять хором:\r\n"Чистота-залог здоровья!"\r\nТа же ситуация повторяется во всех\r\nостальных помещениях.\r\nЗаходит в последнее, видит перышко от\r\nподушки на полу:\r\n"Что такое? Непорядок,убрать! Ну-ка\r\nпоговорку!!"\r\nЗамученные солдаты хором:\r\n"СВИНЬЯ ВСЕГДА ГРЯЗЬ НАЙДЕТ!"');
