INSERT INTO zforums_posts_text VALUES (212, '74502d3b1c', 'Постановление о магии', 'Сегодня после вечернего разговора с Teider`ом было принято следующее решение:\r\n\r\nСоединить боевую магию, магию разума и атакующую магию в одну ветку - колдовская сила. При этом, все ваши набранные очки объединятся в одну колдовскую силу.\r\n\r\nА магию природы, боевую и разума реализовать в виде дополнительных способностей.\r\n\r\nМагия разума (+15% +25% +40%)\r\nБоевая магия (+15% +25% +40%)\r\nМагия природы (+15% +25% +40%)');
INSERT INTO zforums_posts_text VALUES (213, '5b4c32eed4', 'О стратегической части игры', 'После окончания написания РПГ части игры (планируется до след. воскресенья) я буду писать стратегич часть игры:\r\n\r\nУ каждой расы будет 4 вида воинов. \r\n\r\nКороче, всё будет очень похоже на героев. Часть армии ходит с героем, часть сидит в замке.\r\n\r\nБитва монстрами будет ТАКАЯ ЖЕ как и в героях, за исключением использования магии.');
INSERT INTO zforums_posts_text VALUES (221, 'e3779d942a', '', 'Анекдоты 24.01. :\r\n :D \r\nВ Усть-Урюпинске продолжаются выступления пенсионеров против задержки\r\nрассмотрения вопроса о замораживании перерассмотрения базовых ставок\r\nпоправочных коэффициентов к надбавкам при введении первого этапа отмены\r\nпереходного периода монетеризации льгот. Пенсионеры требуют немедленного\r\nи подробного разъяснения от властей против чего они выступают.\r\n :D \r\n"Поле чудес"\r\nЯкубович:  - Я предлагаю вам миллион и вы отказываетесь от своих льгот.\r\nПенсионер: - Нет, все равно хочу льготы!\r\nЯкубович:  - Два миллиона. \r\nПенсионер: - Льготы!\r\nЯкубович:  - А, забирайте свои льготы, все равно у вас мозгов хватает\r\n             только на метро на митинги ездить.\r\n :D \r\nПарень уговаривает девственницу:\r\n- Можно я тебя поцелую?\r\n- А это не стыдно?\r\n- Да конечно нет, зато приятно как!\r\n- Ну ладно.\r\nЕще через пять минут;\r\n- Не сделаешь мне минетик?\r\n- А это прилично?\r\n- Ну конечно, это как чупа-чупс пососать, зато приятно как!\r\n- Ну ладно.	\r\nЕще через пять минут:\r\n- А давай по-настоящему?\r\n- А это не больно?\r\n- Ну конечно нет, это как комар укусил, зато приятно как!\r\nЧерез час. На кровати лежит полностью удовлетворенный парень и на нет\r\nзатраханная во все мыслимые и немыслимые отверстия девушка. Она ему:\r\n- Что-то мне вся эта … напоминает!\r\n- И что же?\r\n- Закон о «Монетизации льгот», там тоже все хорошо начиналось!\r\n :D \r\nОднако, Миша любит Вову.\r\n\r\nМы передавали краткое изложение выступления Михаила Леонтьева.\r\n :D \r\n- Какая самая богатая нация в мире?\r\n- Эстонцы.\r\n- ?\r\n- Они не успевают тратить зарплату.\r\n :D \r\nНовый инагурационный обряд: левая рука на библию, правая на тору, член\r\nна конституцию.\r\n :D \r\nУченые посчитали, что через 10 лет воду из Москвы-реки будут продавать\r\nпо 40 долларов за баррель\r\n :D \r\nМой сын с детства был немного странным... Я был практически уверен, \r\nчто он станет педиком. Однако он им не стал! Он стал нормаль...ной\r\nженщиной!\r\n :D \r\nЗагадка: "Как называется человек, у которого есть много-много преданных\r\nдрузей?"\r\nОтгадка: предатель\r\n :D \r\n- Вчера брателлу схоронили.\r\n- А почему три гроба?\r\n- Так он - наперсточник.\r\n :D \r\n- Жена меня постоянно пилит и пилит. А за что? Ночами работаю, все\r\n  деньги до копейки приношу - все равно пилит! И чего ей, суке, не\r\n  хватает?\r\n- Кобеля!\r\n :D \r\nЗвонок на радио "Шансон":\r\n- Передайте, пожалуйста, для горячо любимых жены и тещи песню \r\n  В. Высоцкого "Кони привередливые"!!!\r\n :D \r\nБабушка:\r\n- Дети! Идите пить молоко!\r\nКорова:\r\n- Дети! Идите пить молоко!\r\nБабушка:\r\n- Дети! Идите есть бифштекс!\r\nКорова:\r\n- Дети! Дети?.. ДЕЕТИИИИ!!!\r\n :D \r\nОтец застукивает незнакомца в постели своей дочери, незнакомец:\r\n- Не волнуйтесь, папаша! Ведь я должен был узнать, как ваша дочь\r\n  выглядит по утрам, прежде чем сделаю предложение.\r\n :D \r\nЖениться - это как получить Интеpнет с неогpаниченным доступом - долго\r\nдобиваешься, получаешь, и - не знаешь, зачем тебе это было надо.\r\n :D \r\n       на правах рекламы\r\nБрежнев вызвал группу космонавтов.\r\n- Товарищи! Американцы высадились на Луне. Мы тут посоветовались с\r\nтоварищами и решили, что вы полетите на Солнце!\r\n- Так сгорим ведь, Леонид Ильич!\r\n-  Не бойтесь, товарищи, Партия подумала обо всём. Вы полетите ночью.\r\n :D');
INSERT INTO zforums_posts_text VALUES (222, '96c05fa353', '', 'Афоризмы 24.01 :\r\n :D \r\nЖизнь - это очередь за смертью. И дурак тот кто лезет без очереди.\r\n :D \r\nЧтобы удачно поплакать, надо просто неудачно пошутить. \r\n :D \r\nПока докажешь, что ты не верблюд, весь оплюешься!\r\n :D \r\nЕсли нельзя грязно выругаться, остается только чисто материться.\r\n :D \r\nЧеловеку свойственно аш-ебаться.\r\n :D \r\nЯзык психолога - это деликатес!\r\n :D \r\nСвобода выбора не гарантирует свободы приобретения.\r\n :D \r\nНичто так не бьет по зубам, как качество зубных паст.\r\n :D \r\nБедный мавр! Дездемона задушила его духами "Отелло".\r\n :D \r\nЧем проще жизнь, тем легче поведение.\r\n :D \r\nНичто не ограничивает способности так, как неограниченные возможности. \r\n :D \r\nСкупой платит дважды. И никогда все сразу.  \r\n :D \r\n  Наше правительство действует по-евангельски: лепта вдовицы ему \r\nне менее ценна, чем миллиарды Ходорковского. \r\nПравда, злые языки утверждают, что тут дело в русской пословице \r\n“Доброму вору все в пору”. \r\nНо ведь злые язычки можно и укоротить…\r\n :D \r\nУмные стремятся владеть информацией, мудрые - результатом ее обработки.\r\n :D \r\nДоброта - это товар, который продается дорого, а покупается дешево.\r\n :D \r\nНужно не только уметь загадывать желания, но еще и их отгадывать.\r\n :D');
INSERT INTO zforums_posts_text VALUES (223, 'f463fb5c0a', '', 'Истории 24.01 :\r\n :D \r\nИз милицейских протоколов\r\n\r\n22 января, исходя из своей потребности купить продукты для больного\r\nребенка, я потребовал в сельпо баночку сгущенного молока. Мне отказали.\r\nТогда я потребовал заменить ее банкой фруктовой смеси. Hо и заменителя\r\nне нашлось. Крепко волнуясь за судьбу больного ребенка, я купил\r\nчетвертинку водки и выпил ее в том же общественном месте, то есть в\r\nмагазине. (Из показаний)\r\n\r\nВоспользовавшись моей неопытностью, он завладел мною, даже не заплатив.\r\n(Из показаний следователю)\r\n\r\nГр. Громов, находясь на Комсомольской площади в нетрезвом виде, кричал,\r\nчто он - голубь мира, и требовал у прохожих денег на пиво.\r\n\r\nГражданка Кузнецова вела себя буйно, шумела, кричала, мешала гражданам\r\nспокойно отдыхать в вытрезвителе.\r\n\r\nЗайдя в подвал, мы обнаружили там лежащий на полу труп. Уже хотели\r\nпозвать милицию, но труп приподнялся и стал требовать закурить. Когда мы\r\nему не дали, то он стал материть нас, правительство и президента...\r\nПотом упал и умер, что и констатировала прибывшая через 2 часа "Скорая\r\nпомощь"... (Из показаний)\r\n\r\nHа потерпевшем были обнаружены четыре раны. Две - смертельные, две\r\nдругие, к счастью, нет.\r\n\r\nПервый раз я ударил пострадавшего, потому что он мне не понравился.\r\nВторой раз я его ударил, потому что мне не понравилось, как я его ударил\r\nв первый раз. Последующие удары я наносил с целью убедиться, что второй\r\nудар был нанесен правильно. (Из показаний)\r\n\r\nПо поводу порванных трусов гражданки Петровой могу сообщить следующее.\r\nВо время обыска Петровой, задержанной в качестве проститутки, она\r\nсорвала с меня погоны и сунула их себе в трусы. Я их оттуда вежливо\r\nвытащил и к ее трусам не прикасался.\r\n\r\nПоскольку я с детства не имел привычки пить по частям, то вышеупомянутая\r\nбутылка была прикончена мною прямо в столовой. После чего, выйдя на\r\nулицу, я вдруг обнаружил себя одетым в незнакомое мне женское пальто.\r\n(Из показаний)\r\n\r\nПотом я купил еще одну бутылочку и хотел выпить ее в лесу. Hо так как\r\nлеса поблизости не нашлось, пришлось выпить ее в телефонной будке.\r\n\r\nПропив 900 рублей государственных денег, я испугался и пропил еще 1300\r\nрублей, после чего, поняв, что влип в очень неприятную историю, пропил и\r\nостальные 3600. (Из показаний)\r\n :D \r\nНавеяно поездками в городском транспорте. Ганновер, Германия. Средина\r\nдня. Еду в практически пустом трамвае в город. На одной из остановок\r\nзаходят мама с дочкой лет 25. Дочка еще та кобыла, скажу я вам...\r\nВ общем, крупная. Наверное от слова "круп", если вернуться к кобылам... \r\nо чем это я... а... Ну вот. Заходят они и располагаются аккурат напротив\r\nменя - через проход лицом к лицу. И дочка на чистом русском языке\r\nначинает рассказывать, как она ходила на собеседование на стриптиз (!!!), \r\nи это уже в шестой раз, и почему-то ее не берут, с ее умом и\r\nзамечательными внешними данными... мама начинает ей советовать, как себя\r\nправильно вести на собеседовании (!!!), что показать в первую очередь,\r\nчто во-вторую... Слава богу, мою морду с первых минут этого диалога от\r\nсмеха свело судорогой, так что я сидел, как статуя канцлера на\r\nХауфбанхоффе... И тут у меня зазвонил телефон - шеф попросил, что\r\nпоскольку я еще в городе, то заказать столик в "Четырех временах года"\r\nчасов на восемь вечера... Естественно я ему ответил. Естественно на\r\nрусском.\r\nМама с дочкой совершенно помидорного цвета вышли на следующей\r\nостановке...\r\n :D \r\nБыл у нас одногруппник с не совсем ординарными действиями, логикой,\r\nфразами и т.д. И как-то на экзамене по физике учитель (уже после 3го\r\nчаса приема экзаменов) задает ему вопрос: "А почему здесь (тыкает\r\nпальчиком в его рисунок) течет ток?". Он подумал и ответил: "По\r\nпроводам." Хоть повеселил нас, измученных.\r\n :D \r\nДело было так...\r\nВезли мы как-то стол. И вот уже почти довезли. Вошли мы значит в дом,\r\nвызвали лифт, втащили этот стол в лифт и... лифт застрял. Вызвали мы\r\nтехников, диспетчер сказала, что будут минут через 40 (с другого конца\r\nгорода они что ли едут...). Ну что ж, делать нечего, будем ждать, а \r\nчтобы было не так скучно это делать, я запустил фильмец на свем кпк, \r\nдинамик орал довольно громко, и вот какая-то старушка, заслышав \r\nнепонятные звуки, кричит сквозь лифтовую дверь:\r\n- Чем это вы там таким занимаетесь??!!\r\nЯ:\r\n- В лифте сидим... кино смотрим...\r\n :D \r\nТелефонный разговор знакомого, через пять минут после заселения в\r\nквартиру сдающуюся внаем посуточно:\r\n- Добрый день, девушку не хотите?\r\n- А сколько?\r\n- 100 гривен за два часа.\r\n- Хм, за два часа... Нормально... А стирать она умеет?\r\n- ???\r\n- Ну вы что думаете, если я за час уложусь, она, при отсутствии\r\n  стиральной машины в квартире, остальное время прохлаждаться будет?\r\n :D \r\nМоему сыну десять лет... Ну ладно, через три месяца будет одиннадцать.\r\nСмотрим телевизор. Ведущий рассказал анекдот про голубых, сын смеется,\r\nтипа юмор понял.\r\nСпрашиваю:\r\n- А ты хоть знаешь, кто такие голубые?\r\n- Знаю! \r\n(Я слегка обалдеваю)\r\n- А кто такие зеленые, знаешь?\r\nПосле секундного раздумья:\r\n- Зоофилы, что ли?\r\nГринпис отдыхает...\r\n :D \r\nПора экзаменов, вроде и прошла, но еще свежи в памяти воспоминания об\r\nучебе. В начале семестра, как правило, появляется огромное число\r\nпреподавателей, имена которых трудно запомнить, а особенно, когда сам ни\r\nна лекциях, ни на семинарах не появляешься.\r\nВот и пришел к нам новый преподаватель. По рассказам - это такой модный\r\nдяденька - полупенсионер. Вся его модность заключается в том, что этот\r\nполупенсионер ходит с хвостиком.\r\nПрихожу я домой после того, как мне описали в деталях этого дяденьку, и\r\nначинаю пересказывать это подруге. Говорю (соблюдая политкорректность):\r\n"Дяденька хоть и пожилой, но с хвостиком". Пауза, за которой следует\r\nвопрос: "НОС ХВОСТИКОМ?!"....\r\nКомментарии излишни.\r\n :D \r\nМой приятель Толик имеет чудную воинскую специальность "Заправщик\r\nкосмических аппаратов"(лично видел запись в военном билете). Когда наши\r\nбоссы сильно начинают нас доставать на работе, я говорю ему: "Давай на\r\nхер бросим этот полиграф, и откроем АЗС на орбите. Ведь ты же умеешь НЛО\r\nзаправлять".\r\n :D \r\nКак хорошо, когда коровы не летают...\r\n\r\nНе далее как 2 дня назад, отдыхая в компьютерном клубе, где я работаю,\r\nпосле трудового дня (нужно сказать, что очень напряженного, пятница...\r\nнароду много)решили приколотся над нашим прорабом-строителем ANDY,\r\nмолодой человек владеющий строительной фирмой, которая ведет\r\nремонтно-отделочные работы в клубе... уже целый год... для чего были\r\nсняты колпаки колес с его автомобиля, отмыты, перевязаны ленточкой и\r\nподарены под соответсвующую музыку с поздравительным текстом при\r\nскоплении всех клиентов... ради развлечения, на капот машины был\r\nвыставлен кусок торта, дабы он когда пойдет ставить колпаки, мог\r\nоткушать сладенького...\r\nпока приподносили "подарок", какой то не хороший человек, сделал из\r\nкусочка торта, большую лепешку на лобовом стекле...\r\n\r\nв результате пришла мысль... накажет.. ох и накажет меня всевышний...\r\nждать долго не пришлось...\r\n\r\nвчера вечером заехал на автомойку, полностью вымыли мне машину... домой\r\nприехал... душа пела... утром надо смотаться в гараж, соленья, варенья и\r\nт. п. привезти домой... гараж не смог открыть, замерз замок наглухо... и\r\nнагреть то нельзя, а вдруг как загорится что нибудь внутри... приехал\r\nобратно домой, поставил машину там где всегда ставил, пока ходил\r\nпереодеться (решил доехать до клуба, посмотреть как там дела у админов)\r\n3 минут прошло, за это время стая пернатой нечисти окупировала иву, под\r\nкоторой стояла моя ласточка... выхожу из подъезда и что вижу? машина\r\nпокрыта РАВНОМЕРНЫМ маскирующим покрытием, роль которого исполняет да да\r\nптичье говно... в среднем один шлепок на 5 квадратных сантиметров...\r\nпока садился даже не подумал ничего, но как сел услышал\r\nшлеп-шлеп-шлеп... как на самого не попало, когда садился не понимаю...\r\nзаехал в клуб, человеки плакали, когда зашел в клуб, а они видя мою\r\nкислую рожу выбежали на улицу... а я плакал, когда заехал на автомойку\r\n(всегда на одной мойке моюсь, девчата меня уже знают) и они так невинно\r\nспрашивают... а внутри снова мыть? или стекла были закрыты?\r\n\r\nда воздастся каждому по заслугам его... нет мне не обидно, а просто\r\nнаводит на мысли...\r\n :D \r\nО особенностях подводно-подледной рыбалки \r\n\r\nВосьмилетний сын - Женька - не отходил от меня ни на шаг.\r\n- Пап, ну возьми меня с собой, я буду хорошо себя вести и слушаться\r\nбуду! – это обещание в его понимании стоило очень дорого и уж больно \r\nему хотелось со мной на зимовье к знакомому егерю - Славке.\r\n- Точно будешь? – понимая, что все равно не отстанет, для проформы\r\nпоинтересовался я.\r\n  В ответ он только кивнул головой и не дожидаясь моего согласия начал\r\nсобираться.\r\n  На зимовье народу в тот день собралось немало. Трое, включая меня,\r\nСлавку и Мишку, планировали погонять по тундре оленей, благо лицензии на\r\nотстрел имелись, а два «Бурана» (не путать с многоразовым космическим\r\nкораблем) были заправлены и подготовлены. Конечно, Женька планировал\r\nехать со мной и дальше, но брать восьмилетнего пацана в тундру, где\r\nчерте что может случиться, в мои планы уж точно не входило. Тот сначала\r\nзанервничал, но сидящий в зимовье Петька его урезонил.\r\n- Да ладно, Женек, ну что ты с отцом попрешься сопли морозить, оставайся\r\nс нами, мы с тобой на рыбалочку сходим, чебачка, щуку из-подо льда\r\nподергаем!\r\n  В тот момент он еще не знал, какую допускает ошибку – брякнул так, для\r\nуспокоения нервной обстановки. А Женька напрягся, видимо подледная\r\nрыбалка его интересовала очень даже сильно. Помахав мне на прощанье\r\nрукой, он тут же устремился в зимовье.\r\n  Охота удалась на славу, если не считать того, что к зимовью мы\r\nвернулись лишь на следующий день к обеду. Странно, но там никого не\r\nбыло, хотя по обстановке было видно, что с вечера тут была приличная\r\nпопойка – стол был завален остатками закуски и горами окурков папирос.\r\nЕсли бы не пропавший сын, я бы конечно этому внимания не придал, но\r\nздесь занервничал. Пришлось играть роль следопыта и разбираться в\r\nследах, а они все уходили к протоке, что была в полукилометре от\r\nзимовья. И я рванул туда.\r\n  Вид с бугра на блестевшую льдом протоку был прекрасным, но увиденное\r\nпоразило меня настолько, что я открыл в немом вопросе рот. У проруби, из\r\nкоторой мы черпали воду для хознужд и для баньки, сгрудилось четверо\r\nвзрослых мужиков и бегающий среди них Женек. То, что с ним все в порядке\r\n- радовало, но дальнейшее навевало какие-то непонятности. Один из\r\nмужиков скинул полушубок и, представ в полном неглиже, с криком атакующей\r\nчайки рухнул в прорубь.\r\n- Моржи блин! – только и мелькнуло в моем ничего не понимающем рассудке.\r\nЗдесь, пожалуй, надо начать все с самого начала и изложить все факты в\r\nхронометрической последовательности. А дело было так.\r\n  Не успели затухнуть звуки наших отъезжающих «Буранов» как Женек \r\nвспомнил данное Петькой обещание.\r\n- Пойдем, дядь Петь, пойдем рыбу ловить – как клещ вцепившись в его\r\nрукав, загундосил он.\r\n  После получаса интенсивного нытья и уговоров Петька сдался и все бы\r\nничего, если бы в морозном воздухе вновь не раздался звук «Бурана»,\r\nправда уже не нашего. На зимовье пожаловали гости. Гости ни рыбаками ни\r\nохотниками не были, а было у них с собой почти ящичек водки да мясо на\r\nшашлыки, решили обмыть новый снегоход, заодно испытав его на ход. Увидев\r\nтакое количество водки, желание рыбачить у Петьки пропало однозначно и\r\nбесповоротно, хотя Женек его настроения не разделял. В целях исполнения\r\nобещания и замаливания греха, пока остальные суетились с мангалом,\r\nПетруха ухватил одной рукой Женька за шиворот, а второй какую-то палку,\r\nстоящую у стены зимовья, и рванул к проруби. Пошурудив в подернутой\r\nледком воде дубиной, он авторитетно заявил:\r\n- Видал, нет рыбы! Спит она, да и тебе пора!\r\nНа задаваемые Женьком вопросы ответы дадены не были и он, вновь\r\nухваченный за шиворот, был оттранспортирован в зимовье, где уже вовсю\r\nзвенели стаканы.\r\n  Даже для четверых здоровых мужиков ящик водки - это многовато! Стаканы\r\nзвенели, водка пилась, мясо съедалось, а не теряющего надежды Женька\r\nотодвигали все дальше и дальше, задвинув в конечном итоге куда-то в\r\nугол, где его уже никто не слышал, да и не видел.\r\nУтро началось с хриплого Серегиного голоса:\r\n- Вставайте, мужики, похмелиться бы надо!\r\nПредложение было своевременным, потому что даже на свежем таежном\r\nвоздухе похмелье дело тяжелое, но странное дело – похмеляться было\r\nнечем. Хотя любой из четверых взрослых мог поклясться, что вчера\r\nоставалось еще много. Перерыли все, пустые бутылки были, полных нет.\r\nПосле получаса интенсивных поисков с непроходящей сухостью во рту и\r\nтошнотой у кого-то хватило мозгов обратить внимание на посапывающего во\r\nсне Женька. Так как с вечера он по причине своего малолетства был самым\r\nтрезвым, то решили будить его.\r\n- Женек, ты не помнишь, у нас вчера водка оставалась? – растолкав\r\nпацаненка, в один голос поинтересовались все.\r\n- Да, много! – продрав глаза, подтвердил тот.\r\n- И где она? – с надеждой, что еще не все потеряно, спросили его.\r\n- В проруби! – с детской наивностью поведал он.\r\nШок был страшным, сухость во ртах удвоилась, лица с глазами остекленели.\r\n- А как она там оказалась? – после тяжелой, гнетущей паузы\r\nпоинтересовался кто-то.\r\n- Я ее туда кидал, рыбу будил! – все так же искренне заверил Женек.\r\nБить его все по той же причине малолетства не стали, но как всегда\r\nбывает в таких случаях, крайний-то должен быть. Крайним стал Петька, ну\r\nи правильно - зачем пацану мозги компостировал? Разобравшись что к чему,\r\nвынесли вердикт, ничего хорошего Петьке не обещавший, и поплелись к\r\nпроруби.\r\n  Глубина протоки метра полтора, но дно илистое, его там еще на полметра.\r\nПоэтому тыкать палкой было бесполезно. Все посмотрели на Петьку.\r\n- А почему я, почему я!? – не хуже чем герой «Джентльменов удачи»\r\nвзревел тот.\r\nГнетущая тишина и безальтернативность выбора были ему достойным\r\nответом. Тихо скуля и вспоминая меня и Женькину маму, Петруха разделся.\r\n- Куда кидал? – скукожившись как чернослив после усушки, поинтересовался\r\nон у Женьки.\r\n- Туда! – махнув рукой в сторону норд-оста, заверил тот.\r\nМетровая в диаметре прорубь приняла Петьку, поглотив его душераздирающий\r\nкрик.\r\nСекунды тянулись как часы и когда на поверхности проруби показались\r\nПетрухины глаза, занимающие всю водную поверхность, народ проявлял\r\nбеспокойство. Но больше всех беспокоился Женек.\r\n- Дядя Петя, дядя Петя, - когда новоявленный морж вынырнул на\r\nповерхность, бросился он к нему, - ну че, рыба там есть?\r\nПосле десяти секунд беспрерывной ненормативной лексики, прояснявшей, что\r\nрыбы тут отродясь не было, Женек подкорректировал направление поиска.\r\n- Может, я туда кидал! – ткнув на норд-вест, - темно ведь было!\r\nВторое погружение Петруха выдержал с трудом. Когда его синюшное тело\r\nбыло обуто в унты и укутано полушубком, он издавал такую вибрацию, что в\r\nрадиусе десяти метров начал потрескивать лед, а зубы выбивающие чечетку\r\nперекрыли бы по звуку очереди тяжелого пулемета. Тем не менее, бегающего\r\nвокруг него Женька интересовал все тот же вопрос – есть ли там рыба?\r\n- Ка-ка-ка-я ры-ба-ба, во-во-дка гд-е-е? – ревел Петруха, у которого\r\n  наверно мозги замерзли в одном положении.\r\n- Там – махнул рукой Женек, указывая в противоположную от Петрухиных\r\n  поисков сторону, - точно там, я вспомнил!\r\nТретье нырянье было уже на моих глазах, и когда я приблизился к\r\nновоявленным моржам, Петька уже опять трясся на льду.\r\n- Пап, а дядь Петя говорит, что тут рыбы нет – увидев меня, грустно\r\nпроизнес Женька.\r\n- Да есть, есть тут рыба, ты скажи только где водка, - с явным желанием\r\nубить взревел Петруха.\r\n- Есть?! А она не спит? – прячась за меня, поинтересовался сын.\r\n- Какой спит, я там и чертей наверно уже всех поднял! Куда водку бросал?\r\n  Ведь помру же!\r\n- Водка там – махнув в сторону зимовья, заверил Женек – я ее в снег у\r\n  сарая закопал. - Пап, а пап, а мы с тобой будем рыбу ловить, дядь Петя\r\n  говорит, что она здесь есть и не спит.\r\nЧаса два мы с ним ловили, поймав двух полудохлых чебачков. Ну и то\r\nхорошо – ведь не враг я себе!\r\n :D');
