INSERT INTO zforums_posts_text VALUES (266, 'f388e333c4', 'Правила приема в гильдию магов', 'Требования:\r\n1. Вы должны быть в клане  "мастера смерти"\r\n2. Вы должны быть магом.\r\n3. Вы должны прокачивать только магию и все комплектующие к ней.\r\n\r\nВид заявки:\r\n1. ссылка на героя.\r\n2. уровень героя.\r\n\r\nРАНГИ МАГОВ:\r\nВысший маг -  50-100\r\nМастер магии - 40-50\r\nЧитающий магию - 30-40\r\nМаг второго ранга - 20-30\r\nМаг первого ранга - 10-20\r\nВолшебник - 5-10\r\nУченик - 1-5');
