INSERT INTO zforums_posts_text VALUES (296, '6c2e9eef55', '', 'Анекдоты 25.01:\r\n :D \r\nОдин чиновник интересуется у другого:\r\n- Ты как считаешь, Путин все же пойдет на третий срок?\r\n- Если он не пойдет на третий, мы с тобой потянем первый.\r\n :D \r\nВ ответ на многочисленные акции протеста российских пенсионеров,\r\nправительство разработало новую программу - программу замены льгот\r\nэфтаназией по низким ценам.\r\n :D \r\nНЕОНАЦИЗМ\r\nКурю на лестнице в подъезде, вижу на стене свастику и надпись:\r\n"ОДНО ГОСУДАРСТВО\r\nОДИН НАРОД\r\nОДИН ВОЖДЬ..."\r\nЧего-то не хватает, думаю...\r\nА! Ну точно!\r\nПриписал внизу: ОДИН ХУЙ\r\n :D \r\nСамая невыносимая работа - на Гознаке. Каждый день видеть такое\r\nбогатство и не вынести!\r\n :D \r\n- Моей жены явно нет дома. Телефон уже успел остыть.\r\n :D \r\nЗдоровье дается человеку один только раз, и пропить его нужно так, \r\nчтобы потом не было мучительно больно...\r\n :D \r\nВ логово Шерхана вползает шакал Табакки - лапы сломаны, морда разбита,\r\nхвост оторван.\r\n- Ну? - спрашивает Шерхан.\r\n- Ак... Ак... Акела промахнулся, - еле шевеля языком произносит Табакки.\r\n- А Маугли?\r\n- А Маугли, сволочь, попал!\r\n :D \r\nМоя собака до 6-ти месяцев думала, что ее зовут "Ой_Какая_Собачка", \r\nа после - "УБЕРИТЕ_СОБАКУ!!!"\r\n :D \r\nКрасивая девочка напряженно тренируется в тренажерном зале. Вдруг\r\nчувствует на себе чей-то взгляд. Оборачивется - напротив стоят два\r\nкачка-грузина, у обоих стоит, и смотрят на нее. Она:\r\n- А я вижу, что вы обо мне разговариваете.\r\n :D \r\nШвеция, Стокгольм. Час ночи. По улицам ночного города бродит Петерсон \r\nс похмелья. Выпить надо, а все магазины закрыты! Вдруг натыкается на\r\nмужика:\r\n- Пить хочешь?\r\n- Спрашиваешь!!!\r\n- Бутылочка водки есть.\r\n- Сколько?\r\n- Полсотни крон.\r\n- Хрен с тобой, давай!\r\n- На. Захочешь еще - звони, - мужик протягивает клок бумаги.\r\nСчастливый Петерсон возвращается домой, открывает бутылку, глотает...\r\nЧерт!!! Вместо водки - вода! Злой Петерсон звонит по телефону. Сонный\r\nголос говорит:\r\n- Диспетчер водопроводной службы Стокгольма вас слушает...\r\n :D \r\nна правах рекламы\r\nКомпания Panasonic первая вошла в новый век торговли. Сначала\r\nнапродавали всем VIERA (Виеры): "Гонки на танках!", "Зимовка с\r\nПингвинами!", "Ужин с Нефертити!". Типа Дорого. НЕ РАБОТАЕТ! Вот скоро\r\nони начнут инструкции по включению воображения продавать. Тогда узнаете,\r\nчто такое действительно ДОРОГО...\r\n :D');
