INSERT INTO zforums_posts_text VALUES (311, 'e9d6df120b', 'Легенда клана', 'Легенда гласит … \r\n”И было огромное поле, и на много миль вокруг не было ничего, кроме зелёной травы. И сошлись на нём два полчища.… И первый раз на поле битвы встретились ночь и день, добро и зло, свет и тьма.… И не было видно края войнам, ни с одной, ни с другой стороны. И только солнце отразилось от первых щитов, как началась битва. И были силы равны… и село солнце, но бой продолжался. И много раз ещё солнце вставало и садилось, а битва продолжалась… и кровь пропитала всю землю, и трава уже не была зеленой, потому что не стало травы, была только кровь, но даже стоя по колено в крови, войны продолжали сражение.… И наступил перелом в битве.… И отступило войско тьмы.… И первый раз свет праздновал свою победу… \r\nНо появились войны, рожденные этой битвой. И были Они не просто войны – каждый из них, обладал нечеловеческой силой, и в тоже время Они оставались людьми, но, это было только внешнее сходство. Ведь сам Дьявол наградил их своими умениями. Уменьями появляться в любом месте и в любом обличии. Сегодня Они могут появиться пред тобой как вампиры и высосать всю твою кровь, а завтра как оборотень разорвать зубами тебя на части, подобно призраку следить за каждым твоим шагом и наносить удары словно молнии. Но, это не значит, что они стали слугами дьявола или его поклонниками – они стали ЕГО ВОЙНАМИ. \r\nОни никогда не отступали в бою, они никогда не били в спину, они всегда вели честный бой, ибо честь для них превыше всего. Честь и свобода! Именно из-за этих, казалось бы, простых истин Они стали теми, от кого отвернулось общество, теми, кого это общество прокляло. Ведь среди серой массы этого общества Они выделялись подобно грому среди ясного неба, подобно стальному клинку среди травы. И Их было невозможно сломать, невозможно поставить на колени, невозможно заставить поклоняться примитивным идеалам! Они были рождены в Битве, они жили, живут, и будут жить ради Битвы!” \r\n… Говорят, и сегодня Они где-то среди нас…');
