INSERT INTO zforums_posts_text VALUES (322, 'f78a59ad15', '', 'Истории 25.01:\r\n :D \r\nМГУ им. Ломоносова, 1 курс, первая сессия, все волнуются, переживают:\r\nвылетишь - не поймают, то бишь не восстановишься. Надо сказать,\r\nфакультет был гуманитарный, и именно на нашем потоке ставили эксперимент\r\nпо углубленному овладению иностранным языком, вторая специальность, так\r\nсказать.\r\nВстречаю однокурсника:\r\n- Привет!\r\n- Привет!\r\n- Как дела?\r\n- Плохо...\r\n- Что так? - удивляюсь я. Вугар - парень вроде неглупый.\r\n- А, - безнадежно машет он рукой, - англичанка зачет не ставит. Говорит,\r\n  что у меня грузинский акцент.\r\nИ продолжает горячо, распаляясь от обиды:\r\n- Ну откуда, ОТКУДА у меня грузинский акцент, я же азербайджанец!!!\r\nЗачет англичанка все-таки поставила.\r\n :D \r\nДж. Буш на вопрос журналистов, почему Усама бен Ладен все еще не пойман,\r\nответил просто: "Потому что он прячется"\r\n :D \r\nИз статьи Павла Шеремета о зверствах Лукашенко: "За простых людей\r\nЛукашенко не стыдно. Участницу антиядерного шествия Галину Кунину билиголовой об асфальт, глухонемого от рождения Лесуна бросили в тюрьму зато, что он выкрикивал антипрезидентские лозунги и выражался нецензурной бранью, ...". Вот как довел президент народ, что даже глухонемые смогли говорить, а вы говорите только Иисус мог творить чудеса.\r\n :D \r\nИстория рассказана Пашей, широко известным в узком кругу под кодовым именем Фиса.\r\nСлужил Фиса в ВВС (не подумайте, что он там летчик какой-нибудь –\r\nаэродром боец охранял), в части, находящейся где-то под Кировом.\r\nТак вот, служил с ним один борзый солдатик, который не переносил храпа.\r\nПонятно, что никому храп больно-то не нравится, но солдатик поступал\r\nсовсем подло: не вставая, брал сапог и швырял его в своих сослуживцев, затем переворачивался на другой бок и засыпал крепким сном. Ес-сно сослуживцы от таких поступков в восторг не приходили, а так как метод использовался каждую ночь, вскоре ярость благородная вскипела до жгучего желания отмщения (о, как я!). В час Х солдаты приступили к реализации своего коварного плана.\r\nПривязали они грубой ниткой сапог к (прошу пардону!) залупе крепко\r\nспящего бойца. Ну и всхрапнули под ухо.\r\nНечеловеческий вопль огласил казарму; то был вой простреленной навылет волчицы...\r\nМесяц солдатик валялся в медчасти. Как вы думаете: избавился ли он от своей пагубной привычки? Вовсе нет, просто к ней добавилась новая: после метания сапога, спросонья он спрыгивал с койки и бежал вслед за летящим предметом обуви...\r\n :D \r\nИх в части называли дАгами. Их, дагестанцев.\r\nБыли даги истыми мусульманами: в числе прочих религиозных премудростей\r\nза ними значилась процедура подмывания своего волосатого зада после\r\nпроцесса срачки. Ясен перец, никаких бумажек они не признавали.\r\nОказывается, зря...\r\nВ этот день рядовой Паша Елисеев по прозвищу Фиса исполнял свой\r\nсвященный долг солдата ВС РФ, а именно драил сортир. Для сего таинства\r\nФисе была выдана бутылочка кислоты (то ли серной, то ли соляной). Видите\r\nли, остатки фекалий оседали на белоснежных стенках очка и оттереть их\r\nвраз не представлялось возможным (надеюсь, аппетит я вам испортил =).\r\nДругое дело с кислотой – заскорузлые массы исчезали очень быстро.\r\nМногие из вас догадались, как именно развивались события дальше. Как\r\nнастоящий солдат, Фиса забыл бутылку в сортире. Другой солдат, тоже не\r\nопозорив честь мундира, содрал с нее этикетку.\r\nОтменно посрав, даг решил подмыть свой священный зад от продуктов\r\nжизнедеятельности. Очень кстати пришлась невзрачная бутылочка, стоявшая\r\nскромно в углу.\r\nСода не помогала. Воду в нарывающую сраку лить было нельзя – было бы\r\nнамного больнее. Фису ждал очень неприятный разговор с правоверными\r\nмусульманами в подсобке.\r\n :D \r\nЗимне-летней погодой навеяло...\r\nДело было несколько лет назад, зимой, на автогонках, питерская трасса\r\n"Невское кольцо". Тогда еще не было таких тотальных ограждений трассы\r\nкак сейчас и машинки ездили попроще. Но зато их не так жалели. Был заезд\r\n24х Волг. С внутренней стороны трассы, метрах в двух от дороги стоял\r\nкакой-то старый фолькс, мордой к трассе; вроде никому не мешал. Стоял он\r\nметрах в 40 после поворота (Сорочинского - питерские знают), а перед\r\nэтим поворотом есть длинный прямой учаток от пристани к стадиону. И вот,\r\nодну волгу после поворота занесло. То есть, в поворот она вписалась, но\r\nпочему-то продолжала вращение против часовой стрелки и остановилась,\r\nразвернувшись на 180 градусов, правым бортом впритык к фольксу. Мобыть\r\nдаже слегка тюкнула бортом этот гольф. Ну, повреждений ноль, волга\r\nзавелась, развернулась и продолжила гонку. Подумаешь, на гонках\r\n(особенно зимних) и не такое бывает. Но вот только комментатор (был\r\nтогда один старпер - мож кто помнит) вдруг как-то перешел на междометия.\r\nОбычно он комментировал аварии более-менее осмысленно - т. е. называл\r\nфамилию гонщика, за какую команду выступает, что произошло и тд, а тут\r\nпроходит минуты 2-3, на трассе напряженная борьба, кто-то вырвался\r\nвперед, кто-то сошел с дистанции, а из динамиков доносится только\r\nкакое-то вяканье. И вот тут до народа начинает доходить что это личный\r\nфолькс комментатора и он там сидит внутри с радиомикрофоном. У всех\r\nпоявляются добрые советские улыбки, народ выражает бурную радость и\r\nпроявляет доброе участие ("Ну что, родимый, приссал, горшочек тебе не\r\nподнести..."). Еще через минут 3 он завелся и попытался съехать с\r\nтрассы, но ехать можно было только назад и он застрял в снегу. А еще\r\nчерез сколько-то минут из динамиков раздался голос какого-то кекса\r\n(заслуженного гонщика или там президента автомобильного союза - не суть)\r\nкоторый тоже сидел в фольксе, помогал комментировать и наконец очухался\r\n- "я считаю что гонщик проявил неуважение к нашему уважаемому\r\nкомментатору..."\r\n\r\nНе знаю, случайно ли это вышло, но если нет, то гонщик - супер-ас. Вот.\r\n :D \r\nКак зарабатывают деньги сантехники - все прекрасно знают, нам еще Афоня\r\nпоказывал, как можно в одной квартире чугунную мойку снять, что бы в\r\nдругой поставить... а вот каким образом лифтеры могут левака срубить я\r\nузнал года 2 назад.\r\nПереехали мы с женой на съемную квартиру в Марьино. Мебели мало, но\r\nпотихоньку обрастаем всякими табуреточками, полочками и прочей\r\nдребеденью. А тут еще теща в Подмосковье затеяла ремонт с полной\r\nперепланировкой и заменой мебели. И перепал нам с этой вакханалии\r\nдиван... нет, не так - ДИВАН!!.. на вид то, что называется "дед с войны\r\nприслал", весит как маленький слон + ободранные бока (а где еще\r\nприкажите любимому тещиному котику когти точить?) Позвонила она мне\r\nчасов в 7 утра, сказала, что служебная Газель уже вышла, диван загружен\r\nи задерживать рабочих крайне не желательно, так как их еще вышки и\r\nпровода на основной работе ждут. Жену на работу, сына в сад... кофе\r\nдопит, на улице - конец мая, настроение бодрое, а что на работу на час\r\nопазадаю - так и плевать..\r\nОПА НА!! Лифт не работает. В другой день плюнул бы, да спустился бы\r\nпешком с 12 этаже, через 5 минут забыл бы про это, а вечером уже бы и\r\nпочинили, но сегодня?? СЕЙЧАС??...\r\nВниз я спускался в смятении - затащить диван по лестнице не реально,\r\nздесь с табуреткой в руках фиг развернешься.. встретил "обновку",\r\nдотащили они мне его до лифта (все надежды на то, что лифт вдруг сам по\r\nсебе заработает, разумеется, не сбылись), бережно поставили в проходе,\r\nнапрочь загородив проход к лифтам и быстренько смылись по своим\r\nнеотложным делам...\r\nЕдинственная надежда оставалась на тех. службы, к которым я и обратился\r\n(благо в новых домах кнопка вызова диспетчера находится как внутри\r\nлифта, так и снаружи). Через полчаса прискакали два похмельных мастера,\r\nодин постарше, один помоложе.\r\nМолодой попинал диван ногой и вкрадчиво спросил "Диван хочешь поднять?"\r\n"Нет, блин, здесь жить буду" - съязвил я\r\n"Будешь" - успокоил он меня - "До вечера фиг починим"...\r\n......... я растерялся...........\r\n"Но выход есть.... 300 рублей и мы тебя поднимем вручную.."\r\n"Это как?" - спросил я\r\n"Да какая тебе на хер разница?" - хрипло спросил тот, что постарше -\r\n"Главное, что через 10 минут будешь дома со своим диваном"\r\n"300 - дорого" - это во мне проснулся менеджер - "200 - самое оно"\r\n"250" - молодой посмотрел на диван - "и то из чувства сострадания, в\r\nэтом диване килограмм 80, у меня дома такой же"\r\n"250, но вы мне его в квартиру занесете"\r\n"Идет..."\r\n\r\nВас никогда не поднимали в лифте "вручную"??... на крыше лифта "молодой"\r\nкряхтя что то крутил (или мне казалось, что крутил?), от чего лифт\r\nрывками поднимался вверх, "старый" там же командовал ("осторожнее,\r\nептыть..."), я же с диваном в полной темноте думал лишь об одном - лишь\r\nбы это "что то" имело ход только в одну сторону и никак не в другую, так\r\nкак лететь вниз совсем не хотелось. Интересно, что такое они там\r\nкрутят??..\r\n"Твой.. 12-ый.. вылазь"... створка лифта со скрипом отошла в сторону и я\r\nпоторопился встать на твердый бетон площадки.\r\nВ итоге мы уложились в обещанные 10 минут.. расплатился, выпроводил\r\nлифтеров-носильщиков и уселся курить, параллельно придумывая какую байку\r\nрассказать шефу про мое опоздание (вариант с ручным подъемом лифта\r\nотпадал, чувство юмора у шефа отсутсвовало напрочь).. что то там\r\nсочинив, я вышел на площадку и на автомате нажал кнопку лифта....\r\nкоторый (за 5 минут починенный) с веселым "Дзинь!" распахнул свои\r\nгостепреимные двери...\r\n\r\n"Вот ведь, блин!!" подумал я.... хотя за такой цирк наверное и денег не\r\nжалко..\r\n :D \r\nУ меня муж – эстонец. Но совсем не типичный: веселый и громкий.\r\nЗато все его родственники прямо типичные, как в анекдотах.\r\nЯ с его семьей знакома около 10 лет, во время ремонта в нашей квартире\r\nжили у его мамы с сестрой, летом все вместе живем на даче.\r\nОднажды говорю мужу, твоя мама и сестра такие дружные, так хорошо ладят.\r\nЯ НИКОГДА НЕ ВИДЕЛА, ЧТОБЫ ОНИ ССОРИЛИСЬ ИЛИ ПОРУГАЛИСЬ.\r\nМуж задумался и ответил: «Нет, они ругаются, и часто. Только ТАК ТИХО,\r\nчто ты ни разу не услышала. »\r\n :D \r\nЗнакомо ли вам это неприятное чувство, когда, глядя на своих ровесников,\r\nвы думаете:\r\n- Неужели и я так старо выгляжу? Не может быть!\r\nЕсли да, тогда эта история для вас.\r\n\r\nСидя в очереди на приеме к новому стоматологу, я обратила внимание на\r\nего диплом, висящий на стене в приемной. Внезапно я вспомнила, что\r\nкрасивый высокий мальчик с таким именем учился со мной в одном классе\r\nгде-то 30 лет назад.\r\nНо, как только я зашла в кабинет, я тут же отбросила мысль об этом -\r\nэтот лысеющий седой мужчина с изборожденным морщинами лицом был слишком\r\nстар, чтобы быть моим одноклассником.\r\nТем не менее, после того, как он провел осмотр, я спросила его, какую\r\nшколу он закончил. Он назвал номер моей школы!\r\n- В каком году? - спросила я\r\n- В 1978-ом. А почему вы спрашиваете?\r\n- Вы были в моем классе! - воскликнула я.\r\nОн пристально посмотрел на меня и спросил:\r\n- Да? А что вы преподавали?\r\n :D \r\nОтветы студентов на экзаменах:\r\n"Живые организмы размножаются с фантастической скоростью."\r\n\r\n"Большой барьерный риф построили бобры. Они приплывали с веточками в\r\nзубах и забивали их хвостами."\r\n\r\n"Естественный отбор - это когда сильная особь одного вида поедает слабую\r\nособь другого вида. В результате слабый отходит в мир иной, а сильный\r\nразмножается. Так появился человек."\r\n\r\n"Генотип - это тип, который передается по генам." На вопрос: а что такое\r\nфенотип? - пауза..."Ну, блин, я попал!"\r\n\r\nОтвет на вопрос: "Почему некоторые живые организмы не размножаются?" -\r\n"Не получается у них чего-то. Например, у слона с черепахой".\r\n :D');
INSERT INTO zforums_posts_text VALUES (323, 'e4760ead68', '', 'Анекдоты 26.01:\r\n :D \r\nАрмия. Уходит дембель.\r\n- Ну, присядем на дорожку... Духи 20, а черпаки 10 раз!\r\n :D \r\nВ брачном агентстве:\r\n- Молодой человек, что вы желаете?\r\n- Я? Пышную блондинку!!!\r\n- ОК! Нет проблем! Считайте, что специально для вас уже откармливаем \r\n  и перекрашиваем!\r\n :D \r\n- Дяденька, а как правильно он называется, мАбильник или мОбильник?\r\n- Положи на место телефон!\r\n :D \r\nПрофессор принимает экзамен у блондинки. Та, естественно, ни в зуб ногой.\r\nПрофессор устало говорит:\r\n- Знаете, девушка, вы напоминаете мне демо-версию.\r\n- Ой, вы считаете меня такой же яркой и красивой?\r\n- Да нет, просто ваши возможности так же сильно ограничены.\r\n :D \r\n       - Знаешь, как эти мерзкие американцы называют нашего Бога?\r\n- Как?!\r\n- Гад...\r\n :D \r\nБоженька тоже любит юмор. Особенно прогнозы погоды.\r\n :D \r\nМало кто знает...\r\nЧто для зачатия инспектора ГИБДД необходим презерватив в полоску и\r\nанглийская булавка.\r\n :D \r\nПодходит внук к бабке, и видит, что она на компьютере почту читает.\r\n- Ну че, бабка, спам?\r\n- Ой не спам, сынок, всю ночь не спам!\r\n :D \r\n- Взял на пробу соус "Тысяча островов".\r\n- И как?\r\n- Представляешь, двух не хватает.\r\n :D \r\nДуша болит, а начнешь лечить - печень болит!\r\n :D');
INSERT INTO zforums_posts_text VALUES (324, 'e92c480432', '', 'Истории 26.01:\r\n :D \r\nШел я как-то раз неспеша по делам служебным (приспичило завлабу срочно\r\nкупить чего-то-там, а я в самый раз по коридору шел с видом задумчивым)\r\nпоутру до магазина через лесочек. Январь месяц, мороз и солнце - день\r\nчудесный и далее по тексту.\r\nЧу, висит кормушка системы "бутыль пластиковая на 5, как минимум, литров\r\nс вырезанными стенками" на кустике. В кормушке крошки всякие да зернышки\r\nс воробушками. Под кормушкой, соответственно, кошка. Рыжая такая,\r\nсимпатичная, толстенькая. Смотрит на кормушку умильно. Ну, думаю, высоко\r\nвисит кормушка, обломится тебе полноценное питание. Отошел метров на\r\nдесять, закурил, жду... Тут кошка начинает заниматься совсем\r\nнеадекватным времяпровождением - по тропинке, натоптаной до кормушки\r\nсердобольными жителями академгородка, разбежится и с разбега ба-бах\r\nтолстой мордой лица об дно кормушки. Птички, ясен пень, разлетелись.\r\nКрошки с зернышками, впрочем, тоже того, разлетелись в смысле. На снег\r\nокрестный. Докурил я да пошел дальше.\r\nДесять минут спустя. Иду обратно. Висит кормушка уже пустая. По снегу\r\nскачут воробушки, собирая вкусную и здоровую пищу. А где же кошка???\r\nПрисмотрелся - из сугроба торчат усы и горящие жаждой скорого\r\nпиршества глаза.\r\nА еще говорят, что у животных нет интеллекта;)\r\n :D \r\nВ общем, преподша зверствовала, у всех искала шпоры. Я положил шпору под\r\nпарту. Она ходит между рядами, я шпору не трогаю. Один чел на другой\r\nпарте, сбоку от меня тоже под партой спрятал шпору. И полез за ней,\r\nпридурок. Преподша наклоняется, фиксит его шпору и.... поворачивается в\r\nмою сторону. Видит мою шпору и пересаживает меня. Без шпорки я не\r\nнапишу. У меня листы формата а4. Думаю, хоть поиздеваюсь над ней.\r\nНачинаю делать вид, будто у меня между листов шпора. Причем\r\nвнаглую - когда она смотрит в мою сторону.\r\nОна не выдерживает. Подходит и спрашивает:\r\n- Что у вас там?\r\n- Ничего интересного!\r\n- Ну все же, что там?!\r\n- Я же говорю, для вас это никакого интереса не представляет!\r\n- ЧТО там?\r\n- Хорошо, давайте поспорим, если вы там найдете шпору - ставите 2 и я\r\n  прихожу на пересдачу, когда скажете; если там ДЕЙСТВИТЕЛЬНО ничего \r\n  нет - вы ставите 3.\r\n- Идет!\r\nОна берет листы, раскладывает по одному, переворачивает, даже на свет\r\nсмотрит. Далее следует кислая мина:\r\n- Давайте зачетку!\r\n :D \r\nЖиву я в Ленинграде.. есть у нас такое радио РОКС... постоянно слушаю..\r\nЕсть там такая программа об автомобилях - "Терра Мобиле".\r\nДак вот, значит, пригласили они как-то на программу, видимо в рекламных\r\nцелях, директора топливной компании Фаэтон...\r\n... Часа полтора он разглагольствовал по поводу качества своего бензина,\r\nвежливости персонала и прочей херне, попутно отвечая на звонки...\r\nИ вот, под конец, звонит мужик.. слышно, что с мобильного...\r\nМонолог - что-то вроде этого:\r\n- "Здравствуйте уважаемый директор топливной компании, хотел у вас\r\n  спросить... я сейчас стою на вашей заправке... у меня в машине бак\r\n  объемом 60 литров... он был пустой.. почти... дак а почему залили 70?"\r\n\r\n... комментарии излишни.. :)...\r\n :D \r\nОбучаю свою подругу Шери русскому языку. Шери - афроамериканка. Урок\r\nпроисходит лежа в койке, с утра. Фонетика. Букву "Ё" освоили без\r\nзатруднений. Учим трудную букву "Ы". Я тяну с рычанием эту любимейшую\r\nфидошную гласную: ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ! Как Леонов в фильме\r\n"Кин-дза-дза". Шери в ответ вопит: УУУУУУУУУУУУУУУИИИИИИИИИИИИ! "Ы" не\r\nвыходит. Шери злится. Я снова и снова пытаюсь ей втолковать, как же\r\nправильно говорить букву Ы. Говорю: скажи "МЫЫЫЫ!!!" Это значит "WE".\r\nШери пытается повторить. Получается "Муууууу!!!" Я долго ржу. Шери\r\nпытается меня придушить подушкой. Тут меня осенило. Говорю: "Быть или не\r\nбыть!" На что мне Шери выдает почти без акцента: "ИБУТЬ или НЕ ИБУТЬ!" Я\r\nприпух на пару секунд, после чего отвечаю по-русски: "КОНЕЧНО ИБУТЬ! Еще\r\nи как ИБУТЬ!" И тут же объяснил моей черной Нефертити, что именно она\r\nсказала (по-английски), и что именно я собираюсь с ней делать. После\r\nэтого русский язык был забыт еще часа на два.\r\n :D \r\nРаботал я несколько лет назад в одном НИИ. Помимо всех остальных\r\nпрелестей постсовковой полуразваливающейся науки, там были "чУдные"\r\nотхожие места, напоминающие вокзальные, со столь грязными унитазами, что\r\nна них страшно было присесть, поэтому народ все больше забирался на них\r\nс ногами. Самое интересное, что это были туалеты для, так сказать,\r\nверхушки института, куда остальные сотрудники забредали только изредка\r\n(официального запрета не было, но дирекция и ученая часть находились в\r\nотдельном крыле, куда рядовым сотрудникам было далековато). И вот, после\r\nпосещения "туалета типа сортир" высоким начальником, удивившимся такому\r\nубожеству, было принято решение о "евроремонте" в отдельно взятом\r\nсанузле. Не прошло и недели после установки нового унитаза, как по\r\nинституту прошел слух о травме сотрудницы, которая, как выяснилось, с\r\nногами залезла (по привычке, видимо) на новенький чистенький шведский\r\nунитаз... А он не выдержал столь грубого обращения, и раскололся под\r\nней, нанеся ей "тяжкие телесные повреждения" в интересном месте. Она\r\nпопыталась было подать в суд на институт за "травму на рабочем месте",\r\nно, видимо, поняла, какой ржач такой иск вызовет.\r\nОднако, чтобы обезопасить себя от повторения таких случаев и возможных\r\nисков, по наущению юриста администрация вывесила объявление в туалете:\r\n"Запрещается залезать с ногами на унитаз! За полученые травмы\r\nадминистрация НИИ ответственности не несет!"\r\n :D \r\nИстория просто двухчасовой свежести.\r\nДруг вчера говорит: "Прилетает мой кореш, встретить не могу, выручай".\r\nПоехал я сегодня в аэропорт Пулково встречать рейс из Франкфурта. Рейс\r\nзадержался почти на час, и я пошел в бар кофейку попить. Только сел за\r\nстолик - входит в бар Кинчев с другом, взяли по кофе и сели за соседний\r\nсо мной столик. Как потом выяснилось, они встречали кого-то с этого же\r\nрейса.\r\nОбъявили посадку, все встречающие двинулись к выходу из зала прилета.\r\nКинчев, нараздавав автографов и наснимавшись со всеми, кто к нему\r\nподходил, в итоге стоял практически первым из встречающих.\r\nВыходит человек, которого я встречаю. Пошатывается, улыбается. На выходе\r\nглаза его непонятным образом вывалились из орбит, улыбка с лица слетела\r\nи он проследовал до машины беззвучно.\r\n- Что случилось? - спрашиваю уже в машине.\r\nВыяснилось, что человек практически не пьет. Пьет только в самолетах,\r\nпотому что жутко боится летать. И вот он, хорошо поддав в полете,\r\nскрасил себе время тем, что, будучи поклонником русского рока, в полусне\r\nслушал через плеер диск группы "АЛИСА"!!!\r\nДалее представьте себе, какой глюк по пьяни он словил при выходе из\r\nаэропорта, когда первым человеком из встречающих на его пути оказался\r\nКинчев!!!\r\n :D \r\nО преемственности сантехников, или как починить трубу\r\n\r\nПроизошло это сразу после Нового года в подмосковном пансионате Пахра,\r\nкуда мы отправились на каникулы с дочкой.\r\n\r\nВ ванной нашего номера нас ждал сюрприз. Под изгибистой трубой\r\n(полотенцесушителем), стояла подрезанная «под баночку» пластиковая\r\nбутылка, в которую звонко вытекали из дырки в трубе капли живительной\r\nвлаги.\r\n\r\nБыл ВЕЧЕР. Перспектива провести ночь за опорожнением в унитаз баночек с\r\nводой меня не привлекала. Я направилась к администратору и попросила\r\nвызвать сантехника.\r\n\r\nСантехника звали Миша. Был он высок и худощав. Его лицо несло на себе\r\nотпечаток активно отмеченного Наступающего и наступившего. Туго\r\nориентируясь в пространстве, он взирал на трубу с сожалением, но\r\nпреданно, затем провозгласил:\r\n\r\n- Ну, ничего страшного. Завтра сделаю…\r\n- !!!!!!!!!!!! Почему завтра?\r\n- Потому что кладовщица уже ушла.\r\n- !!!??????? А кладовщица-то вам зачем?\r\n- Затем, что у нее прокладки. А без прокладки я починить не могу. Да вы\r\n  не волнуйтесь, много за ночь не натечет…\r\n\r\nЛадно, я еще не очень осерчала. И мы с ним договорились, что в 10 утра\r\nон появится и осчастливит нас и трубу.\r\n\r\nУТРОМ СЛЕДУЮЩЕГО ДНЯ я добросовестно опорожнила наполненную емкость, и\r\nвернула под трубу.\r\nМиша не пришел.\r\n\r\nЧЕРЕЗ 10 ЧАСОВ я спустилась к администраторше и вновь, уже на повышенных\r\nтонах, предложила вызвать Мишу…\r\n\r\nМиша пришел. Был он маленький, толстый и трезвый. Я смутилась, т. к.\r\nхорошо помнила, как он выглядел вчера. И если за сутки он мог\r\nпротрезветь, то поправиться и укоротиться он явно не сумел бы. От\r\nнеожиданности, единственное, что я произнесла, было:\r\n\r\n- Миша, а вчера вы выглядели иначе…\r\n- Так то был другой Миша, - весело сказал он, - вы не волнуйтесь, я вам\r\n  сейчас все починю. Я избавлю вас от баночки…\r\n\r\nМиша принес металлический желоб, длиной в полметра и шириной сантиметров\r\nпятнадцать. Доверяясь новому трезвому Мише, я спокойно следила за его\r\nдействиями.\r\nМиша приставил один конец принесенного им металлического желоба к дырке\r\nв трубе, а второй – спустил в раковину. Затем радостно произнес:\r\n\r\n- ВОТ СЕЙЧАС Я ЭТУ ШТУКОВИНУ ВОТ ТАК ВОТ НАКЛОННО ЗАКРЕПЛЮ, И ВАМ БОЛЬШЕ\r\n  НЕ ПРИДЕТСЯ ВЫЛИВАТЬ БАНОЧКУ! Вода по этому желобу будет САМА стекать в\r\n  раковину...\r\n\r\n- !!!!!!!!!!!!!!!!!!!!!!!!!!?????????????????????\r\n\r\nВзрыв моего негодования прогремел в администрации. Там я подробно\r\nизложила свое видение того, как профессиональные сантехники должны\r\nчинить трубу... В своей длинной, прочувствованной речи я пообещала, что\r\nза все дни пребывания ни разу на опущусь до баночки - пусть она вытекает\r\nвниз, в стороны, по стенам, к потолку... И вообще, если произойдет\r\nпотоп, то мне на это абсолютно наплевать... И вообще, и вообще...\r\n\r\nВконец озверевшая, я отбыла в номер, и стала остывать.\r\n\r\nЧЕРЕЗ 5 МИНУТ в дверь робко постучала горничная: «Мне поручено заменить\r\nу вас баночку», - сказала она. И под текущей трубой, вместо маленькой\r\nбаночки, она воцарила большое черное ПОМОЙНОЕ ВЕДРО.\r\n\r\nPS.\r\nКАЖДОЕ ПОСЛЕДУЮЩЕЕ УТРО в дверь вежливо стучала горничная.\r\n- Не нужно ли вам вылить ведро? - интересовалась она...\r\n :D \r\nСчастливый ли я человек? Я не знаю. Но мне постоянно катастрофически\r\nвезет. Везет во всем. Но так было не всегда.\r\n\r\nНачалось это не так давно, лет семь назад. Я тогда учился в десятом\r\nклассе, отметками не блистал, внешностью тоже, короче, был стандартным\r\nсереднячком. Серым. Совсем незаметным. Не выдающимся. Меня даже друзья\r\nзвали – Серый.\r\n\r\nЛюди смотрели на меня и через секунду забывали. Точно так, как люди\r\nсмотрят на коврик у дверей – мимолетно, не вникая, не цепляясь взглядом.\r\n\r\nУчителя давно махнули на меня рукой и радовались, если я тянул руку,\r\nготовый ответить. А такое было редко. Раз в полугодие, а то и в год.\r\n\r\nРодители тоже разочаровались во мне, и все свое внимание переключили на\r\nмладшего брата. Этот был просто идеален. Староста класса, отличник,\r\nспортсмен, поэт и любимец девчонок не только своего, но и даже старших\r\nклассов.\r\n\r\nЧто и говорить, среди девчонок я популярностью тоже не пользовался.\r\nАбсолютно. На мои редкие попытки пригласить их в кино, они отвечали\r\nпо-разному – нормальные говорили, что сейчас не могут, но может быть\r\nпотом (ага, хуй там), ебанутые прямо посылали в известном направлении –\r\nно в любом случае, итог был одинаковым.\r\n\r\nДворовые пацаны тоже меня недолюбливали. «Какой-то он никакой», -\r\nговорили они. Но потом все изменилось.\r\n\r\nТогда, в 1996 и случилось чудо из чудес – на меня обратила внимание\r\nдевушка. Красивая. Охуительная. Я был не опытен и зажат. Но мне повезло,\r\nболтала все время только она. Она предлагала, куда ехать, где лучше\r\nвыпить, где поебаться.\r\n\r\nВ постели она все сделала сама. Одноклассники от зависти просто хуели –\r\nеще бы, самым продвинутым из них приходилось перепихиваться с прыщавыми\r\nщеглихами или вонючими шлюхами, а тем, кто позажатее - того хуже,\r\nдрочить себе в кулачок, вызывая в голове образ мой женщины.\r\n\r\nЯ стал смелее, и шпана предпочла со мной не связываться.\r\n\r\nС учебой тоже наладилось. Почему-то хорошие оценки стали даваться легко\r\nи непринужденно, учителя стали хвалить меня.\r\n\r\nПотом поперло – золотая медаль в школе, поступление в престижный ВУЗ,\r\nпоездка в Штаты по обмену. После универа, который я закончил за три\r\nгода, приняли на работу в крупную компанию, быстро там продвинулся до\r\nзама. От женщин не было отбоя, мне даже не надо было напрягаться.\r\n\r\nА хули. Ведь тогда в девяносто шестом мой батя стал губернатором\r\nобласти.\r\n :D \r\nПервые послевоенные годы. Львовщина. Батя, после "дембеля", остался на\r\nофицерской должности при полке связи. Был начальником узла связи, где\r\nему был поручен ремонт разнообразной трофейной немецкой радиоаппаратуры.\r\nКвартиру с приятелем на пару они снимали у одной местной тетушки.\r\nИ вот попал к ним в руки армейский приемник то ли Grinding, то ли\r\nPhilips. Бились над ним недели две. Не хочет работать вражья машинка.\r\nПриволокли аппарат на выходные на квартиру, сидят, паяют-перепаивают.\r\nЗаходит хозяйка:\r\n- Хлопцы! Вы жрать идете или как?\r\n- Ща, мать, тут у нас запарка.\r\n- Шо у вас там?\r\n- Да те, мать, не понять – Радио!\r\n- Да язви вас в душу перемать, выж все не так делаете!\r\nОтец с корешом от таких слов в ступор впали.\r\nХозяйка рванула к столу, секунд 15 разглядывала аппарат и, схватив\r\nпаяльник и пару проводов, навесила на монтаж пару перемычек.\r\n- Включайте, хлопцы.\r\nХлопцы как под гипнозом включили, лампы прогрелись, и аппарат залился\r\nкакими-то маршами. Батя с приятелем сползли на полчаса под стол.\r\nОказалась, что их хозяйка во время оккупации была угнана в Германию и\r\nтам работала на конвейере на сборке этих самых радиоприемников. И паяла\r\nэтот самый узел, над которым мой батя с корешом так долго пыхтели. \r\nО как!\r\n :D \r\nЭто сейчас куда ни плюнь обязательно попадешь либо в бизнесмена либо в\r\nпредпринимателя, а в далеком восемьдесят третьем я и слово-то такое\r\nредко слышал, не говоря уж о самих представителях такой тяжелой\r\nпрофессии. Но исключения были, и одним таким исключением стал приехавший\r\nк нам на север за «длинным рублем» паренек с Винницкой области,\r\nустроившийся водителем на снабженческий «ЗиЛ» нашего леспромхоза.\r\nНеплохой такой паренек и как водитель тоже, по крайней мере я такой\r\nвывод сделал, съездив с ним в пару краткосрочных командировок. Интересное\r\nначалось гораздо позже, а именно тогда, когда в одной из поездок\r\nзабарахлил движок машины. Заглох и не заводится. Толик долго ковырялся\r\nпод капотом, объясняя свое отношение к этому рыдвану на смеси русского\r\nязыка и украинской мовы, в итоге из кузова был выдернут канат и в родные\r\nпенаты мы двигались уже в виде гужевой повозки, где вместо лошади был\r\nвзявший нас на абордаж какой-то Камаз.\r\n  По прибытию на место назначения, Толик – я так думаю из лучших\r\nчеловеческих побуждений, выдернул из кошелька пять рублей и побежал\r\nрассчитываться с водителем тяглового средства, видимо совсем забыв из-за\r\nнервной обстановки, где он находится. Естественно, что убеленный сединой\r\nдедок – водитель Камаза, всю жизнь проработавший на севере, послал его\r\nвместе с пятью рублями очень далеко, я так думаю, что даже дальше\r\nтерриториального пространства Советского Союза, а мне потом пришлось\r\nдолго объяснять Толику, что на севере взаимовыручка не основана на\r\nматериально-денежных отношениях. Толик вник.\r\n  В тот памятный день командировка намечалась в областной центр, что от\r\nнашего леспромхоза километрах в четырехстах. Туда груза не было и\r\nпланировалось проскочить налегке, но странное дело, как только мы выехали\r\nна трассу областного значения, Толик ударил по тормозам. Я ничего не\r\nпонимая наблюдал как он довольно шустро запрыгнул в кузов и так же\r\nшустро сбросил оттуда на землю жесткую сцепку. Не успел он подтащить ее\r\nк переднему бамперу, как из-за поворота выскочил груженный КраЗ,\r\nкоторому Толик отчаянно махнул рукой. Минут через пять мы были прочно\r\nзакреплены за его фаркоп, а отдувающийся Толян запрыгнул в кабину.\r\n- Не понял? – только и смог произнести я, наблюдающий всю эту\r\nсвистопляску.\r\n- А что тут непонятного, он тоже в город едет, - заверил меня тот.\r\n- Так мы сломались, что ли? – все еще не имея возможности найти\r\nлогическую цепь, задавал я глупые и наивные вопросы.\r\n- Ниче мы не сломались, просто дорогу я не знаю, а на жесткой сцепке и\r\nвыспаться можно! Такому «зверю» - кивнув на рванувший нас с места КраЗ –\r\nмы как пушинка, – устраиваясь поудобней, объяснил Толян – видимо в душе\r\nпоражаясь моей беспросветной тупости. – Доедем с ветерком, а бензин я\r\nпродам – закатывая глаза в предвкушении будущих барышей, довел он свою\r\nпредпринимательскую мысль до конца.\r\n  Ехать на жесткой сцепке, в общем-то не плохо, особенно когда первые сто\r\nкилометров сидишь с открытым ртом в нирваническом состоянии. Правда,\r\nнемного мешает летящая из-под колес ведущей машины пыль, но разве это\r\nпомеха при таком полете предпринимательской мысли. Сейчас, конечно, я\r\nсмотрю на это совсем по-другому, но тогда …, тогда я мягко говоря\r\nнаходился в том же состоянии как папуас увидевший самолет. Не, ну\r\nстебануть на родном заводике пачку пиломатериала, которую потом можно\r\nпродать, это еще куда ни шло, но разве это сравнимо с такой комбинацией?\r\n  Толик спокойно читал газетку и иногда мигал фарами, если было желание\r\nвыскочить по малой нужде. Когда на землю опустились сумерки, он вообще\r\nзакемарил. А я думал – я всю дорогу думал и иногда мысли заводили меня в\r\nтакую даль, что я косо посматривал на своего водителя, прикидывая какую\r\nхрень он может еще придумать и не окажусь ли завтра я в роли КраЗа,\r\nкогда Толик захочет еще что-нибудь экономить и продавать. Мысли эти\r\nбыли довольно черные и пугающие!\r\n  Правда, бизнес Толяна прогорел, северный край стер его\r\nпредпринимательскую мысль на нет, бензин просто некому было продать. Ну\r\nи действительно - кому его продашь, если любую машину останови и\r\nканистрочку-то обязательно нальют – забесплатно!\r\n :D');
INSERT INTO zforums_posts_text VALUES (325, '250e110226', '', 'Анекдоты 27.01:\r\n :D \r\nВоспоминания с выставки: \r\nПеред вами редкостный шедевр - "Портрет неизвестного". Это ранее \r\nнеизвестная копия с картины неизвестного художника, сделанная неизвестно \r\nкем, неизвестно когда, и неизвестно как попавшая в наш музей.\r\n :D \r\nОн длинно выругался словом из трех букв...\r\n :D \r\nВ связи с продолжающимся подорожанием жизни в Нью-Йорке, грабители\r\nтеперь требуют со своих жертв на 3% больше денег.\r\n :D \r\nХороший друг - тот, который не даст тебе попасть в тюрьму по дурости.\r\nНастоящий друг - это тот, который будет сидеть в соседней с тобой камере\r\nи говорить "Б#я, это было круто!!"\r\n :D \r\nНастоящая свобода начинается тогда, когда у вас появляются два\r\nначальника.\r\n :D \r\nЛежат в стакане две линзы, и тут одна другой говорит:\r\n- Блин, ты слышишь, уже двенадцать дня, а мы еще ни в одном глазу!\r\n :D \r\nКак подумаю, какой из меня инженер - боюсь идти к врачу.\r\n :D \r\nМне сегодня цыганка за 50 баксов нагадала, что я лох.\r\n :D \r\nПришла в дом к богатому хозяину девушка наниматься в гувернантки.\r\nХозяин отметил ее хорошие рекомендации и попросил в качестве небольшого\r\nэкзамена сделать книксен, что она тут же и продемонстрировала. Хозяин\r\nостался очень доволен. Заметив это, она с надеждой спрашивает, мол, как\r\nнасчет работы, принята?\r\n- Конечно, дорогая! Вот только у вас наблюдается неправильное\r\n  трактование понятий: книксен - это несколько другое, а то, что вы \r\n  сейчас сделали, называется минет.\r\n :D \r\nРецепт коктейля "Идиот": \r\n150 гр. кока-колы \r\n50 гр. Hennessy X.O.\r\n :D');
INSERT INTO zforums_posts_text VALUES (326, 'dfc2685962', '', 'Истории 27.01:\r\n :D \r\nИз опыта работы в телефонной компании в Америке. Звонит на линию\r\nобслуживания клиентов какой то мужик (американец). Позле обычного\r\nприветствия, спрашиваю, как могу помочь? Мужчина совершенно беспечным\r\nголосом просит кредит за звонок такого-то числа по номеру ххх-хххх. Я\r\nпосмотрела звонок в системе: звонок длился ровно минуту, и обошелся\r\nмужику всего-то в 5 центов (!). Но, наверное, дело в каком то принципе,\r\nподумала я, и невинно поинтересовалась по какой причине кредит-то\r\nдавать? - Может, звонок не соединился? Или качество связи было плохое? -\r\nспрашиваю.\r\nМужик обыденно: да нет, соединился, просто оказалось, что человек, с\r\nкоторым я хотел поговорить по этому номеру - умер...\r\nС трудом веря собственным ушам, я все же проговорила: "Сэр, я очень\r\nсочувствую, но к сожалению, компания не гарантирует, что абонент, с\r\nкоторым вы пытаетесь связаться окажется жив. Компания несет\r\nответственность за качество соединения, и надеюсь, в этом вполне\r\nоправдала ваши ожидания"... В общем, кредит на 5 центов я ему не дала...\r\nИз принципа.\r\n :D \r\nВ гости зашел приятель, школьный учитель географии. Выпили, конечно.\r\nВодка быстро кончилась, зато началось хорошее настроение. Бориса\r\nпотянуло на прекрасное. "Сергей Сергеич, а не сходить ли нам в театр?"\r\nДелов-то! Повесили на себя галстуки, поехали в Драматический. Как\r\nистинные театралы дождались самого интересного места во всех воронежских\r\nспектаклях - антракта. В буфете взяли еще коньяку...\r\nМинут через десять Борис накренился ко мне вместе с буфетным столиком:\r\n"Сергей Сергеич, а нет ли здесь поблизости еще театров?"\r\n :D \r\nВ конце восьмидесятых я гостил у деда с бабкой в Киеве.\r\nОба они прошли всю войну от первого до последнего дня. А после войны\r\nполучили участок в Киеве для застройки, на Сталинке, и сами построили\r\nсебе там дом.\r\nБабуля меня и просит - слазь, внучек, на чердак, прочисти трубу печную,\r\nа то уж сильно дымит.\r\nЗалез я на чердак, все что надо сделал, а когда уже на выход пошел, то\r\nзаметил в углу чердака чемодан.\r\nДревний, фанерный чемодан, какие я только в старых фильмах видел. Весь в\r\nпыли и паутине. Сразу почему-то появилась мысль о забытых сокровищах.\r\nПросто так ведь чемоданы на чердаках не прячут!\r\nПопробовал подвинуть это фанерное убежище сокровищ - ого! Не тяжелый, а\r\nпросто тяжеленный! Ну очень интересно!\r\nБудем открывать!\r\n\r\nОткрываю. В чемодане лежит огромный темно-серый валун. Просто камень.\r\nКак ни странно - прямоугольной формы, абсолютно совпадающей с\r\nчемоданной. Ни поднять, ни вытащить этот камень из чемодана невозможно,\r\nнастолько плотно он там сидит.\r\nЧто за фигня такая?\r\nМожет надгробный камень какой-то? И почему он так точно повторяет\r\nразмеры чемодана? И кто затащил эту тяжесть на чердак?!\r\nНепонятно...\r\nПошкрябав пару минут каменюку ногтями, я закрыл чемодан и весь\r\nзаинтригованный спустился вниз. Где сразу спросил бабушку Веру\r\nГригорьевну об этом каменном чуде.\r\nБабушка рассмеялась и рассказала историю.\r\n\r\nКогда после войны дом строили, вместе с ними жила бабкина мама - моя,\r\nзначит, прабабушка.\r\nБабушка Настя.\r\nРодилась она в конце девятнадцатого века и прожила всю свою жизнь на\r\nУкраине. Поэтому жизнь у прабабушки была очень трудная.\r\nВсе то, что мы учим по учебнику истории - первая мировая война,\r\nреволюции, немцы, Петлюра, гражданская война, Махно, голодомор,\r\nколлективизация, репрессии, вторая мировая война, оккупация и так далее,\r\nможете добавить сами - все это она испытала на собственной шкуре.\r\n\r\nНо вот 45-й год. Победа!\r\nВраг повержен! Бедам пришел конец! Наконец-то наступила нормальная\r\nмирная жизнь.\r\nНо скоро началась холодная война. Да еще какая - с сытыми и сильными\r\nамериканцами и их страшными атомными бомбами!\r\nЧем все это закончится никто не знал, но ничего хорошего ждать не\r\nприходилось.\r\nУмудренная жизнью прабабка поняла - надо готовиться. И она стала\r\nпонемногу на базаре покупать каменную соль. После чего ссыпала ее в\r\nфанерный чемодан на чердаке, пока не наполнила его до краев. Про запас,\r\nна всякий случай. Соль ведь не портится и - что самое главное - всегда\r\nпригодится.\r\nИ соль действительно не испортилась. Но за 40 послевоенных лет она\r\nнатянула в себя влаги, затвердела и превратилась в монолитный камень.\r\nПамятный камень нашей истории.\r\n\r\nСоль эта - я уверен на 100 % - до сих пор лежит на чердаке старого дома.\r\nИ может быть еще когда-нибудь понадобится.\r\nКто знает.\r\n :D \r\nВ свой первый рабочий день на новом месте долго не могла "блюсти"\r\nсерьезное лицо. После следующего зрелища: \r\nСтена заводского туалета. Три листа формата А4, все тексты - одинаковым \r\nшрифтом (Таймс, само собой - кому придет в голову его менять?! На \r\nзаводе-то...) \r\nТексты дословно:\r\n\r\n1. Просьба экономить воду (это даже жирным Таймсом Многострадальным)\r\n\r\n2. Миссия завода: удовлетворение всех отраслей промышленности\r\nконкурентоспособными средствами измерения, контроля и регулирования\r\nтехнологических процессов, безопасными для общества и окружающей среды.\r\n\r\n(Ф-ух! И это, повторяюсь, в туалете. Для рабочих. Не знаю, пытался ли\r\nкто-то из пролетариев вдуматься в это... Но главное, вы не пытайтесь -\r\nсохраните адекватность еще на минутку!) \r\n\r\n3. Просто шедевр:\r\n\r\nСвинья свинье сказала как-то:\r\nЧто мимо "лунки", то - де-факто,\r\nЧтоб повышать свою культуру,\r\nКлади "посылку" в цель - де-юре.\r\nМораль: РАБОЧИЙ, КАЖДЫЙ РАЗ\r\nПОПАСТЬ СТАРАЙСЯ В УНИТАЗ!!!\r\n\r\nЯ не плакаль... я ржаль... весь день.\r\nИ вот уже второй день меня спрашивают, почему я отсюда ухожу.\r\nPS какое там: "уважаемые господа, не мочитесь в подъезде!"\r\n :D \r\nПоехали на рыбалку....\r\nЗима, мороз под 30. Приехали днем, разбрелись по водоему, условившись,\r\nкак стемнеет собраться в избушке, дабы переночевать, попутно приняв для\r\nсугрева и компрессу ну и поделиться впечатлениями.\r\nЯ, тогда мне лет 20 было, быстренько наловил ершей, поставил со льда\r\nдонки на ночь, маленько подергал окуня и "сдался", отправившись в\r\nизбушку. Затопил печь, порезал закуску, вынес "греть водку". Через\r\nнекоторое время подошли мужики. С порога мне: "Че-то прохладно у тебя,\r\nподдай давай" (надо сказать, что к тому времени я уже сидел практически\r\nв майке). Ну, надо так надо, нет проблем, дров полно, нажарганили так,\r\nчто дверь открывать пришлось.\r\nСели, выпиваем, закусываем, разговариваем, кто сколько, кого и как за\r\nдень....\r\nПодходит мой батя, ресницы, шапка в инее, ну, думаю не иначе как на\r\n"дальний кордон" ходил. Требут свой законный стакан с горячительным. С\r\nэтим тоже проблем нет.\r\nТут надо сказать, что батя воспитывал меня по принципу "строго, но\r\nсправедливо", был классным специалистом (мы оба инженеры-строители) и\r\nявлялся для меня непререкаемым авторитетом (к сожалению, бати сейчас уже\r\nнет). И еще одна особенность: на зимнюю рыбалку, когда мы ехали на это\r\nместо всегда ездил в резиновых сапогах, вместо носков наматывал\r\nпортянки, причем наматывал с незаурядным мастерством.\r\nВ общем, он выпил, в избушке жарища, накурено, выпил еще.... еще... Ну и\r\nсморило его... Прилег на лежанку, уснул. Мы с мужиками и забыли о нем,\r\nрасспорились о чем-то... Часа через 2, уже поздний вечер, вроде как бы и\r\nспать пора... Давай укладываться. Дровишек еще подбросили... А батя как\r\nв сапогах был, так в них и в одежде уснул. Мужики говорят, мол сними с\r\nотца сапоги-то... Ноги -то у него ведь того... Жарко будет... Ну я долго\r\nне соображал, набрался уже порядочно... Сдернул сапоги с него, размотал\r\nпортянки... Тут решили еще выпить на сон грядущий, опять заспорили о\r\nчем-то. Вдруг батин бас с кровати:\r\n- Кто, мля, снял с меня сапоги?!\r\nНу я :\r\n- Пап, да я это, чтобы тебе не жарко было!\r\nДалее буквально слышу как скрипят его извилины: "типа сын конечно\r\nмолодец, за отцом бдит, но надо и приструнить немного" И чувствую:\r\nнеудобно ему, что уснул, еще подумает сын, что батя старый стал,\r\nпьянится быстро... Да и мужики, друганы его рядом, надо ж\r\nреабилитироваться как-то...\r\nБесподобный ответ:\r\n- Ну и мудак же ты! Я ж больше так славно портянки ни в жисть не\r\n  намотаю!!!\r\nУ нас аж стопки из рук повыпадали.....\r\n :D \r\nОказывается, мужчины не любят болтающих в постели женщин, особенно,\r\nкогда те вспоминают своих бывших. Ну и, как следствие, не_любят их. А я\r\nвот расскажу вам одну грустную-печальную историю, произошедшую с моей\r\nодноклассницей, назовем ее Натащща, именно так она и выглядит -\r\nфигуристая блондинка, мечта южного поэта. Было это давно. Заглянула я в\r\nаптеку на Китай-городе, и услышала, как кто-то требует у провизора\r\n"силиконовые затычки, как у агента Купера". Обернулась я - и ба! кого я\r\nвижу! Натали! Отродясь я с ней не дружила, но она меня узнала, и оставив\r\nнесчастного фармацевта в покое, вцепилась в меня. Взяла на углу коньяку\r\nдорого паленого и газировки на запивку, и в скверике на горке\r\nрассказала, что у нее есть муж. И она с ним спит. И он - нет, не храпит.\r\nОн разговаривает. Нет, не лунатик. Не во сне. В процессе. Училась\r\nНаточка в институте, и были у нее поклонники, а некоторые даже с\r\nсерьезными намерениями, а в их числе даже и симпатичные. А среди них\r\nодин - настоящая жемчужина, с богатыми и щедрыми родителями. Ему и выпал\r\nсчастливый билет. Мешало лишь обстоятельство в виде первой жены, потому\r\nдело чуть затянулось. Ната купалась в платоническом восхищении и зависти\r\nнеустроенных подруг, наконец-то назначили свадьбу, через несколько дней\r\nпосле выпускного студенческого бала, и тут... Я уже упоминала, что она\r\nблондинка? Может, посмотрела она что-то вроде "Американского пирога" -\r\nтогда его еще не сняли - и запало ей в голову, что в таком возрасте\r\nдевочкой быть просто неприлично. Рассказ ее плавный перемежался глотками\r\nто из одной бутылки, то из другой, и уровень в них неуклонно понижался.\r\nОна вышла на охоту за опытом. Ума еще достало понять, что делать это\r\nнадо на стороне. Первая попытка провалилась - он довел ее до дома и\r\nпошел мыться. Вышел весь розовый и благоухающий, она спросила у него,\r\nвсе ли он помыл, и ушла. Обидело ее, что он типа как врач, который руки\r\nмоет. Ну никакой романтики, никакого страстного порыва. Второй начал\r\nпихать первой в ванну ее. Она оскорбилась, подумала, что он подумал, что\r\nот нее плохо пахнет, а то и он считает ее грязной, и он схлопотал от нее\r\nпо зубам. Сумочкой. С металлическими уголками. С третьим она решила\r\nдовести до конца. Он тоже сперва помылся, потом свечи разжег, налил\r\nшампанского... В этот раз, для сохранения Гомеостатического Равновесия и\r\nпрекращения истерики, пощечин набрала уже она. Естественно, nihil.\r\nЧетвертым был подцепленный на дискотеке любитель кислоты. До мыться не\r\nстал. Сделать ничего не смог (не всякий зайчик на таблетке - гарантия\r\nудовлетворительного результата). Пятый - качок. Результат тот же (не\r\nвсякая бытовая химия одинаково полезна). Попытка номер шесть - ВИА Гра\r\nотдыхает - алкоголик. Этот хотя бы попытался, только не заметил, что\r\nдевушки в ближайшем секторе пространства нет. Еще один анализ ошибок.\r\nТаксист на настоящей желтой мащине с шашечками (в ту пору в Москве таких\r\nбыло максимум трое) дал ей телефон. Думала - его, оказалось - лечебницы.\r\nДевушка явно пошла вразнос и покатилась по наклонной. Еще несколько, как\r\nона сказала, извращенцев, которые после четкого объяснения, что от них\r\nнадо, как-то очень бысто линяли. В общем, своего Великого Дефлоратора не\r\nнашла, а приобрела лишь отвращение к мужикам, которые только обещают!\r\nСостоялась свадьба, и была она на этой свадьбе заслуженно в белом и под\r\nфатой, и живет она теперь с мужем, мечтая о силиконовых затычках\r\n(латексные к теме ближе) для ушей. Потому что он разговаривает. Так и\r\nвижу это картину: сидит Натали, раскинув ноги в модной обувке, на груде\r\nбитого кирпича, полы пальто по земле раскиданы, и дирижирует пустым\r\nконьячным мерзавчиком характерными такими поступательными движениями.\r\nМуж-де считает нужным заверять ее, что она лучше бывшей. Так и говорит:\r\nты-лучше моей-бывшей ты-лучше моей-бывшей\r\nты-лучше-мой-бывшей-лучше-бывшей-лучше-бывшей-лучше-лучше-лучше-лучше!!!\r\nты-лучше-моей-бывшей-\r\nА она смотрит в потолок и мечтает о силиконовых (а латексные больше в \r\nтему) затычках для ушей. Иээх, да что там говорить! И ушла она нетвердыми \r\nшагами, поддерживая баланс баллоном газировки, повергнув меня в сомнения, \r\nибо глубины ее горя я по младости лет оценить не смогла. Может, \r\nдействительно лучше? Может, ее муж не любит акробаток в постели, а любит \r\nсам упражняться на бревне? С тех пор я ее больше не встречала. Почему она \r\nвсе это рассказала мне? Блондинка...\r\n :D \r\nМосква, гостиница «Космос», семинар компании «1С». Нас четверо, но один\r\nопаздывает на сутки. Зато есть другой товарищ, Антон, случайно\r\nоказавшийся в Москве. При поселении я объяснил, что место в моем номере\r\nнеобходимо зарезервировать для прибывающего утром. «Без проблем! » -\r\nответил мне взмыленный администратор, и мы заняли два двухместных номера\r\nрядом. Поскольку одно место должно было пустовать до утра, я предложил\r\nАнтону не ехать к родственникам к черту на рога, а переночевать в\r\nгостинице, на что он радостно согласился. Бросили мы вещи и поехали в\r\nЦМТ на «Дискографию» Нового Диска.\r\nВернулись мы, все четверо, почти в пять утра. Бодрость –\r\nсоответствующая. Я спросил на стойке свой ключ, оказалось, что его уже\r\nвзял сосед. «Шустрый Антон», - подумал я. В номере я обнаружил, что\r\nАнтон уже лег, накрылся с головой и заснул. Я моментально упал на\r\nсоседнюю кровать и тоже почти заснул. Почти – потому что помешали стуки\r\nв дверь. Сквозь дрему я слышал, как Антон объяснял, что не фиг к нам\r\nстучать. Опять я почти заснул, опять стуки, опять Антон попробовал\r\nсберечь мой сон, причем сделал стучащим несколько неожиданное заявление:\r\n«Антон уже спит». Я удивился своеобразной манере речи и опять почти\r\nзаснул. Не судьба. Снова, блин, стуки, но Антон, видать, устал бороться\r\nза спокойный сон. Пришлось мне самостоятельно продирать глаза. Упс,\r\nАнтона на соседней койке нет. Я открыл дверь, за дверью – Антон и\r\nНаталья, член нашей маленькой делегации, которая должна спать в соседнем\r\nномере. Наталья укоризненно попеняла мне: «Ну зачем же ты закрылся и не\r\nоткрываешь, Антон спать хочет. » Я попытался понять, как это бывает:\r\nАнтон спит в номере, отбивается от ломящихся в номер маньяков, потом\r\nоказывается снаружи, а дверь, которую я только что открыл – на цепочке.\r\nЯ понял, что ничего не пойму, поэтому, не вступая в дискуссии, быстро\r\nлег в постель и стал грустно думать: это белая горячка? Так вот она\r\nкакая... Антон, тем временем, моментально разделся и лег туда, где, по\r\nмоему разумению, он уже давно спал. Наталья, прежде чем уйти, приписала\r\nмне авторство фразы «Антон уже спит». Ага, у меня еще и раздвоение\r\nличности. Я снова попытался заснуть, хотя мысль о белой горячке не\r\nспособствовала душевному равновесию.\r\nИ тут в туалете кто-то спустил воду! Я глянул на соседнюю кровать –\r\nАнтон там. А кто в туалете? Впрочем, гадать долго не пришлось, из\r\nтуалета появился незнакомый гражданин и быстренько лег в постель Антона.\r\nНо все ж в последний момент обнаружил, что постель, из которой он\r\nнедавно выбрался в туалет, уже не пуста.\r\n– Ты женщина? – спросил незнакомец, почти не удивившись.\r\n– Нет, – честно ответил Антон.\r\n– Тогда иди отсюда, – незнакомец принимал решения молниеносно. Казалось,\r\nчто для него ситуация вполне привычна: спал, вышел в туалет, вернулся, в\r\nпостели – мужик. Что тут такого-то?\r\nПохоже, он веселился вечером не меньше нашего. До меня дошло – какой-то\r\nфранчайзи «1С» по пьяни ошибся номером. И это он отбивался от стучащего\r\nАнтона. Ура, белая горячка отменяется! Воодушевленный этой мыслью, я\r\nпротрезвел и вмешался:\r\n– Сударь, - сказал я, - Вы ошиблись номером. Здесь Вы не живете. Вы\r\nживете в другом номере. А здесь живет Антон. Так что не надо ложиться к\r\nнему в постель, а надо узнать, где Вы, собственно, живете и культурно\r\nтуда отправиться.\r\nНезнакомец оказался сообразительным, все понял сразу. Но не совсем.\r\n– Я живу здесь, - ответил он. – Вот мой ключ.\r\nТак, быстро объяснить не получилось. Ладно.\r\n– Как Вас зовут? – я вспомнил, что старик Карнеги рекомендовал\r\nобращаться по именам.\r\n– Толик, - ответил товарищ.\r\n– А меня Виталик. Так вот, Толик, сейчас Вам предстоит найти гостиничную\r\nвизитку и посмотреть на ней, в каком номере Вы живете.\r\nТолик попробовал еще раз предъявить ключ, но я твердо настаивал на\r\nвизитке. Он таки ее нашел. Оппаньки! А ведь он живет именно здесь!\r\n– Вот, - предъявил визитку Толик. – Кстати, как тебя зовут?\r\n– Виталик, - ответил я.\r\nТеперь все стало совсем понятно. Эти враги из администрации гостиницы\r\nзабили на мою просьбу зарезервировать место в моем номере для Макса,\r\nкоторый прилетит утром, и подселили мне другого. Заселение вместе\r\nнезнакомых людей на этих семинарах – обычное дело. А я, не разобравшись,\r\nпорушил сладкий сон своего соседа. Чувство вины накрыло меня. Что ж,\r\nотослал Антона к соседям, он там, бедолага, переночевал на полу.\r\nИзвинился перед Толиком. Сходил к администраторам. Без толку, даже не\r\nизвинились. Дескать, «я селю на свободные места, а тот, кто Вам обещал\r\nместо зарезервировать, будет послезавтра, у нее и узнавайте, почему не\r\nзарезервировала». Вернулся в номер, еще раз извинился. Толик сердито\r\nпоинтересовался, как меня зовут. По-прежнему Виталик.\r\nЯ залег и снова попробовал заснуть. Но разбуженный Толик спать уже не\r\nхотел, он решил принять ванну. Это оказалось не проще, чем поспать:\r\nоткрыть горячую воду ему не удалось. Он стал вызывать по телефону\r\nсантехников, те идти не хотели и пытались проконсультировать юзера по\r\nтелефону, как и куда крутить кран, чтоб получить горячую воду. Толик\r\nпериодически скрывался в ванной, потом отзванивал и говорил, что\r\nочередной способ получения горячей воды не прокатил. Я сунулся с инфой о\r\nтом, что в ванной тоже есть телефон, бегать туда-сюда не обязательно, но\r\nбыл не понят. Зато Толик воспользовался тем, что я высунулся из-под\r\nодеяла, чтобы познакомиться. Я привычно представился, он тоже. Пришел\r\nсантехник, вода появилась. Надо сказать, что возился он несколько минут,\r\nт. е. Толик не тормозил, проблема действительно была. Толик ушел\r\nкупаться. Надежда на сон вспыхнула снова, но ненадолго: у Толика\r\nзазвонил будильник в мобиле. Семь утра. Он его, естественно, не слышал\r\nиз ванной. Впрочем, скоро вышел оттуда, выключил будильник. Познакомился\r\nсо мной. Да, я – Виталик, он – Толик.\r\nЯ снова рассказал, почему у нас такая беспокойная ночь. Толик слушал с\r\nплохо скрываемой неприязнью, но и с интересом, явно узнал много нового.\r\nПотом сказал, что не обижается, и не против ли я, если он покурит и\r\nпосмотрит телевизор. Я, подавленный чувством вины, был не против. Он\r\nпокурил, открыл окно, включил телевизор и по мобильнику громко\r\nпересказал кому-то события ночи. Мое чувство вины возросло, я спрятался\r\nпод одеяло.\r\nБолтаясь между явью и сном, я думал, что за интерес смотреть все утро\r\nмультики про Дональда Дака. Странный все-таки этот Толик. И не настолько\r\nуж я виноват. Высунувшись из-под одеяла с целью настоятельно\r\nрекомендовать сменить канал или уровень громкости, я обнаружил, что в\r\nномере один. Толик ушел, оставив открытое окно и включенный телевизор.\r\nТипа, отомстил. Ладно, я выключил окно, закрыл телевизор. Ну или\r\nнаоборот, короче – СПАТЬ!\r\nЧерез пару часов кое-как я вытащил свое тело на завтрак. Вернувшись в\r\nномер, обнаружил там Толика. Уже трезвого.\r\n– Привет, - сказал он. – Как тебя зовут?\r\n– Виталик. Еще раз извини за беспокойную ночь. Я был убежден, что место\r\nв номере забито для моего коллеги. – И я еще раз объяснил, что за хрень\r\nпроисходила ночью.\r\n– Козлы, - мрачно сказал Толик. Формально это относилось к администрации\r\nгостиницы, но при этом он пристально смотрел мне в глаза.\r\nОказалось, что он москвич, семинар «с проживанием» выбрал для удобства,\r\nчтоб на дорогу не тратиться. Но в оставшиеся три дня я его не видел.\r\nНаверно, он решил, что пробки на дорогах – не так уж страшно.\r\n :D \r\nСтрашная история... Но подлинная. Я когда ее услышал, дотошно проверял\r\nна правдивость, увы... Многочисленные свидетели божатся памятью всех\r\nвождей, что правда.\r\nНу а вот сама история.\r\nРаботал на российском чемпионе среди автомобильных заводов (ВАЗ) некий\r\nуже взросло-старый чел(да он и сейчас, наверное, там работает), ну,\r\nпусть будет ВД. Этот чел занимался обслужмванием балансировочных\r\nстанков. Одним из моментов возни со станками было запихивание пластилина\r\nв специальные дырочки на шпинделях, чтобы шпинделя крутились совсем уж\r\nровно, без малейших биений. Под это дело ВД таскал с собой\r\nздоро-о-о-овый кусман пластилина. Причем таскал его дело не по делу и\r\nдомой, и на работу, и опять домой.\r\nИ вот однажды ребята из бригады открыли его "дипломат", взяли этот\r\nкусман пластилина и вылепили из него роскошных размеров... ПЕНИС!\r\nПоложили обратно в дипломат и прикрыли газеткой. ВД идет через\r\nпроходную, тетка на вахте просит его открыть "дипломат", что-бы\r\nпроверить не выносит ли чел запчасти, ВД ничего не подозревая мило\r\nулыбаясь распахивает чемодан, газетка предательски съезжает, являя миру\r\nшедевр художественной лепки. Судя по описаниям очевидцев и,\r\nнепосредственно тех кто лепил, пенис получился такой, что все античные\r\nстатуи плакали от стыда и зависти.\r\nВоенизированная охранница завизжала то ли от ужаса, то ли от восторга,\r\nВД по инерции продолжал улыбаться, а когда заглянул в свой чемодан, едва\r\nне заорал сам...\r\nКороче задержание по полной программе... Составление акта...\r\nНа следующий день вызывает ВД начальник отдела и говорит, точнее орет:\r\n"Ты что?! На старости лет совсем сдурел?! Ты зачем с собой ПЛАСТИЛИНОВЫЙ\r\n%УЙ носишь?!!! " ВД вяло отмазывался, мол это не я такого горбатого\r\nслепил... А какие то падлы завистники. Но как тут оправдаться, когда\r\nналицо огромный %уй из пластилина, да еще с документами из ВАЗовской\r\nмилиции...\r\nВот такая история. Повторяю, все так и было.\r\n :D \r\nСтарый детский анекдот:\r\n- что может быть хуже, чем надкусить яблоко и увидеть там червяка?\r\n- надкусить и увидеть пол-червяка (вариант – не увидеть его вообще)…\r\n\r\nВ бумагах одной из фирм увидели – генеральный директор Негей Сергей\r\nИванович. Посмеялись мы с коллегами, пожалели его, представив, каково\r\nему представляться и сколько однотипных ответов получает он в ответ.\r\nПомолчали…\r\n- А ведь могло быть и хуже – задумчиво сказал один из коллег.\r\n :D \r\nЗАПАХ.\r\n\r\nМои родители очень часто уезжали куда-нибудь оставляя меня одного дома,\r\nоставляли запас провизии, деньги и от меня требовалось только одного,\r\nчтобы по их приезду квартира оставалась в целой и хотя бы относительно\r\nубранной.\r\n\r\nДо приезда родителей оставалось 3 дня.\r\n\r\nВ это утро я проснулся с дикой жаждой деятельности.\r\nДень был распланирован: барахло под диваны, остатки еды со сковородок\r\nкастрюль и тарелок в унитаз, грязные носки в мусор, мусор с балкона.\r\nЭнтузиазм помешанный на желании быстро избавиться от геммора уборки дал\r\nсвои результаты.\r\nВнешне квартира выглядела девственно чистой. Правда немного напрягал\r\nунитаз. Я упресовал в него все что находилось неликвидного из продуктов\r\nна кухне, от полбанки прокисших огурцов до толстого жира со сковородки и\r\nпол кастрюли померших макарон, и он перестал оперативно спускать воду.\r\nПри нажатии на слив, вода быстро наполняла унитаз до краев и вздохнув,\r\nмедленно уходила в вонючую даль…\r\nНо этот факт на фоне комплексного анализа чистоты квартиры на том момент\r\nбыл всеголишь фоном, я решил что рассосется со временем и свалил по\r\nличным делам из дома.\r\n\r\nДо приезда родителей оставалось 2 дня.\r\n\r\nНе рассосалось!\r\n\r\nВо время утреннего похода в сортир я напрочь забыл про новую особенность\r\nсливной системы унитаза. Поссамши и посрамши я нажал на слив и какое-то\r\nвремя заворожено следил за круговоротом стайки какашек судорожно\r\nсоображая, перельется за край или нет. Не перелилось но и не собиралось\r\nуходить прочь. Точнее уходило но очень медленно. Появилась новая\r\nпроблема. До тех пор пока уровень воды в унитазе не опустится ниже\r\nположенной ватерлинии, «ходить» в туалет становилось опасно, хотя бы по\r\nодной простой причине, что сидя на сральнике, можно было реально\r\nзамочить яйца. Я засек время слива, чтобы как-то спланировать походы по\r\nнужде. В принципе по времени выходило что в течении дня реально сходить\r\nв сортир 5-6 раз, что совпадало с моим циклом, и решив законсервировать\r\nпроблему ( можно было сделать вид при родителях что я и сам удивлен\r\nнеработоспособностью унитаза и снять с себя решение этой проблемы), я\r\nсвалил по личным делам из дома.\r\n\r\nДо приезда родителей оставалось 1 день.\r\n\r\nЗаконсервировать не удалось.\r\n\r\nВо время утреннего похода в сортир я снова напрочь забыл про новую\r\nособенность сливной системы унитаза.\r\nЯ добавил в душу унитазу новой порции отходов моей жизнедеятельности ( а\r\nименно говна ), и нажав на слив с ужасом вспомнил о засаде. В унитазе\r\nфактически у края бортов, уже плавала целая флотилия какашек, и я понял\r\nчто удивление неработоспособностью унитаза съиграть не удастся, такую\r\nфлотилию не реально собирать за один раз.\r\nПроблема переросла в катастрофическую. Я понял что проблему придется мне\r\nрешать самому.\r\nЯ решил лоКАЛизовать задачу и проанализировать причины проблемы, дабы\r\nвыработать меры по устранению.\r\nТак как я учился на 1 курсе физического факультета, я выявил проблему\r\nслива в жире, который я наковырял со всех сковородок и вывалил в\r\nсральник. Я решил что жил прилип к стенкам сливного жерла унитаза,\r\nзаблокировав слив.\r\nА как бороться с жиром? Правильно! Горячей водой!\r\n( Время было советское и цивилизация о всяких там утенках и доместосах\r\nеще и не догадывалась.) Я вскипятил два ведра воды до постоянно\r\nбулькающего кипятка. Сняв ведра с плиты я попер их в направлении\r\nсортира. Чтобы открыть дверь в сортир, мне пришлось поставить одно ведро\r\nна пол в коридоре и вновь подняв его я обнаружил что прожог аккуратную\r\nдырку по окружности дна ведра с кипятком в паласе и линнолиуме.\r\n\r\n( Это были первые но не последние жертвы МЧС.) Я вылил оба ведра в\r\nунитаз и выскочил на время из сортира из-за жуткого тумана который там\r\nобразовался. Когда туман рассеялся я проник внутрь и ужаснулся\r\nсделанному……\r\nВода и не собиралась уходить и если раньше какашки плавали в твердом\r\nагрегатном состоянии, с четкими формами и различными цветами, то теперь\r\nсодержимое унитаза представляло собой нечто однородное, похожее на суп\r\nпюре с единым колером от борта до борта, и …..\r\n\r\nИ появился ЗАПАХ!?!?! Эта масса жутко воняла, не давая возможности\r\nнаходиться в сортире без средств химзащиты!\r\nУ меня произошел нервный срыв! Блиц криг не удался, а проблема переросла\r\nв неустранимую, решить которую можно было только бросанием жилья и\r\nпереселением в новую квартиру. ( срыв произошел и у моего кота. Он свлил\r\nна улицу и на отрез отказывался возвращаться.)\r\n\r\nС мыслью –«ебись оно все конем», я лег спать. ( Сон - это лучшее\r\nсредство с проблемами. А от человека способного разбудить спящего вообще\r\nможно ожидать любой подлости! )\r\n\r\n1 сутки как родители должны были приехать.\r\n\r\nМеня разбудил телефонный звонок родителей. Они сообщили, что задержатся\r\nеще на сутки.\r\nСудьба вновь дала мне фору. Все таки провидение любит настойчивых и\r\nупорных. Сон убавил стресс, и дал новых сил и энтузиазма.\r\nПервым делом я пошел осмотреть фронт работ. Уровень воды ( или гарбича\r\nкрем-брюле), за ночь не изменился и я понял что она окончательно\r\nперестала уходить.\r\n\r\nЭТО ЗАСОР!\r\n\r\nСделав выводы из вчерашней неудачи, я решил больше не дилетанствовать и\r\nобратиться к опыту специалистов. Были просмотрены энциклопедия на слово\r\nЗАСОР, пролистаны книги по строительству и домоводству. В руки мне\r\nпопалась брошюру по гражданской обороне, где я прочитал главу о защите\r\nпри химическом заражении. План действий был выработан и состоял из двух\r\nпунктов.\r\n\r\n1. Максимально оградить себя от соприкосновении с агрессивной средой.\r\n2. Выковырять источник засора рукой.\r\n\r\nПо моим расчетам, руку надо было совать по плече, и лицо по идее должно\r\nбыло оказаться на ватарлинии. Я был на грани нервного срыва.\r\n\r\nЯ стащил в кучу со всей квартиры все спец средства для экипировки и\r\nнапялил на себя.\r\nНа руки я нашел резиновые перчатки немысленного размера, сверху я одел\r\nпилотный комбинезон и куртку пуговицами назад на подобие хирургических\r\nхалатов, на голову лыжную шапку с прорезями для глаз и маску с трубкой\r\nдля подводного плавания. На трубку я нацепил конец резинового шланга,\r\nвторой конец а протянул на балкон и свесил наружу, дышать было трудно но\r\nвозможно. И в завершении на голову я одел пожарный шлем с гребнем.\r\nспизженый годом ранее. Просто так одел, на всякий случай.\r\nОдевался я тщательно и долго, стараясь максимально оттянуть время часа\r\nикс. Когда я уже был одет уже ничто не могло задержать меня перед\r\nоперацией спасения сральника, раздался звонок в дверь.\r\n\r\nЭто пришел друг-сосед с этажа выше Костян. С порога он заявил что какая\r\nсука из квартиры 51, неделями не выносит мусор из дома и второй день в\r\nподъезде стоит жуткая вонь, аж до его квартиры уже дошло, и он открыл\r\nвсе окна дома, но ни хрена не помогает.\r\nУвидев меня он на секунду остолбенел, и начал истерично ржать. Он сделал\r\nбыло шаг ко мне в квартиру и тут же отшатнулся.\r\n- Так это от тебя так говнищем прет? Чуваккк, меня аж пошатнуло! Ты че\r\n  сдесь творишь вообще?!?!?! ( А мне как то наверно уже привонялось, так\r\n  как запах я чуял только в эпицентре радиусом 1-1.5 метров. Все таки\r\n  мощные защитные ресурсы у организма.)\r\n\r\nЯ в кратце поставил его в курс событий, в ответ он дико ржал, он реально\r\nмог бы помереть наверное от смеха если б не вонь, которая приводила его\r\nв чувства как нашатырь. Придя в себя Костян сообщил мне что я сраный\r\nинтеллигент, и щас притащит мне прибор для устранения засора. Прибором\r\nоказался длинный скрученный в спираль трос, с круглым металлическим\r\nнаболдажником. Он отказался заходить в квартиру, сославшись на дела \r\n(сука) но показал как управляться с прибором, типа суй, крути и тащи.\r\n\r\nЯ так и сделал. Всунул, крутнул и потянул. Унитаз сказал ЧПОК, и глубоко\r\nвздохнув, всасал в себя весь гарбич.\r\n\r\n1 сутки как родители приехали.\r\n\r\nЯ на нервной почве я проспал часов 12. На всю ночь я пооткрывал все\r\nокна, пытаясь проветрить помещение, и ни один комар не влетел! Дырку в\r\nлиннолиуме я замаскировал остатками паласа, и в принципе сдача квартиры\r\nродителям прошла без эксессов. Правда они все принюхивались, но\r\nисточника они так и не нашли и списали на кота.\r\n\r\nP.S. Неделю я мылся в ванной по 3 раза в день, поливая себя одеколоном.\r\nМеня преследовал запах.\r\n :D');
INSERT INTO zforums_posts_text VALUES (327, 'd52d6a4d03', '', 'Анекдоты 28.01:\r\n :D \r\nВ кабинет к гинекологу заходит девушка.\r\nВрач в хорошем настроении:\r\n- Девушка! Какая вы хорошенькая - вся такая беленькая, кофточка у вас\r\n  беленькая, брючки беленькие, сумочка и туфельки беленькие!\r\nДевушка (радостно):\r\n- Да, доктор, у меня еще и молочница!\r\n :D \r\n- Совершил с женой паломничество к святому источнику. Молился там...\r\n- Ну и чего?\r\n- Да ничего. Никакого чуда не случилось. С той же женой и вернулся.\r\n :D \r\nРешил господь бог поправить дела в российской медицине и устроился\r\nрайонным врачом в поликлинику. Приходит на прием, к нему первый пациент\r\n- паралитик на коляске. Бог ему руки возлагает на голову и говорит:\r\nвстань и иди. Тот встал и пошел. Выходит в коридор, там очередь до\r\nулицы, его спрашивают: ну, как новый? - Да как все они - даже давление\r\nне померил.\r\n :D \r\n- Ты чем такой озабоченный?\r\n- Да вот думаю, как в однокомнатной квартире можно разместить семьдесят\r\n  пять человек, приглашенных женой на годовщину нашей свадьбы...\r\n- Так у тебя что - круглая дата?\r\n- Нет, у меня жена - круглая дура!\r\n :D \r\n- Девушка, вы выглядите чем дальше, тем лучше!\r\n- Ой, спасибо!\r\n- А чем ближе, тем хуже...\r\n :D \r\nЧеловек со странностями не странен. Странен тот, у кого своих\r\nстранностей нет совсем!\r\n :D \r\nТуркменские ученые-биологи после нескольких лет научных исследований\r\nсделали сенсационное открытие: у Евгения Петросяна обнаружено чувство\r\nюмора!!\r\n :D \r\nВсякий нормальный чиновник убежден в том, что существует два вида\r\nсобственности: частная и честная.\r\n :D \r\nПрислушайся к голосу разума!\r\nСлышишь? Слышишь, какую чушь он несет?!\r\n :D \r\nКарты экспресс-оплаты ГИБДД 10, 50 и 100 условных единиц!\r\nДля корпоративных VIP клиентов новый тарифный план "Эксклюзив" - всего\r\nза 1000 уе в месяц все нарушения бесплатно!\r\nПодключите дополнительные услуги: "Любимое нарушение" - скидка 50% на\r\nлюбое одно выбранное вами нарушение!\r\n"Антирадар" - антиопределитель скорости и вашего номера.\r\nДополнительная информация - у менеджеров в офисах ГИБДД!\r\n :D');
INSERT INTO zforums_posts_text VALUES (328, '106f6133aa', '', 'Истории 28.01:\r\n :D \r\nВчерашний день мне принес много радости. И даже не потому, что вчера\r\nмне отдали старинный долг..."\r\n\r\nИстория первая.\r\n\r\nСт. метро Маяковская, 9:30 утра, первый вагон, первая дверь. Обычно\r\nкогда люди выходят на этой станции, да и вообще из вагона, те кому\r\nвыходить не надо вдавливаются в стенку, чтобы 1) не помешать толпе\r\nвыходящих 2) не вынесли из вагона насильно. Кто видел знает.\r\nКартина такая: все выходят, а около двери стоит в полоборота\r\nвнушительных размеров женщина, и конкретно мешает ВСЕМ выходящим. Все\r\nпро себя слагают ее и ее родню в три этажа, но молчат. Тут один мужик \r\nне выдержал:\r\n- Вы бы хоть прижались!\r\nА тетка эта так жааааалостливо...\r\n- К кому?...\r\nМне даже жалко ее стало!\r\n\r\nИстория вторая.\r\n\r\nПриходится расплачиваться за свои ошибки и пересдавать военную кафедру,\r\nдля чего два дня подряд нужно ходить туда и изучать секретные части\r\nкомплекса С-300, ибо не выдают литературу на дом. Сижу, мечтаю... Надо\r\nсказать, что почему-то на меня некая апатия наваливает на войне. Сижу...\r\nнастроение наихеровейшее... думаю... майоры ходят, подполковники... и\r\nвдруг вспоминается мне Шекспир "Весь мир театр, а люди в нем актеры". \r\nИ вдруг я понимаю, что Шекспир был только отчасти прав, и моя больная,\r\nвзбудораженная войной фантазия начинает выдавать: \r\nВесь мир кунсткамера, а люди в нем уроды.\r\nВесь мир бордель, а люди - суки, бляди.\r\nВесь мир аптека, люди в нем кондомы.\r\nВесь мир роддом, а люди эмбрионы.\r\nВесь мир дурдом, а люди в нем шизойды.\r\nВесь мир гейклуб, а люди педерасты.\r\nи все в таком духе...\r\nи наконец: Весь мир война, а люди в нем майоры.\r\n\r\nИстория Третья.\r\n\r\nВозвращаюсь домой по 10-й линии Васильевского острова (Питер). Смотрю -\r\nбабуля с двумя внучиками гуляет. Слышу, бабуля говорит:\r\n- Не надо, Вася, по лужам прыгать, а то промочишь ногу, а мама всего\r\n  ругать будет.\r\n :D \r\nВо время празднования 250-летия МГУ проводилось такое мероприятие -\r\nэстафета от исторического музея до новой библиотеки на Воробьевых горах:\r\nстуденты в одинаковых желтых курточках передают факел. Холодно, все\r\nустали и замерзли... Мимо организованно проходит группа школьников, один\r\nподошел и спросил: "Против чего бастуете?"\r\n :D \r\nРазмышления о жизни моей 5-летней дочери:\r\n\r\nУвидев трансформаторную будку с нарисованным черепом, пронзенным молнией\r\nнавылет, начинает излагать свою версию произошедшего: - Дядя залез туда,\r\nего ударило светом, он подох… (замирает на секунд 5, набирает в грудь\r\nвоздуха и выпаливает)… а потом ОН УМЕР!!\r\n\r\nПрихожу за ней в сад, мне в лоб задается вопрос:\r\n- Мама, можно я выйду замуж за Пашу??!!\r\nЯ начинаю что-то мямлить, судорожно вспоминая советы психологов по\r\nданному поводу, и решив перекинуть с больной головы на здоровую, говорю\r\nчто не знаю, надо с папой посоветоваться. Вечером, когда мой усталый муж\r\nприполз с работы, дорогое чадо с сияющими глазками задает тот же вопрос.\r\nМуж впадает в ступор. Он еще не готов к такому повороту событий. Слишком\r\nрано! Наконец он решается спросить у меня:\r\n- А Паша это кто?\r\nЯ начинаю ему описывать:\r\n- Нууу такой щекастенький, полненький мальчик….\r\nМуж облегченно:\r\n- Нет, доча, за Пашу нельзя, он вон какой толстый, мы его не прокормим.\r\nРебенок затихает, укладывается спать. Утром, только войдя в детсадовскую\r\nгруппу, громко объявляет о своем решении:\r\n- За Пашу замуж не пойду! Придется за Диму выходить!!!\r\n(Дима, маленькое заморренное создание, на голову ниже моей дочери).\r\nВыходя из детского сада я плакаль. Диму мы наверно прокормим….\r\n :D \r\nДело было, когда я была молоденькой, наивной и малоопытной девушкой.\r\n(или так выглядела). После окончания универа так трудно, грустно, пусто\r\nи неинтересно казалось в Научно-исследовательском институте. Время,\r\nродители, подруги, то и дело выскакивающие замуж, затачивали все\r\nмыслительные процессы в одном направлении. На режимном предприятии было\r\nневозможно встречаться со всеми желанными однокурсниками, т.к. в\r\nлаборатории был ограниченный доступ. Бравые начальники то ли потехи\r\nради, то ли из соображений режимности ругали невинных девушек, если к\r\nним на "перемене" пятиминутке для разгибания измученных конечностей\r\nприходили "господа офицеры" - бывшие однокурсники. Пришлось тоже\r\nорганизовать "офицерское собрание" и ограничить доступ туда людям из\r\nполитеха. Иерархия начальников была такой: Начальник сектора, начальник\r\nлаборатории, начальник отдела, начальник подразделения... И так до\r\nбесконечности наверное. Про каждого начальника молоденьким\r\nспециалисточкам рассказывали всякие байки, наверное с долей истины. Ну\r\nтипа, как они за кем ухлестывали и кто в чем был замечен.\r\nОднажды пользуясь ГРД (гибкий рабочий день), отрабатывая заимствованные\r\nчасы, я осталась совершенно одна в лаборатории. Вдруг дверь без стука\r\nраспахнулась. Вошел весьма респектабельный мужчина лет сорока наверное.\r\nЯ ему из своего угла кричу, что сюда нельзя, ни в коем случае. Выйдете\r\nсейчас же!!! Вместо этого, он довольно нагло вошел в лабу, и стал шарить\r\nна столе у начальника. Я ему говорю. Сейчас же уходите, а он, чтоб\r\nразговор поддержать спраживает:" А начальник то где?" А я откуда знаю,\r\nгде он может быть в нерабочее время. Была зима, он был одет в какую-то\r\nофигительную зимнюю шапку и пальто. Выглядел совсем не так большинство в\r\nэто время. Тут он шапку снял и я, присмотревшись поняла, что это\r\nначальник то ли подразделения или следующий за ним. Я все слова\r\nпроглотила от ужаса, и тихо тихо интимно так ему говорю, подойдя\r\nдовольно близко. "Я НЕ УЗНАЛА ВАС В ОДЕЖДЕ, извините". Тут пришла его\r\nочередь впадать в шоковое состояние. Лицо его приобрело характерное\r\nвыражение, для перебирающего в памяти. Он посмотрел на меня с диким\r\nужасом и вышел. Через несколько лет я узнала, что институт оплатил ему\r\nдорогущую операцию на сердце. Я понимаю его, нервная работка, но видно,\r\nон БОЛЬШОЙ СПЕЦИАЛИСТ СВОЕГО ДЕЛА. Решение по этому вопросу принимал\r\nпрофком, а там ну просто все женщины.\r\n :D \r\nНавеяно историей о том, как автозамена превратила Гаира в ГИБДДра.\r\n\r\nОдин дружок мой писал рассказ, типа фэнтези, и там был рыцарь Поль. Весь\r\nтакой благородный прям :-) а тут супружница увидала и взмолилась - не\r\nнадо Поля!! у нее, оказываеццца, с этим имечком неприятные воспоминания\r\nсвязаны :-(( Так одного мудопляса прозывали в школе, был он Поль от\r\nслова Поляков /фамилие такое/ и ее, бедолашку, в детстве дразнил.\r\nКороче, не катит имя Поль для благородного рыцаря ;-) Ну, с женой\r\nотношения обострять из-за ерунды негоже... ему не один ли фиг? что Поль,\r\nчто не Поль... разве важно для сюжета... перекрестил персонажа в Рауля.\r\nПоменял имя автозаменой.\r\nВ итоге другой герой возглашал:\r\n- Это для вашей же раульзы!\r\n :D \r\nГолод не тетка.. И не дядька, это однозначно.\r\nВчера к вечеру (а как же иначе!) у директора случился очередной приступ\r\nжелания произвести глЫбокий анализ.\r\nВ связи с этим прискорбным фактом двум сотрудницам пришлось остаться\r\nпосле работы.\r\nЧасикам к семи-восьми им захотелось есть. Зверски так. И пошли девчонки\r\nшарить по нычкам. Нашли банку с какими-то хлопьями.\r\nУ нас есть дама, страшно увлекающаяся здоровым питанием и вечно жующая\r\nгранулированные отруби и прочую дрянь.\r\nДевчонки решили, что это очередная разновидность "здоровой пищи".\r\nКое-как сжевали они эти хлопья.\r\nУтро.\r\nДевчонки обсуждают:\r\n- Ну как Л. может есть такую гадость? На вкус хуже опилок и воняет.\r\nТут заходит Л.:\r\n- Никто не видел, куда девались хлопья из стекляной банки? Я рыбкам\r\n  новый корм купила, хочу на пробу покормить. Если будут хорошо лопать,\r\n  еще докупим.\r\nРжал весь офис.\r\nТеперь мужики вокруг бедных девчонок ходят кругами и "заботливо"\r\nинтересуются, не начинают ли у них отрастать жабры. \r\n :D \r\nПример мужской логики.\r\nУ мелкого в классе 17 человек, из них только пять девочек. Естественно,\r\nони чувствуют себя королевами. Мальчишки им тягают конфеты и все такое.\r\nРазговор малого с Каролиной вечером в раздевалке.\r\n- Тебе кто больше нравится - я или Ваня?\r\n- Ваня. Он меня конфетами угощает.\r\n- Ну и глупо. Конфеты съешь - и все, а с фамилией всю жизнь жить.\r\n- А при чем тут фамилия? - теряется Каролина.\r\n- А при том. Ты вот за него замуж выйдешь и всю жизнь будешь Дубко.\r\n  Хочешь?\r\n- Нет! - мотает головой Каролина.\r\n- Вот видишь. А у меня такая фамилия! - соблазняет даму малой.\r\nВечером рассказываю мужу. Тот высказывает полную солидарность:\r\n- Молодец, все логично ей объяснил. Запомни, сынок, логика - это сила.\r\n- Ага, и конфеты целее будут, - скромно соглашается сынок.\r\n\r\nКто о чем...)))))))))\r\n :D \r\nВозвращались мы недавно с женой и четырехлетним сыном из гостей. \r\nТемно, холодно, скользко. Ребенок идет между нами, держа нас за руки. \r\nНа какой-то скользкой выбоине ноги у него уезжают вперед, и он повисает \r\nу  нас на руках. Мы с женой пытаемся его поднять, тянем вверх. \r\nРебенок не  особенно нам помогает, висит на руках и смотрит в небо. \r\nЖена не выдерживает:\r\n- Денис, ну давай вставай.\r\n- Мама, папа, смотрите какая луна большая и красивая.\r\nРебенка таки уронили.\r\n :D \r\nИсторией про рыбалку навяло...\r\nДавненько это было, еще в 80-х прошлого века, а запомнилось.\r\nСидим как-то втроем: Вовка, Пашка и я на Ильмень-озере по зиме, клюет\r\nслабо, ветер "с моря", лед как зеркало, ни одного снежного перемета,\r\nтолько редкие холмики замерзшего ледяного крошева из лунок, до берега\r\nкилометра два, машины на берегу оставлены из-за тонкости льда. Ветер\r\nтакой не слабый, что рукавицы и ящики свободно сдувал, приходилось\r\nбегать за ними, если зазеваешься. Народу вдоль берега мало, и только\r\nмористее нас группа энтузизистов энтузизиснее нас, человек из десяти,\r\nсмотрятся как черточки на горизонте. Километра три до них наверное было.\r\nА ветер как раз точно от них дует.\r\nНу сидим, скучно, замерзать начали. Первым не выдержал я, и хоть мне\r\nбаранку крутить, размечтался о бутылочке водовки, о чекушке на худой\r\nконец, да где ее взять, с вечера не позаботились. Вдруг слышим какой-то\r\nзвук, оборачиваемся, а к нам яшик едет! Абсолютно реальный рыбацкий ящик\r\nиз дюраля и без хозяина. У этузизистов у кого-то сдуло, видимо пока к\r\nтоварищам на стопарик бегал. Прямо в Пашку и уткнулся. "Так-с, посмотрим\r\nкак там клюет у них в море," сказал Пашка, открыл ящик и продолжил: "Два\r\nокушка, плотвичка и четыре ерша. Не густо. Хуже чем у нас, а вот это нам\r\nкстати!" И извлек из ящика бутылку водки. У нас челюсти чуть лед не\r\nпроломили, но стали возражать, мол нечестно, мужик сам надеется и т.д.\r\nи т.п. Но Пашкин аргумент был железным: "Раз в такую погоду и при таком\r\nклеве сам не выпил и с товарищами не поделился, то он ее до дома довез\r\nбы и под одеялом выпил бы! Хрен ему! Термос и закусь не тронем, а пузырь\r\nмы конфисковываем в пользу страждущих и замерзающих!" С этими словами он\r\nзахлопнул ящик, застегнул защелку и сильным мягким пинком отправил его в\r\nсвободное путешествие. Мы мгновенно со своими ящиками и нехитрой закусью\r\nпридвинулись Пашке и естественно раскатали пузырь. На троих. Стало\r\nзаметно теплее и веселее.\r\nЗапыхавшийся хозяин нарисовался только где-то через полчаса. Без\r\nтулупа, только в валенках, ватных штанах, толстенном свитере и без\r\nрукавиц. "Мужики, ящик мимо вас не пробегал?" Бегающие глазки и крысиная\r\nморда доверия не внушали и мы дружно ответили "нет". Через минут\r\nдвадцать проехал его тулуп, а потом и мы снялись.\r\n :D \r\nВстретил своего знакомого Костю. Вот его рассказ, почти слово в слово:\r\n\r\nЯ Таню любил с 9-го класса.\r\nБыло все - дискотеки, стихи и долгие гуляния-провожания, но дальше\r\nпоцелуев в засос не зашло.\r\nПотом мы закончили школу.\r\nРазъехались кто куда…\r\n\r\nВстретил ее почти через 10 лет. Повел в ресторан, заехали ко мне,\r\nтрахнул ее в разных позициях, включая минет и тп...\r\n\r\nПосле всего Таня лежит в постели, затягивается сигаретой и говорит:\r\n- Костя, ты изменился в лучшую сторону!..\r\n :D');
