INSERT INTO zforums_posts_text VALUES (383, 'c387704943', 'Как зарегистрировать клан', 'Теперь в каждом городе появился второй филиал Великой Ассоциации по Надзору за Кланами.\r\n\r\nВы можете зарегистрировать свой клан не выходя из города. Здание размещается в:\r\nКапитолии у людей и эльфов, некромантов и еретиков\r\nСокровищнице III уровня у гномов\r\nВысшем совете у друидов\r\n\r\nЦена за регистрацию клана: [b:c387704943]5000000[/b:c387704943] в основных единицах.');
