INSERT INTO zforums_posts_text VALUES (567, '7725462200', '', '[quote:7725462200="Kazus-Factor"]не так всё и плохо было (: вот, Негован тут рядом на диване валяецца (:[/quote:7725462200]\r\n\r\nВроде ничего сходили. Компания прикольная. Только мы под конец (я и тейдер) приуныли, т.к. не пили вместе со всеми, ибо не пьём. :) А так - весело.\r\n\r\n\r\n"А смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, смысл, ..." (С) :)');
