INSERT INTO zforums_posts_text VALUES (350, '7dc0308137', '', 'Анекдоты 29.01:\r\n :D \r\nАрабский шейх путешествовал по Европе и влюбился в европейку. Вот ее\r\nпапа рассказывает своим приятелям:\r\n- Короче, он мне говорит - если вы ее за меня замуж отдадите, я заплачу\r\n  за нее столько золота, сколько она весит. Ну, я ему отвечаю, что в \r\n  таком вопросе спешить не надо, поговорим через месяц.\r\n- Да, ты прав, эти шейхи с их странными законами... тут надо подумать.\r\nПапа:\r\n- Тут думать не надо. Тут девочку кормить надо!\r\n :D \r\nЗамечали вы, что люди, которые опаздывают, часто намного более веселы,\r\nчем люди, которые должны их ждать?\r\n :D \r\n- Мне очень понравилась ваша последняя книга «Как обращаться с\r\n  подростками». Только я замахнулся ею на моего недоросля, как он тут же\r\n  прекратил огрызаться!\r\n :D \r\nКак бы вы назвали то, что итальянец имеет одну руку короче чем другой?\r\nДефект речи.\r\n :D \r\n«Три белых коня…» - песня пьяного шахматиста.\r\n :D \r\nВопрос армянскому радио: В каком больничном отделении у пациентов самая\r\nлучшая жизнь и почему?\r\nОтвет: в проктологическом. Потому что у них каждый ужин - при свечах.\r\n :D \r\nДон Жуан никогда не имел бы столько амурных побед, если бы у него был\r\nтолько один талант - как привязать к себе любую женщину, и не было бы\r\nталанта - как от любой отвязаться.\r\n :D \r\n- Как же вы там, в космосе, находитесь без вина, без женщин?\r\n- А вот за это нам и дают героев!\r\nИз интервью космонавта Юрия Усачева, «Частная жизнь», Россия, 19.11.04\r\n :D \r\nНет еще в сети такого сайта знакомств, в котором не водились бы\r\nкрокодилы.\r\n :D \r\nЭстонская поговорка: Обещанного 33 года ждут.\r\n :D \r\nЛекарство от лени: "Пиздалгин" - прописывается в кабинете начальника.\r\n :D \r\nПравила женатого мужчины: \r\n1. Проснувшись утром, полюби жену, может сегодня будешь первым.\r\n2. Выйдя на улицу, раздай детям конфеты, может среди них есть твои.\r\n3. Всегда уступай место пожилым мужчинам, может среди них есть твой\r\nотец.\r\n :D \r\n- Итак, дорогой мой будущий зять, я с удовольствием даю согласие\r\n  переложить руку моей дочери из своего кармана в ваш..\r\n :D \r\nПрограммист на собеседовании слушает требования работодателя:\r\n- Вы должны свободно писать код в Delphi, Java, C++, в совершенстве\r\n  знать Oracle, MS SQL, DB2, оперативно решать все возникающие у\r\n  сотрудников фирмы проблемы с компьютерами, обслуживать сеть, телефонную\r\n  станцию... Вы что-то хотели спросить?\r\n- Да. Утюги в runtime не надо ремонтировать?\r\n :D \r\nВдогонку...\r\nвы - родом из СССР, если:\r\n- увидев толпу людей в коридоре спрашиваете - кто крайний?\r\n- будучи за границей из русских песен готовы спеть «Катюшу» и «Союз\r\n  нерушимый»\r\n- даже работая в крупной западной фирме, знаете, что работа не волк и\r\n  любит дураков\r\n- при снятии денег идете не в банк или банкомат, а в сберкассу\r\n- вы все еще верите в светлое будущее\r\n- на новый год всегда покупаете мандарины, делаете тазик оливье и\r\n  покупаете много водки\r\n- уверены, что валюта бывает и жидкой\r\n- слова «ну, поехали» не связаны для вас с поездкой\r\n- твердо знаете, что собаку Рейгана звали Рональд\r\n- еще помните что надо ответить на «партия сказала надо»\r\n- знаете минимум 5 способов приготовления крепких спиртных напитков в\r\n  домашних условиях\r\n- считаете пятницу праздником перед выходными\r\n- чистые алюминивые ложки в столовой считаете хорошим сервисом\r\n- знаете дословную расшифровку аббревиатур – ИТР, ОТК, ГТО, ГОЭЛРО, ЦК\r\n  КПСС, КПЗ, НКВД, ГУЛАГ, итд, итп\r\n- при обращении к милиционеру говорите «командир», «товарищ сержант»,\r\n  или «гражданин начальник»\r\n- знаете ответ на вопрос «если в кране нет воды»\r\n- помните как правильно завязывать пионерский галстук\r\n- с грустной улыбкой вспоминаете, что в СССР секса не было\r\n- не забыли фамилии тех, кто первыми водрузил флаг на Рейхстаг в 1945-м\r\n- и вам все еще хочется туда вернуться…\r\n :D');
INSERT INTO zforums_posts_text VALUES (351, 'e6df011f76', '', 'Истории 29.01:\r\n :D \r\n- Добрый вечер! - сказала белая лошадь.\r\n- Э, здравствуйте, - ответил Павел, со слезами на глазах вспоминая\r\n  рассказы людей о симптомах белой горячки.\r\n- А вы откуда? - вежливо спросила лошадь.\r\n- Из Медведково, - сказал Паша, медленно вспоминая, есть ли у него\r\n  сигареты, спички, зажигалка, газовый баллончик и все прочее необходимое\r\n  когда у вас ночью в парке спрашивают откуда вы.\r\n- Хм-мм-м, а вы случайно не пьяный? - усомнилась лошадь, принюхавшись\r\n  и фыркнув.\r\n- Совсем нет! - храбро соврал Паша, надеясь, что тут-то запах и сгинет\r\n  в тумане.\r\n- Hу тогда извините... А у вас деньги на такси есть, а то я подвезу?\r\n- Hет, не надо, - с достоинством ответил Павел, и сообразив, что это\r\n  невежливо, добавил, - Я сегодня зарплату получил, вот...\r\n- До свидания, молодой человек, - сказала лошадь и, медленно\r\n  повернувшись, ушла в туман.\r\n- До свидания, белая лошадь, - с облегчением вздохнул Паша. \r\nОтветом ему был дружный хохот патруля конной милиции, выведенной на \r\nдежурство в парке в этот вечер.\r\n :D \r\nВ гостях... надо некоторое время исполнить обязанности гостя....\r\nпоиграть с хозяйским ребенком (2.5 года)...\r\nТот возюкает краски руками по бумаге.... краски в баночках, только \r\n4 цвета...\r\nНачинаю рассказывать про каждую краску...\r\n\r\n- Синяя... - ей нарисуем небо... , Желтая... - ей нарисуем солнце... ,\r\n  Зеленая... - ей нарисуем травку... , Красная.. - ей нарисуем... э-э-э...\r\n  полусладкое...\r\n\r\nРодители-хозяева ржут...\r\nЖаль, ребенок не оценил...\r\n :D \r\nВ Минске на авторынке правоохранительные органы устроили серьезную\r\nпроверку, чтобы деньги за аренду мест и т.д. не шли мимо кассы. Дело\r\nбыло серьезное, поэтому после его завершения вся администрация рынка\r\nбыла очень зашугана и на входе в администрацию появилось следующий\r\nшедевр:\r\n"Вход в администрацию рынка с долларами США КАТЕГОРИЧЕСКИЙ ЗАПРЕЩЕН"\r\n :D \r\nВчера еду с работы домой. Снег, ветер, холод, в общем, отвратительно.\r\nСтою на остановке и жду свою маршрутку. А ее все нет и нет, а люди все\r\nподходят и подходят. И наконец, вот она, которую все так ждали.\r\nЕстественно, все лезут напролом. Я влезла последней. Все, кто стоят, \r\nстоят буквой "зю". Сами понимаете, какая высота потолков. Передо мной \r\nстоят парень с девушкой. И вот она ему говорит:\r\n- Лучше "конем" ехать в маршрутке, чем "ферзем" стоят на остановке. \r\nВот как.\r\n :D \r\nНа двери профкома висит табличка: "Идет заседание!", ниже прикреплена\r\nзаписка: "По важным и срочным вопросам и в холодильник входить можно"\r\n :D \r\nЛекция по геодезии. Препод диктует быстро.\r\nМолодой человек, не успевая что-то записать, поворачивается к девушкам\r\nсписать.\r\nПрепод:\r\n- Студент, не приставайте к девушкам. Лучше меня вам никто не даст!\r\n :D \r\nМне теперь стал насильно-бесплатно приходить журнал "Американ Бейби":\r\n"Ученые Великобритании обнаружили, что если младенцев после обеда\r\nрегулярно выгуливать на свежем воздухе, то они спокойнее спят по\r\nночам..." Господи, чем только не заняты эти ученые фиговы.\r\n"Исследования показали, что если ребенка регулярно ронять головой на\r\nкафельный пол, то его умственные способности могут несколько понизиться.\r\nПроверено, что среди таких детей число выпускников Гарварда на 16% ниже,\r\nчем среди обычных детей алкоголиков."\r\n :D \r\nКоротко.\r\nВремя - Середина конца девяностых.\r\nМесто - автомобильный пограничный переход в Бресте.\r\nОчередь на 6-10 часов.\r\n\r\nНесколько относительно благополучных семейств во время зимних школьных\r\nканикул направляется в Словакию покататься на лыжах.\r\nВ пространстве между шлагбаумами свирепствуют цыгане - люди без\r\nпаспорта. Как они туда попадали?\r\nТычут в окна младенцев, дергают все, что привязано на багажнике, хотят\r\nденег и очень громко и настойчиво это втолковывают сидящим в автомобилях\r\n"терпельцам".\r\n\r\nОбычно, не получив ничего в течение пары минут "обработки", стайка\r\nцыганят бежала сканировать очередь дальше. Здесь случилось, что\r\nшести-семи летний цыганенок задержался, уставившись на своего\r\nбелобрысого сверстника за стеклом. Чтоб время зря не пропадало,\r\nпроситель не забывал громко причитать о своих финансовых потребностях и\r\nвыразительно тянуть грязненькую ладошку.\r\n\r\nВизави цыганенка, видно, вошел в положение. Но поскольку он был\r\nпослушным мальчиком, а родители приказали денег цыганятам не давать\r\n("сбегутся, не отобьешься!")...\r\nВ общем, в открытое окно был протянут жетончик cо словами:\r\n- "БУДЕШЬ В МИНСКЕ - НА МЕТРО ПРОКАТИШЬСЯ".\r\n :D \r\n"Абонемент ГИБДД" отдыхает...\r\n\r\nЖиву в Америке, штат Вашингтон. Сильно достали меня здешние копы - на\r\nлапу не берут принципиально, а вот чтобы прицепиться к чему-то, то ****\r\nеще те. Да и штрафы здесь выходят в несколько сот зеленых и бьют по\r\nкарману ощутимо.\r\n\r\nРешил, в общем, купить я себе антирадар. То, что в штате Вашингтон\r\nантирадар иметь вполне легально, и новейшие системы для обведения вокруг\r\nпальца полицаев чинно занимают место в автожурнале, наряду с\r\nпротивоугонными системами и моторным маслом, уже само по себе\r\nзаслуживает внимания. Но главный прикол не в этом. Покупаю я значит себе\r\nантирадар. Дорогой, правда ($250), но клевая штука, засекает за\r\nполкилометра, когда тебя еще коп и не видит-то. Вместе с радаром\r\nприсоединяется гарантия (дословный перевод):\r\n\r\n"Если в течение года с покупки товара вас оштрафовали за превышение\r\nскорости при использовании антирадара, вышлите копию штрафа нашей фирме\r\nи мы вам возместим убытки".\r\n\r\nКруто! Оказывается, покупаешь раз в году такой радарчик, и гоняй себе по\r\n200 км/ч, все штрафы возместит компания. Ну чем не "абонемент на \r\nнарушения от ГИБДД"? :)))\r\n :D \r\nЕсть у меня дядька. Нормальный мужик, спокойный такой, рассудительный. \r\nИ есть у него родной брат – такой здоровенный, благодушный и весьма,\r\nкстати, состоятельный. И вот недавно построил этот братан себе коттедж –\r\nбольшой, двухэтажный, с мансардой, камином, баней и прочими радостями.\r\nКоттедж и вправду получился на славу – ну все есть, что душе угодно.\r\nСпустя некоторое время переехали они туда с семьей жить и, как водится,\r\nсобрали новоселье – народу наприглашали целую толпу. Дядька с женой,\r\nесссно, тоже приехали.\r\n\r\nСначала гости пошли осмотреть «имение». Снаружи все облазили, внутри во\r\nвсе углы заглянули, ну все посмотрели, потрогали, не переставая\r\nнахваливать, конечно же. «Ай какая парилка, ай какой бассейн, ну\r\nмолодцы, хозяева, ай да молодцы!». Все в таком духе. А дядька мой ходил\r\nи скромно помалкивал. Сели за стол, хозяин сказал «поехали» и понеслось.\r\nВ начале тосты, понятное дело, были за новый дом, за строителей, потом\r\nза каждую комнату в отдельности и т.д. и т.п. Дядька скромно молча\r\nвыпивает, закусывает и о чем-то своем думает. Выпили уже и за веранду, и\r\nза зимний сад и за бильярд… Потом за евроокна, за финскую мебель, за\r\nитальянские люстры… И вот тут мой дядька не выдержал. Поднимает от\r\nтарелки голову, смотрит на братана и во все услышание произносит:\r\n\r\n- А вот СКВОРЕЧНИКА-то у тебя и нету!!!!!!!!!\r\n :D');
