INSERT INTO zforums_posts_text VALUES (673, '39c168c4f9', 'Локальный сервер', '[size=18:39c168c4f9][color=blue:39c168c4f9]Внимание! Я установил локальный сервер для клиентов сети MatriX. Адрес: http://venta.local Траффик с него не тарифицируется, но! \r\n1) Работает он не круглосуточно, а когда включен мой компьютер. Обычно с 18:00 до 23:00.\r\n2) Работать он будет, если окажите мне материальную помощь в его содержании. А именно, оплата траффика. Из-за того, что сервер находится у меня (а БД в интернете), то SQL запросы жрут ЛИЧНО МОЙ траффик. Мне, как Вы понимаете, это крайне не желательно. Посему прошу содействовать оплате минимального пакета для траффа. Посмотрим сколько они (SQL запросы) едят. Думаю, что немного =&gt; надеюсь, мин. пакета хватит.[/color:39c168c4f9][/size:39c168c4f9]');
