INSERT INTO zforums_privmsgs_text VALUES (27, 'fc7cb00289', 'Спасибо, Дима, что ответил :) \r\nВ общем, вопросы есть и их не мало:\r\n1)почему  у меня за неделю обнулились все характеристики и опыт;\r\n2)почему мне уже 3 раза пришлось регистрироваться на форуме;\r\n3)куда делись мои здания;\r\n4)каким образом мне может помочь клан, если он даже не запоминает своих членов....\r\n\r\nПеребор с вопросами? :oops: \r\nСпасибо!');
INSERT INTO zforums_privmsgs_text VALUES (28, '9f19f7ec90', 'Ответ:\r\n\r\nСпасибо, Дима, что ответил :) \r\nВ общем, вопросы есть и их не мало:\r\n1)почему  у меня за неделю обнулились все характеристики и опыт;\r\n\r\nМы проводили понижение всех уровней в 10 раз. Потом распределяли опыт по уровням и начисляли очков на повышение в количестве Уровень*5. Это было нужно чтобы добиться баланса.\r\n\r\n2)почему мне уже 3 раза пришлось регистрироваться на форуме;\r\n\r\nВот про форум сложнее. Не у тебя одной он работает плохо. Честно говоря, у меня всё ОК, по этому, мне трудно судить о его проблемах. Прости. Если додумаюсь - обязательно сообщу.\r\n\r\n3)куда делись мои здания;\r\n\r\nРаз в неделю происходят всякие землетрясения и т.д. Из-за этого рушится город\r\n\r\n4)каким образом мне может помочь клан, если он даже не запоминает своих членов....\r\n\r\nа) Он запоминает. Просто я его переименовал по просьбе малого и надо заного в него вступить. Вот и всё.\r\nб) Я ещё не полностью допрограммровал модуль кланов.\r\n\r\nПеребор с вопросами? :oops: \r\n\r\nНет. Всё нормально.\r\n\r\nСпасибо!\r\n\r\nНадеюсь, смог помочь. Если что, пишите, отвечу.\r\n\r\nЖелательно сюда: admin@nld.spb.ru');
